at fly forward in a path in front of him, dealing damage to all enemies hit and applying Bees to them."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage:"",""value"":""60/115/170/225/280 (+80% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":9381,""Summary"":""Swarm"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1956_93811.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""75/80/85/90/95"",""description"":""Ah Muzen Cab sprays honey at a moveable ground target location, Slowing all enemies in the area. Bees from Hives within 90 units and Swarm will fly over to protect the honey, dealing damage every .5 second and applying Bees! to all enemies as they leave the honey."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""13/25/37/49/61 (+15% of your Physical Power)""},{""description"":""Slow:"",""value"":""20%""}],""secondaryDescription"":""""}},""Id"":9423,""Summary"":""Honey"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1956_94231.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Ah Muzen Cab fires off an enormous stinger that deals damage to all enemies in a line, sticking into the first god that is hit, applying Bees! and Crippling them for 3 seconds.  If the target dies or after 3 seconds, the stinger falls onto the ground for 4 seconds.  If Ah Muzen Cab picks up his stinger, he gains a significant reduction to Stinger's Cooldown."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""70""}],""rankitems"":[{""description"":""Damage:"",""value"":""275/355/435/515/595 (+110% of your Physical Power)""},{""description"":""Retrieval Cooldown Reduction:"",""value"":""80%""}],""secondaryDescription"":""""}},""Id"":9393,""Summary"":""Stinger"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1956_93931.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Enemies afflicted by Bees! take damage every .5s for 2s, are revealed on the minimap, and swarm nearby enemies. Basic Attacks refresh and extend the duration of Bees! by 1s, and any target afflicted for 4s is Disarmed for 1s (10s Cooldown between Disarms)."",""menuitems"":[{""description"":""Ability:"",""value"":""Pet""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage per tick:"",""value"":""9 (+6% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":9380,""Summary"":""Bees!"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1956_93801.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.016,""Cons"":"""",""HP5PerLevel"":0.71,""Health"":450,""HealthPerFive"":7,""HealthPerLevel"":73,""Lore"":""It is said that history is written by the victors, but what happens when the victors say nothing? Everything that came before would be lost. Events, mythology, even identity. The victors – the survivors – could become anyone. Even Gods. Ah Muzen Cab is suspiciously devoid of a past, but the God of Bees enjoys the privileges of worship and ceremony. Privileges that, perhaps, he stole.\\n\\nLong ago, the sky was propped above the land by four beings, the Bacab. They endured their task without complaint, and for their service, were honored by the Mudmen beneath. In truth, the Bacab were prisoners, shackled by duty. Then, a great flood consumed the earth. Seizing their chance, the Bacab fled and the sky crashed into the rising sea. Into that terrible storm they vanished, never to be seen again.\\n\\nAs the seas retreated, new Bacab stepped in to hold the sky aloft. The land reemerged, and from it mankind was born. Gods appeared; patrons of the sustaining forces of life, like agriculture and fertility. And the bee, creator of honey, used to sweeten food, as medicine for the sick, and to produce mead for rituals, was revered, and Ah Muzen Cab arrived, as if from nowhere, as their God.\\n\\nNow, as the greatest war between the heavens clashes on earth, what will remain when the dust has settled? Who will be the victor that writes history? If Ah Muzen Cab was, indeed, one of the original four Bacab, he survived the end of the world once and became a God. What power will he seize this time when the new world is made?"",""MP5PerLevel"":0.38,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":230,""ManaPerFive"":4.4,""ManaPerLevel"":40,""Name"":""Ah Muzen Cab"",""OnFreeRotation"":"""",""Pantheon"":""Mayan"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.2,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Movement Speed, High Attack Speed"",""Roles"":"" Hunter"",""Speed"":365,""Title"":""God of Bees"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""40"",""description"":""Bees swarm at the ground target location, creating a new Hive that provides movement and Attack Speed Buffs to Ah Muzen Cab.  He also heals for a small amount every second while he remains close to the Hives. Hives reveal enemies within 20 units of them. The Hives can only be destroyed by Basic Attacks (maximum 6 Hives)."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target