ption"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius/Corpse Radius:"",""value"":""20 / 25""}],""rankitems"":[{""description"":""Initial Damage:"",""value"":""60/70/80/90/100 (+10% of your Magical Power)""},{""description"":""Damage per Corpse:"",""value"":""60/85/110/135/160 (+25% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":11374,""Summary"":""Corpse Explosion"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2056_113741.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""70"",""description"":""Ah Puch throws a charm from the underworld which awakens a decaying corpse that applies miasma to targets in an area and falls to the ground, remaining behind. Targets take damage every second. After the duration, targets take additional damage and are stunned if they were healed by an ability during the initial duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""13""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""30/35/40/45/50 (+20% of your Magical Power)""},{""description"":""Additional Damage:"",""value"":""50/100/150/200/250 (+50% of your Magical Power)""},{""description"":""Stun Duration:"",""value"":""1.5s""},{""description"":""Duration:"",""value"":""4s""}],""secondaryDescription"":""""}},""Id"":11394,""Summary"":""Fleeting Breath"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2056_113941.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Ah Puch unleashes an army of Wraiths from the Ninth Hell that swarm forward and deal damage to enemies they collide with."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""50""}],""rankitems"":[{""description"":""Damage per Wraith:"",""value"":""40/50/60/70/80 (+10% of your magical power)""},{""description"":""Duration:"",""value"":""6s""}],""secondaryDescription"":""""}},""Id"":11364,""Summary"":""Empty the Crypts"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2056_113641.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Ah Puch is closely attuned with the dead and may exhume corpses at his will. When walking over a decaying corpse, Ah Puch lowers the cooldown of Undead Surge and Corpse Explosion by 2s, restores 5% of his maximum Health and 3% of his maximum Mana."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Max Corpses:"",""value"":""6""},{""description"":""Corpse Lifetime"",""value"":""45s""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":11361,""Summary"":""Hollow Ground"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2056_113611.jpg""},""AttackSpeed"":0.86,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":400,""HealthPerFive"":6,""HealthPerLevel"":75,""Lore"":""Buried beneath the crust of the world descends the cruel hells of torment. The topmost of which are realms of torture and vile inhumanities, home to denizens of darkness and malice. Yet, further into the black below, at the inkiest recesses can be found the horrific ninth hell. Here dwells a deity of true evil, gloating over each corpse he’s claimed with macabre glee, and relishing the moment more of these lesser souls are his. He is Ah Puch, the mightiest lord of the ninth hell.\\n\\nWhen night falls, Ah Puch roams the land, crowned by a wreath of human eyes, gruesome skull face bared for all to witness, accompanied by the shriek of ghostly owls. All that live are his for the taking. If Ah Puch finds a human in the night, he kills and drags the unfortunate into endless oblivion. Only those already wracked by his servants, those caught in gut-wrenching wailing, moans of agony, and fits of mania are safe from his touch.\\n\\nHide now, all men and Gods, for the age of eternal night has come. Ah Puch will reap anything that lives. There is great vacancy left in the nine hells, and the Horrific God of Decay wishes only to fill it."",""MP5PerLevel"":0.42,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":175,""MagicalPowerPerLevel"":7.5,""Mana"":265,""ManaPerFive"":4.9,""ManaPerLevel"":55,""Name"":""Ah Puch"",""OnFreeRotation"":"""",""Pantheon"":""Mayan"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":9,""PhysicalProtectionPerLevel"":2.7,""Pros"":"" High Area Damage"",""Roles"":"" Mage"",""Speed"":365,""Title"":""Horrific God of Decay"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""70/75/80/85/90"",""description"":""Ah Puch raises up to two decaying corpses from the underworld that surge forward exploding on anything they touch, when they reach max distance, or when Ah Puch reactivates Undead Surge dealing damage and slowing targets hit. The corpses collapse after exploding remaining behind."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/110/130/150/170 (+35% of your magical power)""},{""description"":""Slow:"",""value"":""20/25/30/35/40%""},{""description"":""Slow Duration"",""value"":""3s""},{""description"":""Corpses Dropped:"",""value"":""1/1/2/2/2""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""8s""