nly Reflection"",""Ability3"":""Glorious Charge"",""Ability4"":""Dazzling Offensive"",""Ability5"":""Illuminating Strike"",""AbilityId1"":12046,""AbilityId2"":12055,""AbilityId3"":12047,""AbilityId4"":12049,""AbilityId5"":12072,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""9s"",""cost"":""50/55/60/65/70 "",""description"":""Amaterasu harnesses the power of her jewel, healing herself every second for 4 seconds and creating a persistent aura that buffs nearby allied gods. Every time this ability is activated the aura switches between Valor and Benevolence. "",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Allies""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Heal Per Tick:"",""value"":""15/25/35/45/55 (+5% of your Physical Power)""},{""description"":""Benevolence Aura:"",""value"":""5/10/15/20/25 % Move Speed""},{""description"":""Valor Aura:"",""value"":""15/20/25/30/35 Bonus Power""}],""secondaryDescription"":""""}},""Id"":12046,""Summary"":""Divine Presence"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/01/Icons_God72_A01.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""70/75/80/85/90"",""description"":""Amaterasu charges her mirror for 5 seconds. While the mirror is charging she takes decreased damage. By activating the ability again or at the end of 5 seconds she will fire her mirror straight ahead, dealing damage. The mirror can be charged by successfully attacking enemies or from taking damage, and will deal up to double the base damage when fully charged."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Self Damage Mitigation:"",""value"":""3/6/9/12/15%""},{""description"":""Mirror Damage:"",""value"":""50/90/130/170/210(60% of your Physical Power)""},{""description"":""Full Charge Damage:"",""value"":""100/180/260/340/420""}],""secondaryDescription"":""""}},""Id"":12055,""Summary"":""Heavenly Reflection"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/01/Icons_God72_A02.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""70/75/80/85/90 "",""description"":""Amaterasu shines light off of her sacred blade, silencing all enemies in front of her. She then dashes forward while dealing damage, piercing through minions or stopping at the first god hit.  "",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Silence Duration:"",""value"":""1s""},{""description"":""Dash Damage:"",""value"":""70/130/190/250/310(60% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":12047,""Summary"":""Glorious Charge"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/01/Icons_God72_A03.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""75s"",""cost"":""100"",""description"":""Amaterasu focuses the power of the heavens into an impressive 3 strike combination attack. The 2nd hit will do 20% more base damage and slow enemies. The 3rd hit will do 40% more base damage and stun enemies. She must hit an enemy target with each hit to progress the combo."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""35""}],""rankitems"":[{""description"":""Damage Per Strike:"",""value"":""75/125/175/225/275 (+50% of your Physical Power)""},{""description"":""Slow Duration:"",""value"":""2s""},{""description"":""Stun Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""Id"":12049,""Summary"":""Dazzling Offensive"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/01/Icons_God72_A04.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Amaterasu illuminates enemies she hits with basic attacks. After 3 hits on the same target the enemy gains an aura, exposing their weaknesses and causing them to take more damage from all sources. Any other enemies that come near the afflicted target are weakened as well."",""menuitems"":[{""description"":""Ability:"",""value"":""Debuff""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Weakening Aura:"",""value"":""10% Increased Damage Taken""},{""description"":""Stack/Aura Duration:"",""value"":""5s""},{""description"":""Max Auras Possible:"",""value"":""3""}],""secondaryDescription"":""""}},""Id"":12072,""Summary"":""Illuminating Strike"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/01/Icons_God72_Passive.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.8,""Health"":470,""HealthPerFive"":8,""HealthPerLevel"":82,""Lore"":""As the first rays of dawn cross the horizon, before all else they touch the land of the rising sun. A realm of islands painted with the careful brush strokes of its deities. That morning light, which brings warmth and life is Amaterasu, the benevolent Goddess of the sun. Universally, she is adored. \\n\\nLess so are her brothers, namely Susano-o, bringer of storms, whose jealousy of his sister’s popularity drove him to burn her golden rice fields and shatter the sacred looms of her people. Grief stricken at the destruction, Amaterasu sealed herself inside a deep cavern. Her people suffered and the realm fell into crushing darkness. \\n\\nFor an unknown time, she stayed there, hidden away from the atrocities of the world. Until, one day, came a thumping from outside. At first, she tried to ignore it, but curiosity called. Moving aside the great stone sealing the cavern, she peered cautiously out, only to stare into a polished bronze mirror. Blinded by her own reflection, Amaterasu was forced to creep further out to find the source of the sound. Hands grabbed her from either side and pulled her free of the cave. Gathered around were hundreds of friends and loved ones. Atop a wide tub danced Usume, Goddess of Mirth, creating the erratic drumming to the joy of all. Amaterasu smiled and light came back to the world. \\n\\nSeeing all those that depended on her, all those that loved her, Amaterasu vowed never again to hide away from calamity. She would, instead, face it, just as the dawn rises each new day."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":4.8,""ManaPerLevel"":35,""Name"":""Amaterasu"",""OnFreeRotation"":"""",""Pantheon"":""Japanese"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.0,""PhysicalProtection"":18,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Area Damage, High Mobility"",""Roles"":"" Warrior"",""Speed"":375,""Title"":""The Shining Light"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""9s"",""cost"":""50/55/60/65/70 "",""description"":""Amaterasu harnesses the power of her jewel, healing herself every second for 4 seconds and creating a persistent aura that buffs nearby allied gods. Every time this ability is activated the aura switches between Valor and Benevolence. "",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Allies""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Heal Per Tick:"",""value"":""15/25/35/45/55 (+5% of your Physical Power)""},{""description"":""Benevolence Aura:"",""value"":""5/10/15/20/25 % Move Speed""},{""description"":""Valor Aura:"",""value"":""15/20/25/30/35 Bonus Power""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""70/75/80/85/90"",""description"":""Amaterasu charges her mirror for 5 seconds. While the mirror is charging she takes decreased damage. By activating the ability again or at the end of 5 seconds she will fire her mirror straight ahead, dealing damage. The mirror can be charged by successfully attacking enemies or from taking damage, and will deal up to double the base damage when fully charged."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Self Damage Mitigation:"",""value"":""3/6/9/12/15%""},{""description"":""Mirror Damage:"",""value"":""50/90/130/170/210(60% of your Physical Power)""},{""description"":""Full Charge Damage:"",""value"":""100/180/260/340/420""}],""secondaryDescription"":""""}},""abilityDescription3"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""70/75/80/85/90 "",""description"":""Amaterasu shines light off of her sacred blade, silencing all enemies in front of her. She then dashes forward while dealing damage, piercing through minions or stopping at the first god hit.  "",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Silence Duration:"",""value"":""1s""},{""description"":""Dash Damage:"",""value"":""70/130/190/250/310(60% of your Physical Power)""}],""secondaryDescription"":""""}},""abilityDescription4"":{""itemDescription"":{""cooldown"":""75s"",""cost"":""100"",""description"":""Amaterasu focuses the power of the heavens into an impressive 3 