.  In addition, Sorrow grants Anubis an additional 30% reduction to all Crowd Control durations."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff/Debuff""},{""description"":""Affects:"",""value"":""Self/Enemy""}],""rankitems"":[{""description"":""Stolen Per Tick:"",""value"":""7""},{""description"":""Magical Lifesteal Scaling per Stack:"",""value"":""(pexistspprop1026/0.33/+#/+33% of your lifesteal)""},{""description"":""Duration:"",""value"":""5s""},{""description"":""Max Stacks:"",""value"":""3""}],""secondaryDescription"":""""}},""Id"":7547,""Summary"":""Sorrow"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1668_75471.jpg""},""AttackSpeed"":0.86,""AttackSpeedPerLevel"":0.009,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":350,""HealthPerFive"":7,""HealthPerLevel"":66,""Lore"":""Jackal-headed Anubis holds the ultimate judgment over the dead, measuring every heart against the weight of Truth.\\n\\nNephthys, wife of Set - the God of Darkness, desired a child, yet her husband was infertile, so Nephthys disguised herself as Isis, the wife of Set’s brother Osiris, and seduced him. From that union, Anubis was born. Osiris cared for Anubis as his own, but when Osiris was murdered by his evil brother, Set, Anubis embalmed his adopted father and mummified the corpse so he would not rot. This preservation passed down to the Faithful, for if it was good enough for the Gods, it was good enough for man.\\n\\nNone enter the abyss of the Underworld without first being tested by Anubis. When corpses are preserved, he is the embalmer. When time for judgment comes, he is the final arbiter. In his realm, he keeps legendary weighing scales. On one side, the massive weight of Ma’at – truth and order. On the other side, he places the heart of the deceased. Should the weight of Ma’at prove infinitely heavier than that of the heart, Anubis casts the soul deep into the darkness of the Underworld, where it is forgotten, never to be reborn."",""MP5PerLevel