 This ability ends after all dragons are used, or after 10s.\n\nAo Kuang may activate this ability again to send forward any remaining dragons in a ranged attack. The dragons damage and Slow the first enemy they hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Stim / Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Range:"",""value"":""55""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Attack Damage:"",""value"":""35/50/65/80/95 (+30% of your Magical Power) per hit""},{""description"":""Ranged Damage:"",""value"":""15/20/25/30/35 (+15% of your Magical Power) per remaining dragon""},{""description"":""Slow:"",""value"":""30%/ for 1s + 0.25s per remaining dragon""}],""secondaryDescription"":""""}},""Id"":10648,""Summary"":""Dragon Call"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2034_106481.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""7s"",""cost"":""60/65/70/75/80"",""description"":""Ao Kuang unleashes a storm of lightning from his sword, damaging all enemies in front of him. This hit is considered a Basic Attack, and will activate item effects."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/125/170/215/260 (+40% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":10736,""Summary"":""Wild Storm"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2034_107361.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""90/100/110/120/130"",""description"":""Ao Kuang grabs a single target, damaging and knocking them into the air. If the target is below a Health threshold, Ao Kuang will also reveal his true form, becoming an airborne Dragon and executing them restoring Health.\r\n\r\nAfter transforming Ao Kuang then picks a new location to land, dealing damage to enemies within range 20."",""menuitems"":[{""description"":""Landing Range:"",""value"":""200""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/140/190/240/290 (+50% of your Magical Power)""},{""description"":""Execute Threshold:"",""value"":""30%""},{""description"":""Heal:"",""value"":""10/15/20/25/30% of maximum Health""},{""description"":""Landing Damage:"",""value"":""100/150/200/250/300 (+50% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":10652,""Summary"":""King of the Eastern Seas"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2034_106521.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Each time Ao Kuang successfully uses his dragon form to execute an enemy god he gains a stack of Magical Power and Lifesteal. Stacks up to 3 times, stacks are permanent."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""}],""rankitems"":[{""description"":""Magical Power Per Stack:"",""value"":""15""},{""description"":""Magical Lifesteal Per Stack"",""value"":""5%""}],""secondaryDescription"":""""}},""Id"":10644,""Summary"":""Dragon King's Sword"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2034_106441.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.02,""Cons"":"""",""HP5PerLevel"":0.7,""Health"":400,""HealthPerFive"":10,""HealthPerLevel"":82,""Lore"":""Regal, powerful, the Dragon-God of the Eastern Sea commands storms and tides with the flick of a claw, yet he seethes with rage for past humiliations.\\n\\nAs one of four Dragon-Gods, Ao Kuang demands tribute from those along the Eastern shores. For their worship, tides remain calm, rivers contained, and rainfall for crops plentiful. It was not always like this, however. Long ago, Ao Kuang grew greedy and expected greater sacrifices. When they were not given, he sent floods, tidal waves, and devastating storms, striking so much fear into the people they dared not speak of this violence to the Jade Emperor. Ao Kuang enjoyed his total control.\\n\\nThen came Sun Wukong to his undersea palace seeking a weapon for his famous journey to the West. Despite the offer of other weapons, Sun Wukong took the Ruyi Jingu Bang, an immense pillar that aided in controlling the tides. It was believed none could even lift it, but Sun Wukong spun it with ease. As if this were not humiliating enough, Sun Wukong demanded other gifts of armor, shoes, and helm, all of which Ao Kuang was forced to supply.\\n\\nNext, the demigod boy Nezha, playing in a stream, inadvertently shook Ao Kuang’s palace. Annoyed, the Dragon-God set forth his favorite scout to kill the child, but Nezha defended himself and the scout was slain. Furious, Ao Kuang ordered his third son to destroy Nezha, yet Nehza slew him as well. Completely outraged, Ao Kuang went to Nezha’s father and threatened to take the issue before the Jade Emperor, but Nezha tackled the Dragon-King and forced him to submit.\\n\\nSuch repeated shame and humiliation have both humbled Ao Kuang and tempered his fury to steely resolve. Long has he awaited his chance to rise again and exert dominance as a great Dragon-God of the Sea."",""MP5PerLevel"":0.41,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":175,""MagicalPowerPerLevel"":12.0,""Mana"":240,""ManaPerFive"":4.8,""ManaPerLevel"":38,""Name"":""Ao Kuang"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Single Target Damage"",""Roles"":"" Mage"",""Speed"":375,""Title"":""Dragon King of the Eastern Seas"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70"",""description"":""Ao Kuang T