Birds"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1898_8740.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90/85/80/75/70s"",""cost"":""100"",""description"":""Aphrodite pledges undying love to herself and her soul mate.  While this is active, her and her soul mate are invulnerable to all damage for a short duration.  All Crowd Control effects are also removed when activated."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self and Soul Mate""}],""rankitems"":[{""description"":""Invulnerability Duration:"",""value"":"".8/1.1/1.4/1.7/2s""}],""secondaryDescription"":""""}},""Id"":8743,""Summary"":""Undying Love"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1898_8743.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Aphrodite gains 4 Physical Protection and 4 Magical Protection for each friendly or enemy god within 70 feet of her."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":13180,""Summary"":""Center of Attention"",""URL"":""""},""AttackSpeed"":0.87,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":380,""HealthPerFive"":6,""HealthPerLevel"":68,""Lore"":""There are too few words to describe the radiance, the magnificence, the inequitable glory of Aphrodite, Goddess of Beauty. So wondrous is she to behold that one look can inspire tears, desire, jealousy, and love. Yet, beneath her flawless exterior resides a heart burdened with insecurity.\\n\\nInattentive and hideous to look upon, her husband, Hephaestus, unknowingly leaves Aphrodite feeling lonely and worthless. She finds consolation in the arms of other men such as Ares, or validation by competing in any contest of beauty she encounters.\\n\\nAt a wedding attended by all the Gods, a golden apple appeared, inscribed with the words \""to the fairest.\"" Immediately Aphrodite, her mother Hera, and sister Athena quarreled over it. Zeus elected Paris, Prince of Troy, to choose a victor. In exchange for being named the fairest, Aphrodite offered any woman in the world as his wife, so Paris agreed. However, he chose Helen as his wife, and their love began the catastrophic Trojan War.\\n\\nNow, a new war brews, but this one between Gods, not men. While the battlefield is no place for the fairest of all, Aphrodite recalls the destruction between the Greeks and Trojans. Perhaps, this time, her beauty can be used to stop a war instead of start one. Perhaps, this time, she will discover the beauty within."",""MP5PerLevel"":0.41,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":160,""MagicalPowerPerLevel"":7.25,""Mana"":240,""ManaPerFive"":4.8,""ManaPerLevel"":43,""Name"":""Aphrodite"",""OnFreeRotation"":""true"",""Pantheon"":""Greek"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":9,""PhysicalProtectionPerLevel"":2.7,""Pros"":"" High Sustain"",""Roles"":"" Mage"",""Speed"":355,""Title"":""Goddess of Beauty"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""16/15/14/13/12s"",""cost"":""50/55/60/65/70"",""description"":""Aphrodite blows a kiss to an allied god, making them her soul mate and giving them both increased movement speed.  If it hits an ally, it has a reduced 3s cooldown.  If the kiss hits an enemy god, they are Stunned and Aphrodite's soul mate gets jealous, increasing their damage. Also, 70% of all Mana regenerated by Aphrodite is granted to her soul mate."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Gods (Enemy or Ally)""}],""rankitems"":[{""description"":""Movement Speed:"",""value"":""4/8/12/16/20%""},{""description"":""Stun Duration:"",""value"":""1s""},{""description"":"