""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/115/160/205/250 (+60% of your Physical Power)""},{""description"":""Movement Speed Buff/Debuff:"",""value"":""5/10/15/20/25%""},{""description"":""Buff Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""Id"":8783,""Summary"":""The Moves"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1899_87831.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""110s"",""cost"":""10 + 40 per second"",""description"":""Apollo rides his chariot across the sky, choosing when to land, dealing damage every .2s for .8s as he lands."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""70/95/120/145/170 (+30% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":8785,""Summary"":""Across The Sky"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1899_87851.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""After 10 successful Basic Attacks, Apollo gains Audacity, attacking with both hands and increasing his Attack Speed by 100% for the next 5 Basic Attacks (hit or miss) he makes."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Attack Speed Buff:"",""value"":""100%""},{""description"":""Buff Duration:"",""value"":""5 Basic Attacks""}],""secondaryDescription"":""""}},""Id"":8754,""Summary"":""Audacity"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1899_87541.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.016,""Cons"":"""",""HP5PerLevel"":0.69,""Health"":450,""HealthPerFive"":8,""HealthPerLevel"":77,""Lore"":""There are none without admiration for Apollo, God of Music. He is brash, cavalier, and dauntless, with the power to bring hope to the hopeless and change the course of battle with a single arrow. Voices of soldiers, mothers, kings and emperors, even Gods rise in glorious melody in honor of him; and he, basking in their adoration, shines victoriously.\\n\\nThough Hera, Queen of Gods, challenged his very birth, sending the great serpent Pylos to slay Apollo, his twin sister Artemis, and their mother Leto, not even she could deny him victory. Merely four days old, Apollo, gifted with a legendary bow, slew the Gaia Serpent and defied Hera.\\n\\nIn his humble youth, Apollo was a cattle herder. The trickster God Hermes stole Apollo’s charges and led them to a nearby cave. From the shell of a tortoise and the body of a cow, he crafted the first Lyre. Apollo finally caught up with Hermes, saw the instrument, and simply had to have it, trading the rest of his cattle to Hermes for it. Years later, Hermes would send his son, Pan, to challenge Apollo in a contest of musical prowess, but Apollo soundly defeated the satyr with dexterous mastery of the Lyre.\\n\\nAs Apollo grew into his rightful place among the Gods, his victories mounted, and the songs of the Faithful were sung more and more in his name. Now, they raise their voices for Apollo to take the field as Gods clash. Never one to deny his adoring public, Apollo prepares for one last show."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":225,""ManaPerFive"":4.6,""ManaPerLevel"":40,""Name"":""Apollo"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":40,""PhysicalPowerPerLevel"":2.6,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":2.7,""Pros"":"" High Mobility"",""Roles"":"" Hunter"",""Speed"":365,""Title"":""God of Music"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""11s"",""cost""