ttps://web2.hirez.com/smite/wp-content/uploads/2015/05/1899.jpg"",""id"":1899,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Venomous Bite"",""Ability2"":""Cocoon"",""Ability3"":""Web"",""Ability4"":""Night Crawler"",""Ability5"":""Predator"",""AbilityId1"":10495,""AbilityId2"":10614,""AbilityId3"":10570,""AbilityId4"":10507,""AbilityId5"":10493,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""60/65/70/75/80"",""description"":""Upon activation, Arachne's next Basic Attack within 5s does additional damage and infects the target with Venom, dealing damage over time and healing Arachne every 0.5s for 3s."",""menuitems"":[{""description"":""Ability:"",""value"":""Stim""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Initial Damage:"",""value"":""50/75/100/125/150 (+35% of your Physical Power)""},{""description"":""Damage per Tick:"",""value"":""10/20/30/40/50 (+10% of your Physical Power)""},{""description"":""Healing per Tick:"",""value"":""10/20/30/40/50 (+10% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":10495,""Summary"":""Venomous Bite"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1699_104951.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70"",""description"":""Arachne spindles her webbing, and her next 3 successful Basic Attacks are executed with increased Attack Speed for 6s. If all 3 Basic Attacks hit the same target, that target is Stunned."",""menuitems"":[{""description"":""Ability:"",""value"":""Stim""},{""description"":""Affects:"",""value"":""Enemies""}],""rankitems"":[{""description"":""Attack Speed:"",""value"":""30/40/50/60/70%""},{""description"":""Stun Duration:"",""value"":""1/1.1/1.2/1.3/1.4s""}],""secondaryDescription"":""""}},""Id"":10614,""Summary"":""Cocoon"",""URL"":""https://web2.hirez.com/smite/wp-content/upl