,""Id"":10507,""Summary"":""Night Crawler"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1699_105071.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Arachne's Basic Attacks gain 1.5% Physical damage for every 5% of a target's missing Health. "",""menuitems"":[{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":10493,""Summary"":""Predator"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1699_104931.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.02,""Cons"":"""",""HP5PerLevel"":0.67,""Health"":445,""HealthPerFive"":9,""HealthPerLevel"":79,""Lore"":""Once, a beautiful and talented weaver of cloth and fabric, a single prideful mistake made a monster of Arachne for all time.\\n\\nWith loom and thread, there were none more skilled than the mortal Arachne. Viewers traveled leagues just to see her art. So wondrous and majestic were her tapestries, it was said the spinner must have been instructed by the patron Goddess of Weavers herself, Athena. To this comparison, Arachne proudly scoffed, claiming not even the Gods rivaled her talent at weaving.\\n\\nWhen Athena heard this, disguised as a crone, she visited Arachne and encouraged her to show proper respect to the Gods. Arachne dismissed the old woman and issued a challenge that no God, not even Athena, could weave better than she. Furious, Athena revealed herself and accepted the challenge.\\n\\nThey both set to the loom with fervor. Athena wove a glorious tapestry depicting her battle with Poseidon over the city of Athens. Her detail and imagery were exquisite. Yet Arachne’s weavings depicted Zeus in his many infidelities with mortals. So flawless, so lifelike was her artistry, not even Athena could refute the skill, nor could she contain her anger at such a sleight. Violently, she tore Arachne’s tapestry and pressed a finger to Arachne’s forehead. Twisting in anguish, Arachne fell to the ground as additional legs grew from her body, screaming as she transformed into the first spider.\\n\\nIt was an act of anger and pity, a lesson and a curse, for spiders are the greatest of weavers, and Arachne, in particular, was to weave for all time, but none could doubt the consequence for Arachne’s pride. Still, within her twisted heart, Arachne never forgave Athena, consumed by a dark hatred that can be sated only by the destruction of the Gods."",""MP5PerLevel"":0.46,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":210,""ManaPerFive"":4.8,""ManaPerLevel"":41,""Name"":""Arachne"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.2,""PhysicalProtection"":13,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Single Target Damage, Great Jungler"",""Roles"":"" Assassin"",""Speed"":375,""Title"":""the Weaver"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""60/65/70/75/80"",""description"":""Upon activation, Arachne's next Basic Attack within 5s does additional damage and infects the target with Venom, dealing damage over time and healing Arachne every 0.5s for 3s."",""menuitems"":[{""description"":""Ability:"",""value"":""Stim""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Initial Damage:"",""value"":""50/75/100/125/150 (+35% of your Physical Power)""},{""description"":""Damage per Tick:"",""value"":""10/20/30/40/50 (+10% of your Physical Power)""},{""description"":""Healing per Tick:"",""value"":""10/20/30/40/50 (+10% of your Physical Power)""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70"",""description"":""Arachne spindles her webbing, and her next 3 successful Basic Attacks are executed wit