eld, engulfing enemies in a cone in front of him causing damage every .5s for 4s.  Ares is immune to Knockback for the duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""15/20/25/30/35 (+7% of your Magical Power)""},{""description"":""% Max Health per Tick:"",""value"":""1/1/2/2/3%""}],""secondaryDescription"":""""}},""Id"":8286,""Summary"":""Searing Flesh"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1782_82861.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""100s"",""cost"":""80/85/90/95/100"",""description"":""Ares throws chains out to all enemy gods in an area around him. All enemies hit by the chains are pulled to Ares after 2.5s, taking damage and are Stunned."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy Gods""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""35""}],""rankitems"":[{""description"":""Damage:"",""value"":""200/275/350/425/500 (+40% of your magical power)""},{""description"":""Stun:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":8316,""Summary"":""No Escape"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1782_83161.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Each completed aura item that Ares owns grants him 30 additional Magical Power."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":8317,""Summary"":""Blessed Presence"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1782_83171.jpg""},""AttackSpeed"":0.9,""AttackSpeedPerLevel"":0.011,""Cons"":"""",""HP5PerLevel"":0.67,""Health"":485,""HealthPerFive"":8,""HealthPerLevel"":90,""Lore"":""Feared by his enemies, reviled by his father, adored by the Goddess of Beauty, and worshipped by warriors, Ares, a tortured and lonely soul, is the bloodthirsty Greek God of War.\\n\\nAres is not loved by the people. He represents everything they fear and despise: war, strife, chaos, and murder. It’s said that the sky darkens when Ares takes the field. That he rides to battle on a chariot drawn by fire-breathing steeds and delights only in the clash of battle and smell of bloodshed.\\n\\nAres is not loved by his father. Zeus has many sons, but only two with his wife Hera. However, the thunder God has long suspected Hera of having an affair that led to the birth of Ares, perhaps as revenge for all of Zeus’ infidelity. For this, Zeus is disgusted by him.\\n\\nAres is not loved by his sister. Athena and Ares are both Gods of War. Where Ares represents violence, force, and slaughter, Athena is the embodiment of intelligence, strategy, and leadership. Ares is quick to act and leave a bloody trail. Athena is thoughtful and careful with lives. Often they have been on the opposite sides, most notably at the Battle of Troy, where Athena viciously wounded him and forced Ares to retreat.\\n\\nAres is the lover of the Goddess of Beauty. Though Aphrodite is married to Ares’ brother, Hephaestus, Ares takes what he wants, and Aphrodite gives in willingly. Their union created offspring almost as terrible as Ares himself: Phobos and Deimos, Fear and Terror.\\n\\nAres is loved only by the Spartans, who revere the God for his masculinity, his merciless warrior spirit, and tenacity against all odds. The Spartans, however, know the unpredictable fury of their patron, and bind his statues in chains. This is, in part, to prevent Ares’ spirit of victory from escaping Sparta, and a vain effort to keep the God of War contained."",""MP5PerLevel"":0.42,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.75,""Mana"":200,""ManaPerFive"":4.6,""ManaPerLevel"":37,""Name"":""Ares"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":20,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Crowd Control, High Defense"",""Roles"":"" Guardian"",""Speed"":360,""Title"":""God of War"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70/75/80/85/90"",""description"":""Chains extend from Ares' shield, doing damage to all enemies in its path.  Hitting a god shackles them to Ares, Cripples them, preventing movement abilities, dealing the same damage every second while slowing them and buffing Ares.  While shackled, Ares can fire another chain for free within 2s."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Minion Damage:"",""value"":""50/70/90/110/130 (+15% of your Magical Power)""},{""description"":""God Damage per Tick:"",""value"":""25/45/65/85/105 (+15% of your Magical Power)""},{""description"":""Slow/Speed:"",""value"":""15% per unique Shackle""},{""description"":""Duration:"",""value"":""4s""},{""description"":""Max Shackles:"",""value"":""3""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Ares strengthens the defenses of himself and all nearby allies, granting Protections and reducing Crowd Control durations. For each shackled enemy, the Protection Buffs are increased."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self/Allies""},{""description"":""Radius:"",""value"":""35""}],""rankitems"":[{""description"":""Protections:"",""value"":""20/25/30/35/40""},{""description"":""CC Reduction