trol for 3s."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy Gods""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""150/225/300/375/450 (+100% of your Physical Power)""},{""description"":""Stun:"",""value"":""1.1/1.2/1.3/1.4/1.5s""},{""description"":""Boar Lifetime:"",""value"":""6s""}],""secondaryDescription"":""""}},""Id"":8126,""Summary"":""Calydonian Boar"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1748_81261.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Artemis gains a Critical Strike chance Buff on each successful hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Critical Chance per hit:"",""value"":""5%""},{""description"":""Duration:"",""value"":""4s""},{""description"":""Max Stacks:"",""value"":""3""}],""secondaryDescription"":""""}},""Id"":8007,""Summary"":""Still Target"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1748_80071.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.016,""Cons"":"""",""HP5PerLevel"":0.68,""Health"":450,""HealthPerFive"":8,""HealthPerLevel"":75,""Lore"":""Armed with a magical bow, Artemis is the unrivaled Goddess of the Hunt!\\n\\nDaughter of Zeus and Leta, Artemis and her twin brother Apollo are products of Zeus’ infidelity to his wife Hera. Insulted, Hera cursed Leta while she was pregnant, forbidding her to give birth on land or sea. Fortunately, she found an island that did not touch the ocean floor, so it was neither land nor sea, and thus bore her children. Artemis was born first, then miraculously aided as midwife in the birthing of her brother.\\n\\nArtemis spent her childhood in the hills and forests, training with her bow and hunting beasts. As she grew older and more beautiful, she also grew proud and ruthless when slighted or dishonored, especially against those that claimed to be better hunters than she. Adonis boasted this very thing and Artemis sent a wild boar to skewer him. The twin demigods Otos and Ephialtes, who could not be killed except by each other, threatened to kidnap Artemis and force her to marry one of them, but were tricked when Artemis, appearing as a doe, dashed between them. As they thrust with their spears they impaled each other. Finally, Actaeon, after peeping at Artemis while she bathed, was transformed into a stag and devoured by his own hunting dogs. Such is the wrath of Artemis.\\n\\nHer name is invoked by hunters seeking prey and by midwives during childbirth. Sacrifices are made in her name before a new military campaign. Adolescent girls are sent to her shrine to serve for one year. Beautiful, deadly, and chaste, Artemis is a focused woman and a fearsome warrior."",""MP5PerLevel"":0.25,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":205,""ManaPerFive"":4.4,""ManaPerLevel"":34,""Name"":""Artemis"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":35,""PhysicalPowerPerLevel"":2.5,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Single Target Damage"",""Roles"":"" Hunter"",""Speed"":365,""Title"":""Goddess of the Hunt"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""18/16/14/12/10s"",""cost"":""45"",""description"":""Artemis places a trap on the ground. Enemy gods coming within 5 units of her traps activate them, Rooting and Crippling the enemy god, preventing movement abilities and dealing damage every second for 3s. "",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy Gods""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage per Tick:"",""va