on"":""Bear Self Buff:"",""value"":""10/15/20/25/30Protections""}],""secondaryDescription"":""""}},""Id"":14676,""Summary"":""Entangling Vines (Ferocious Roar)"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/07/Entangling-Vines.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""50/55/60/65/70"",""description"":""Druid Form: Artio channels for 2s, draining the life from enemies. While channeling she deals damage up to 5 times and heals herself up to 5 times. Each hit increasingly Slows enemies and enemies hit all 5 times are Rooted for 1s.\n\nBear Form: Artio charges forward at an increased movement speed for 3s. Enemies she charges through take damage and are Slowed for 2s."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Druid Damage Per Hit:"",""value"":""15/25/35/45/55 (10% of your Magical Power)""},{""description"":""Druid Heal Per Hit:"",""value"":""15/20/25/30/35 (10% of your Magical Power)""},{""description"":""Druid Slow:"",""value"":""20%""},{""description"":""Bear Damage:"",""value"":""70/120/170/220/270 (+50% of your Magical Power)""},{""description"":""Bear Slow:"",""value"":""10/15/20/25/30%""}],""secondaryDescription"":""""}},""Id"":14683,""Summary"":""Life Tap (Heavy Charge)"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/07/Life-Tap.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""1s"",""cost"":""0"",""description"":""Active: Artio Shapeshifts between her Druid stance and Bear stance.\n\nPassive: Every time Artio hits at least 1 enemy with an ability she gains 1 stack of Invigoration. Invigoration stacks increase her Movement Speed and MP5. Stacks last 4s, and stack up to 8 times.\r\n"",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Movement Speed Per Stack"",""value"":""1/1/2/2/3%""},{""description"":""MP5 Per Stack"",""value"":""2/4/6/8/10""}],""secondaryDescription"":""""}},""Id"":14685,""Summary"":""Shapeshift"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/07/Shapeshift-Druid.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Enemy gods hit by Artio's Druid or Bear damaging abilities will begin to decompose. This effect decreases their Physical and Magical Protections. This effect stacks. "",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Enemy Gods""}],""rankitems"":[{""description"":""Protections Debuff Per Stack"",""value"":""3% ""},{""description"":""Max Stacks"",""value"":""8 ""},{""description"":""Duration:"",""value"":""4s ""}],""secondaryDescription"":""""}},""Id"":14680,""Summary"":""Decompose"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/07/Decompose.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.9,""Health"":500,""HealthPerFive"":8,""HealthPerLevel"":100,""Lore"":""Ice melts in cascading waterfalls from jagged mountain peaks, pouring into rivers roaring white to the cold sea. Straightening slowly, like aged men, trees and fauna of the underbrush, now free of snow-weight, reach for the sun. It is spring; the world awakens from darkness and death to grow green again. Her hibernation ends. Coat wet with fresh rain, Artio, Goddess-Bear, roars into the chill morning air.\\n\\nShe is guardian of the cycle. Not the passage of time, but the balance of things. There is no spring without winter, no death without life, no darkness without light, no goodness without evil. Nature declares these opposites into law and Artio is the enforcer.\\n\\nAmong the ursine she runs, sometimes in the shape of a woman, lithe and wild, sometimes as a bear, brown and fierce. Nowhere in the forest do there stand shrines in her name, for Artio is less worshipped and more respected. Perhaps, instead, she looms overhead, a constant presence in the twinkle of the stars, a connection of glistening light; the constellation Ursa Major.\\n\\nAnd now there is war. None could know peace without war, victory without defeat, glory without failure. Artio must join those that fight if only to enforce the cycle of things. Nothing and no one defies the laws of nature like a God."",""MP5PerLevel"":0.43,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.5,""Mana"":210,""ManaPerFive"":4.6,""ManaPerLevel"":39,""Name"":""Artio"",""OnFreeRotation"":"""",""Pantheon"":""Celtic"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":20,""PhysicalProtectionPerLevel"":3.2,""Pros"":"" High Crowd Control, High Sustain"",""Roles"":"" Guardian"",""Speed"":365,""Title"":""The Bear Goddess"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""50/55/60/65/70"",""description"":""Druid: Artio pulses out a strong wave of energy that damages enemies. She will heal herself and allies within 55 units for each enemy god hit by this ability.\n\nBear Form: Artio slashes twice with her claws, damaging enemies with each swipe. "",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""25""}],""rankitems"":[{""description"":""Druid Damage:"",""value"":""70/100/130/160/190 (+35% of your Magical Power)""},{""description"":""Druid Heal:"",""value"":""60/80/100/120/140 (+25% of your Magical Power)""},{""description"":""Bear Damage Per Swipe:"",""value"":""50/80/110/140/170 (+35% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription2"":