p-content/uploads/2017/07/Shapeshift-Druid.jpg"",""godAbility5_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/07/Decompose.jpg"",""godCard_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/07/A-16dba307fabbd2b5f5d9ef19bd0f8f7d.jpg"",""godIcon_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/06/Web-Avatar-Artio-128x128.jpg"",""id"":3336,""latestGod"":""y"",""ret_msg"":null},{""Ability1"":""Preemptive Strike"",""Ability2"":""Confound"",""Ability3"":""Shield Wall"",""Ability4"":""Defender of Olympus"",""Ability5"":""Reach"",""AbilityId1"":8926,""AbilityId2"":8891,""AbilityId3"":8892,""AbilityId4"":8970,""AbilityId5"":8961,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""60/70/80/90/100"",""description"":""Athena powers up for a dash. While dashing, Athena will pass through minions, stop and hit the first enemy god she encounters, dealing damage and slowing all she hits. If she hits an enemy, Athena gains one stack of Block (max 3), absorbing the next Basic Attack from any god that hits her."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/130/180/230/280 (+50% of your Magical Power)""},{""description"":""Slow Amount:"",""value"":""25% ""},{""description"":""Slow Duration:"",""value"":""1.25/1.5/1.75/2.0/2.25s""}],""secondaryDescription"":""""}},""Id"":8926,""Summary"":""Preemptive Strike"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1919_89261.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""60/65/70/75/80"",""description"":""Athena releases a shockwave of power from her shield, Taunting enemy gods, and forcing them to fight or chase her."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy god""}],""rankitems"":[{""description"":""Taunt Duration:"",""value"":""1.0/1.25/1.5/1.75/2.0s""}],""secondaryDescription"":""""}},""Id"":8891,""Summary"":""Confound"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1919_88911.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""60/65/70/75/80"",""description"":""Athena summons a group of Athenian warriors who do damage upon arrival, and after 2s strike for additional damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Initial Damage:"",""value"":""60/95/130/165/200 (+50% of your Magical Power)""},{""description"":""Secondary Damage:"",""value"":""80/150/220/290/360 (+50% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":8892,""Summary"":""Shield Wall"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1919_88921.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""110/105/100/95/90s "",""cost"":""80/90/100/110/120"",""description"":""Athena picks a single allied god anywhere in the world, and launches herself up into the air, landing next to that god 3.6 seconds later. During that 3.6 seconds, the allied god mitigates 20% of the damage they're taking. Enemies nearby when Athena lands take damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Global""},{""description"":""Affects:"",""value"":""Allies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""350/450/550/650/750 (+90% of your Magical Power)""},{""description"":""Allied Mitigation:"",""value"":""20%""}],""secondaryDescription"":""""}},""Id"":8970,""Summary"":""Defender of Olympus"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1919_89701.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""After using any ability, Athena's next Basic Attack is a ranged attack, hitting all enemies it passes through, and dealing an additional +15% of her Magical Power as damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":8961,""Summary"":""Reach"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1919_89611.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.9,""Health"":500,""HealthPerFive"":8,""HealthPerLevel"":100,""Lore"":""In war, there are two kinds of soldiers: those that fight for blood, and those that fight for honor. The first crave the clash of steel and smell of slaughter, the latter know the wisdom of justice, the kindness of mercy, and that life should never be taken wantonly. These different warriors seek different Gods. Ares, God of War revels in the bloodletting, but his sister, Athena, Goddess of Wisdom, is patron to those who fight with dignity, and only when there is no other alternative.\\n\\nFavored daughter of Zeus, wise as ten thousand scholars, just as the scales themselves; Athena is a paragon of incorruptible virtue, and worshipped with righteous fervor. So revered is she that Athens, greatest city in all the world, is named for her, and regal temples adorn the countryside in her honor, each tended by loyal priestesses. To Athena, a life is a precious thing that need not be wasted in frivolous battle. Bloodthirsty Ares, on the other hand, is reviled by their father and chained by his ravenous subjects.\\n\\nAt the Siege of Troy, Ares disobeyed Zeus and joined with the battle, fighting for the mortal Trojans. Athena rose to stop him, indirectly championing the Greeks, but directly keeping the order of divine law. Their fierce battle clashed in unspeakable proportions, ending only when Ares limped from the battle field, cowed by his sister and rival. With Ares diminished, the tide of the war shifted and the heroes of the Greek Army toppled Troy.\\n\\nIn times of war, prayers are sent to both Gods. Ares, for bloodstained victory, Athena for honor, valor, and the wisdom to fight with dignity. Make no mistake, these are times of war, and Ares has already answered the call to arms. Athena, ever cautious with lives, goes to battle without eagerness, but solemn necessity, for the Goddess of Wisdom knows honor is for the living. The dead have no need of it."",""MP5PerLevel"":0.42,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":175,""MagicalPowerPerLevel"":7.5,""Mana"":190,""ManaPerFive"":4.6,""ManaPerLevel"":34,""Name"":""Athena"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":20,""PhysicalProtectionPerLevel"":3.2,""Pros"":"" High Crowd Control, High Defense"",""Roles"":"" Guardian"",""Speed"":365,""Title"":""Goddess of Wisdom"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""60/70/80/90/100"",""description"":""Athena powers up for a dash. While dashing, Athena will pass through minions, stop and hit the first enemy god she encounters, dealing damage and slowing all she hits. If she hits an enemy, Athena gains one stack of Block (max 3), absorbing the next Basic Attack from any god that hits her."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/130/180/230/280 (+50% of your Magical Power)""},{""description"":""Slow Amount:"",""value"":""25% ""},{""description"":""Slow Duration:"",""value"":""1.25/1.5/1.75/2.0/2.25s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""60/65/70/75/80"",""description"":""Athena releases a shockwave of power from her shield, Taunting enemy gods, and forcing them to fight or chase her."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy god""}],""rankitems"":[{""description"":""Taunt Duration:"",""value"":""1.0/1.25/1.5/1.75/2.0s""}],""secondaryDescription"":""""}},""abilityDescription3"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""60/65/70/75/80"",""description"":""Athena summons a group of Athenian warriors who do damage upon arrival, and after 2s strike for additional damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Initial Damage:"",""value"":""60/95/130/165/200 (+50% of your Magical Power)""},{""description"":""Secondary Damage:"",""value"":""80/150/220/290/360 (+50% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription4"":{""itemDescription"":{""cooldown"":""110/105/100/95/90s "",""cost"":""80/90/100/110/120"",""description"":""Athena picks a single allied god anywhere in the world, and launches herself up into the air, landing next to that god 3.6 seconds later. During that 3.6 seconds, the allied god mitigates 20% of the damage they're taking. Enemies nearby when Athena lands take damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Global""},{""description"":""Affects:"",""value"":""Allies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""350/450/550/650/750 (+90% of your Magical Power)""},{""description"":""Allied Mitigation:"",""value"":""20%""}],""secondaryDescription"":""""}},""abilityDescription5"":{""itemDescription"