[{""description"":""Ability:"",""value"":""Mount, Leap""},{""description"":""Affects:"",""value"":""Self and Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/130/180/230/280 (+80% of your Physical Power)""},{""description"":""Movement Speed:"",""value"":""25%""},{""description"":""Strafe Penalty:"",""value"":""50%""}],""secondaryDescription"":""""}},""Id"":10835,""Summary"":""Summon Suku"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2037_108351.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""8s"",""cost"":""60/65/70/75/80"",""description"":""Awilix flips over the last enemy she hit within 1.5s, Rooting, Crippling, and dealing damage as she passes over them. The damage dealt is modified based on the next attack in Awilix's Basic Attack progression.\n\nIf the next attack is her third attack, then she also hits all targets in the area around her."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Range:"",""value"":""30""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""60/90/120/150/180 (+50% of your Physical Power)""},{""description"":""Attack Progression Bonus:"",""value"":""1x/ 1.5x/ 2x""},{""description"":""Root and Cripple Duration:"",""value"":""0.6s""}],""secondaryDescription"":""""}},""Id"":10828,""Summary"":""Feather Step"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2037_108281.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""60/65/70/75/80"",""description"":""Suku comes to Awilix's aid, rushing forward and damaging all enemies. If hit from the side or behind, enemies are also knocked up into the air."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""65""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/130/170/210/250 (+60% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":10922,""Summary"":""Moonlight Charge"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2037_109221.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Awilix calls upon the power of the moon, immediately pulling to her the closest enemy god she is facing that is either leaping or knocked up into the air. The target god takes damage when they land.\n\nAwilix is then bathed in moonlight, gaining bonus Attack Speed and Physical Power, along with protection against Roots, Slows, and Knockbacks for 6s."",""menuitems"":[{""description"":""Ability:"",""value"":""Stim""},{""description"":""Affects:"",""value"":""Self and Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage:"",""value"":""200/250/300/350/400 (80% of your Physical Power)""},{""description"":""Attack Speed:"",""value"":""30/40/50/60/70%""},{""description"":""Physical Power:"",""value"":""20/30/40/50/60""}],""secondaryDescription"":""""}},""Id"":10818,""Summary"":""Gravity Surge"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2037_108181.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""If Awilix strikes first from out of combat, she increases her Physical Power for a short duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Physical Power Increase:"",""value"":""30% for 2.5s""}],""secondaryDescription"":""""}},""Id"":10796,""Summary"":""Initiative"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2037_107961.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.019,""Cons"":"""",""HP5PerLevel"":0.68,""Health"":475,""HealthPerFive"":10,""HealthPerLevel"":77,""Lore"":""Pale white shines the light from her sentinel high above Earth. She watches, the eye that pierces shadow, and listens with the ears of birds and beasts that use the darkness to hunt and revel. As Queen of the Night, she is known; the Goddess of the Moon, Awilix.\\n\\nThey say the sun is her lover, and from his light does she shine, but those that say so have never beheld her. Left unrestrained, the sun burns skin, scorches the land, blinds the eyes. Moonlight does no such thing. Like soft white petals it blankets the night, casting the world into mystical illumination. Never has it brought calamity or ruin, only the chance to see where once there was none. She is no different. Her mysterious radiance needs no other to shine.\\n\\nThese days, the night is less welcoming. Those loyal followers, the jaguars, whose whispered roars bellow into the silence of her domain, prowl at her command. While it is, no doubt, beyond the understanding of mortals, the very moonlight is threatened. A war unlike any before it would end all things. For once that pale white will glimmer on the ugliness of bloodshed, for the night belongs to Awilix."",""MP5PerLevel"":0.27,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":3.9,""ManaPerLevel"":38,""Name"":""Awilix"",""OnFreeRotation"":"""",""Pantheon"":""Mayan"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.16,""PhysicalProtection"":13,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Single Target Damage, High Mobility"",""Roles"":"" Assassin"",""Speed"":370,""Title"":""Goddess of the Moon"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""50/55/60/65/70"",""descriptio