ts:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""65""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/130/170/210/250 (+60% of your Physical Power)""}],""secondaryDescription"":""""}},""abilityDescription4"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Awilix calls upon the power of the moon, immediately pulling to her the closest enemy god she is facing that is either leaping or knocked up into the air. The target god takes damage when they land.\n\nAwilix is then bathed in moonlight, gaining bonus Attack Speed and Physical Power, along with protection against Roots, Slows, and Knockbacks for 6s."",""menuitems"":[{""description"":""Ability:"",""value"":""Stim""},{""description"":""Affects:"",""value"":""Self and Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage:"",""value"":""200/250/300/350/400 (80% of your Physical Power)""},{""description"":""Attack Speed:"",""value"":""30/40/50/60/70%""},{""description"":""Physical Power:"",""value"":""20/30/40/50/60""}],""secondaryDescription"":""""}},""abilityDescription5"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""If Awilix strikes first from out of combat, she increases her Physical Power for a short duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Physical Power Increase:"",""value"":""30% for 2.5s""}],""secondaryDescription"":""""}},""basicAttack"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":"""",""menuitems"":[{""description"":""Damage:"",""value"":""38 + 2.16/Lvl (+100% of Physical Power)""},{""description"":""Progression:"",""value"":""1/0.75/1.25x damage. Range of 16""}],""rankitems"":[],""secondaryDescription"":""""}},""godAbility1