""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/130/170/210/250 (+70% of your Magical Power)""},{""description"":""Slow:"",""value"":""20%""},{""description"":""Slow Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""Id"":8449,""Summary"":""Belly Flop"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1809_84491.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""70/75/80/85/90"",""description"":""Bacchus lets out an obnoxiously loud belch, doing damage every .5s for 2s. If he is Tipsy, enemies are Stunned for 1s and their healing is Debuffed. Bacchus is immune to knockback for the duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""20/35/50/65/80 (+15% of your Magical Power)""},{""description"":""Stun:"",""value"":""1s""},{""description"":""Healing Debuff:"",""value"":""50%""},{""description"":""Healing Debuff Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":8483,""Summary"":""Belch of the Gods"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1809_84831.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""95"",""description"":""Bacchus smashes his jug of wine on the ground, intoxicating all nearby enemies and doing damage. If he is Smashed, Bacchus also gains a Magical Power Buff because of his anger over his lost wine!"",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""250/325/400/475/550 (+70% of your Magical Power)""},{""description"":""Intoxication Debuff Duration:"",""value"":""6s""},{""description"":""Magical Power Buff:"",""value"":""20/30/40/50/60""},{""description"":""Buff Duration:"",""value"":""5s""}],""secondaryDescription"":""""}},""Id"":8491,""Summary"":""Intoxicate"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1809_84911.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Bacchus loves the drink and as Bacchus drinks from his jug, he becomes more intoxicated, gaining Buffs when he gets Tipsy and Smashed. Bacchus also celebrates when he kills an enemy god, giving him 10% on his meter."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Tipsy:"",""value"":""Take 7% less damage and gain 10 Magical Power""},{""description"":""Smashed:"",""value"":""Take 14% less damage and gain 30 Magical Power""}],""secondaryDescription"":""""}},""Id"":8463,""Summary"":""Drunk-O-Meter"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1809_84631.jpg""},""AttackSpeed"":0.88,""AttackSpeedPerLevel"":0.009,""Cons"":"""",""HP5PerLevel"":0.8,""Health"":495,""HealthPerFive"":8,""HealthPerLevel"":86,""Lore"":""Eat, drink, and be merry, for tomorrow you may die. None adhere more vigorously to this creed than Bacchus, the Roman God of Wine, lewd behavior, and madness.\\n\\nAfter spending much of his formative years with his impressively intoxicated mentor Solinus, whom Bacchus loves like a father, the God of Wine is now a wanderer and teacher. He’s journeyed across all of Asia, through India, and finally back to Rome, spreading the “Mysteries of the Vine,” a ritual involving incredible amounts of wine to lower inhibitions, freeing one from social constraints, oppression of gender, sexual taboos, and the stresses of life. Quite the successful ritual, if ever there was one.\\n\\nMuch of this ritual seems to have come from Solinus, who is widely known to have vast, secret knowledge and the ability to predict the future, though only while completely drunk. The king Midas, covetous of this knowledge, captured Solinus, endeavoring to extract it by providing the scholar the finest food, drink, and entertainment he could muster. Bacchus finally tracked down his mentor in the court of Midas and discovered him well fed and cared for. Quickly, Midas lied, claiming Solinus had been lost and the king had taken him in. Seeing through the ruse, Bacchus offered the monarch a boon. Midas asked that anything he touched be turned to gold. Without hesitation, Bacchus granted this. He tested his new gift on a twig and stone and found them turned completely to gold. Elated, Midas called a feast, but found his food turned to gold in his hands and his daughter solidified at his touch. Starving and crazed, Midas begged Bacchus to remove the “gift.” Bacchus acquiesced, allowing the greedy king to wash his hands in the Pactolus river. As the golden touch left his hands, the river sands transformed to glittering gold.\\n\\nOf course, the product of continuous overindulgence in alcohol and deviant behavior, Bacchus could simply be insane."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":185,""MagicalPowerPerLevel"":7.5,""Mana"":200,""ManaPerFive"":4.8,""ManaPerLevel"":40,""Name"":""Bacchus"",""OnFreeRotation"":"""",""Pantheon"":""Roman"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":19,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Crowd Control, High Defense"",""Roles"":"" Guardian"",""Speed"":365,""Title"":""God of Wine"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""40/65/90/115/140"",""description"":""Bacchus takes a drink from his jug, giving him additional Buffs."",""menuitems"":[{