my Minion""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Heal:"",""value"":""70/120/170/220/270 (+70% of your Physical Power)""},{""description"":""Protections:"",""value"":""10/15/20/25/30""},{""description"":""Protections Duration:"",""value"":""10s""}],""secondaryDescription"":""""}},""Id"":8180,""Summary"":""Eat Minion"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1755_8180.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""60/65/70/75/80"",""description"":""Bakasura passively gains Physical Power. When activated, he gains additional true damage on each strike for the duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""True""}],""rankitems"":[{""description"":""Passive Physical Power:"",""value"":""10/15/20/25/30""},{""description"":""True Damage:"",""value"":""10/25/40/55/70""},{""description"":""Duration:"",""value"":""6s""}],""secondaryDescription"":""""}},""Id"":8184,""Summary"":""Butcher Blades"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1755_8184.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90/85/80/75/70s"",""cost"":""80/90/100/110/120"",""description"":""Bakasura regurgitates all of the minions consumed by his Eat Minion ability at his ground target location that Slows and Cripples enemy players.  Bakasura's Basic Attacks become cone attacks and he is immune to Crowd Control for a short duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Radius:"",""value"":""25""}],""rankitems"":[{""description"":""Slow:"",""value"":""20/25/30/35/40%""},{""description"":""Slow Duration:"",""value"":""4s""},{""description"":""Cone Attack Duration:"",""value"":""6s""},{""description"":""CC Immunity Duration:"",""value"":""1.5s""},{""description"":""Minion Damage:"",""value"":""15""}],""secondaryDescription"":""""}},""Id"":8190,""Summary"":""Regurgitate"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1755_8190.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Bakasura's attack and movement speed temporarily increases for each enemy that he kills."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Attack Speed per Stack:"",""value"":""10%""},{""description"":""Movement Speed per Stack:"",""value"":""10%""},{""description"":""Buff Duration:"",""value"":""10s""},{""description"":""Max Stacks:"",""value"":""3""}],""secondaryDescription"":""""}},""Id"":8176,""Summary"":""Insatiable Hunger"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1755_8176.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.016,""Cons"":"""",""HP5PerLevel"":0.68,""Health"":455,""HealthPerFive"":9,""HealthPerLevel"":78,""Lore"":""A horrendous demon with a bottomless appetite for human flesh, Bakasura is a nightmare come to life.\\n\\nAfter committing countless atrocities, Bakasura has demonstrated no end to his depravity, no limits to his brutality, no sating his desire to slurp human meat, crunch bone, and guzzle hot blood. So many are his vile victories over mankind that they cannot be relayed here, yet it his defeat at the hands of a man that is worth the telling.\\n\\nAccording to the Hindu epic, the Mahabharata, the famous Pandava brothers were traveling in exile with their mother, Kunti, when they came to the village Ekachakra. Disguised as brahmins, they sought alms from the villagers in order to sustain themselves. They soon learned that a demon, Bakasura, was living outside the village, devouring the people as they passed through the woods. The chief went to the demon and begged that the feasting stop. In return, a cart of food would be sent to Bakasura each day. Bakasura consumed not only the provisions, but the person that brought the cart as well.\\n\\nAfter hearing this tale from a weeping woman whose son would bear the cart on the morrow, Kunti declared that her son Bhima, who possessed impossible strength and had slain demons before, would take the cart instead, as repayment to the kindness the villagers had shown their family.\\n\\nOnce in the forest, Bhima nonchalantly ate the food intended for Bakasura. Furious, Bakasura threatened to eat Bhima, which he just laughed off, goading the demon to attack him. All day they battled until Bhima finally slew the demon, tied him to the cart and dragged the body back to the village, where the people celebrated the victory in bewilderment.\\n\\nHunger, however, is a demon that cannot be defeated and, inevitably, Bakasura’s disgusting rumble will rise again, now more ravenous than ever and ready to feed."",""MP5PerLevel"":0.46,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":200,""ManaPerFive"":4.8,""ManaPerLevel"":39,""Name"":""Bakasura"",""OnFreeRotation"":"""",""Pantheon"":""Hindu"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.2,""PhysicalProtection"":13,""PhysicalProtectionPerLevel"":2.8,""Pros"":"" High Single Target Damage"",""Roles"":"" Assassin"",""Speed"":370,""Title"":""the Great Devourer"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""60/65/70/75/80"",""description"":""Bakasura leaps to his ground target location, doing damage to all enemies in the area and reducing their Physical Protection."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""1