r dagger, which detonates on her target dealing damage and slowing the enemies in the area."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/120/170/220/270 (+100% of your Physical Power)""},{""description"":""Slow:"",""value"":""30%""},{""description"":""Slow Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""Id"":7494,""Summary"":""Declaw"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1678_7494.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""90/95/100/105/110"",""description"":""Bastet summons 3 cats that attack nearby targets, Slowing and damaging them.  Sensing the smell of blood, the cats will attack Bleeding enemies first."",""menuitems"":[{""description"":""Ability:"",""value"":""Summon Pet""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage per Hit:"",""value"":""25/35/45/55/65 (+20% of your Physical Power)""},{""description"":""Cat Health:"",""value"":""500/550/600/650/700""},{""description"":""Cat Protections:"",""value"":""20/30/40/50/60""},{""description"":""Slow:"",""value"":""20%""},{""description"":""Cat Lifetime:"",""value"":""10s""}],""secondaryDescription"":""""}},""Id"":7513,""Summary"":""Cat Call"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1678_7513.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""When Bastet hits an enemy with Pounce, Razor Whip or Declaw, she wounds the target for a brief time.  If the target has a wound, those abilities deal additional damage and remove the wound instead."",""menuitems"":[{""description"":""Ability:"",""value"":""Debuff""},{""description"":""Affects:"",""value"":""Enemy""}],""rankitems"":[{""description"":""Wound Duration:"",""value"":""3s""},{""description"":""Additional Damage:"",""value"":""20%""}],""secondaryDescription"":""""}},""Id"":9337,""Summary"":""Open Wound"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1678_9337.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.02,""Cons"":"""",""HP5PerLevel"":0.72,""Health"":415,""HealthPerFive"":9,""HealthPerLevel"":80,""Lore"":""Reveling in the joys of life, Bastet, daughter of Ra, is the sensual embodiment of her feline form. This cat, however,  has the fiercest claws.\\n\\nCats are creatures that demand worship. They are regal, nonchalant, and insatiable. Though, as much as they languish in the sun and rumble with purrs of pleasure, cats are agile and deadly hunters. Mercilessly, they cull the populations of invasive vermin and stinging scorpions, protecting the home from vile invaders. Perhaps, the most troublesome enemy of the cat is the serpent, and there was no greater snake in the world than the horrendous Apep.\\n\\nCircling the world along the horizon line, Apep’s scaly girth waited in ambush each morning for Ra to rise and bring light to the world. To fend off this beast, Ra kept the company of his daughter, Bastet. Since time began, as Ra lifted into the Eastern sky, Bastet would spit and howl, claws bared against the treacherous Apep. Countless battles were fought, countless mornings faced uncertainty, until, at last, Bastet tore the foul serpent apart.\\n\\nWith her greatest enemy gone, Bastet is free to prowl as she pleases. Now, she is the guardian of home and hearth,  idol to women - especially those desiring children and exploring their sensuality - and patron of arts, wine, and any occasion of revelry. Like any cat, though, Bastet can still pounce without warning, shredding her enemies once her claws come out."",""MP5PerLevel"":0.25,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana