,""godAbility1_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1678_10138.jpg"",""godAbility2_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1678_10001.jpg"",""godAbility3_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1678_7494.jpg"",""godAbility4_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1678_7513.jpg"",""godAbility5_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1678_9337.jpg"",""godCard_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/StandardBastet_card.jpg"",""godIcon_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1678.jpg"",""id"":1678,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Shield Bash"",""Ability2"":""Bludgeon"",""Ability3"":""Scourge"",""Ability4"":""Eagle's Rally"",""Ability5"":""Master of War"",""AbilityId1"":11127,""AbilityId2"":11137,""AbilityId3"":11140,""AbilityId4"":11141,""AbilityId5"":11145,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""75"",""description"":""Bellona dashes forward and bashes with her shield, dealing damage and Slowing enemies. Bellona gains 1 Stack of block for each enemy god hit. Block absorbs all damage from a single Basic Attack and reflects a portion of the damage around her.\n\nBellona then makes Basic Attacks with sword and shield until out of combat, and every 3 successful basic attacks she gains another Stack of block (max. 3).\r\n"",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemies and Self""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/120/160/200/240 (+40% of your Physical Power)""},{""description"":""Block Reflect:"",""value"":""30%""},{""description"":""Slow:"",""value"":""15/20/25/30/35% for 2s""}],""secondaryDescription"":""""}},""Id"":11127,""Summary"":""Shield Bash"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2047_11127.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""14/13/12/11/10s"",""cost"":""60/65/70/75/80"",""description"":""Bellona summons a hammer and spins, hitting every enemy around her and then smashing forward in an overhand attack. Each enemy god hit in the spin increases the damage of the overhand attack.\n\nBellona now makes Basic Attacks with her hammer until out of combat. Every hammer attack hits all enemies in melee range and only benefit from 33% of Bellona's total Lifesteal."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""25""}],""rankitems"":[{""description"":""Spin Damage:"",""value"":""30/60/90/120/150 (+25% of your Physical Power)""},{""description"":""Slam Damage:"",""value"":""70/130/190/250/310 (+60% of your Physical Power)""},{""description"":""Slam Damage Increase:"",""value"":""25% per Enemy God hit""}],""secondaryDescription"":""""}},""Id"":11137,""Summary"":""Bludgeon"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2047_11137.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""20/19/18/17/16s"",""cost"":""70/75/80/85/90"",""description"":""Bellona summons a scourge, dealing damage to all enemies in a line. Enemies hit are Disarmed, and cannot make Basic Attacks.\n\nBellona now makes Basic Attacks with a scourge until out of combat, which has extended range (+4) and every third attack heals Bellona."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/115/150/185/220 (+50% of your Physical Power)""},{""description"":""Disarm Duration:"",""value"":""1.4/1.6/1.8/2/2.2s""},{""description"":""Healing:"",""value"":""30/35/40/45/50""}],""secondaryDescription"":""""}},""Id"":11140,""Summary"":""Scourge"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2047_11140.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""75s"",""cost"":""100"",""description"":""Bellona plants a Roman flag, granting Protections and increased Physical Power to allied gods. Enemies directly under where the flag is placed take damage and are Stunned for 1s."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Everyone""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""40""}],""rankitems"":[{""description"":""Damage:"",""value"":""100/200/300/400/500 (+50% of your Physical Power)""},{""description"":""Protections:"",""value"":""15/20/25/30/35""},{""description"":""Physical Power:"",""value"":""10/20/30/40/50""},{""description"":""Flag Duration:"",""value"":""6/7/8/9/10""}],""secondaryDescription"":""""}},""Id"":11141,""Summary"":""Eagle's Rally"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2047_11141.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Upon giving or receiving hits from Basic Attacks, Bellona gains Protections and movement speed for 4s. (max. 5 stacks).\r\n"",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Protections:"",""value"":""4 Protections per Stack""},{""description"":""Movement Speed:"",""value"":""+3% per Stack""}],""secondaryDescription"":""""}},""Id"":11145,""Summary"":""Master of War"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2047_11145.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.8,""Health"":480,""HealthPerFive"":8,""HealthPerLevel"":85,""Lore"":""Rome has forgotten her.\\n\\nBellona, the Goddess of War, took no time to build temples or gather worshippers. She favors only those for whom war is life; for that is where she thrives - not on the steps of hallowed basilicas or in whispered prayers, but in the blood-soaked mud, among the breathless armored troops, in the roar of victory.\\n\\nWhen Rome was young, Bellona ran with her armies, conquered her enemies, made her strong. As Rome aged and began to crumble, she fought only with her strongest and most cunning of worshippers, Lucius Cornelius Sulla.\\n\\nSulla rose through the ranks by accomplishing impossible deeds of heroism and ruthless prowess. His enemies feared him, his soldiers loved him, and everywhere he went, Bellona rode with him. Together they quelled the Germanic hordes, they broke the Social War, they sacked Athens. Sulla was utterly undefeatable, and it was the Goddess of War that made him so.\\n\\nBut the Roman Senate moved to displace Sulla and end his rise to glory.\\n\\n\""March on Rome,\"" Bellona quietly urged, \""and you shall rise as no other.\""\\n\\nEmboldened, Sulla commanded his legions and took the city streets, Bellona at the fore, slaughtering the gladiator-slaves that stood against them. The Senate buckled. They cast the vote. Sulla became the first life-long dictator of Rome.\\n\\nDuring Sulla's reign, Bellona was worshipped for the Goddess she was. But Sulla had grown old. His wars were over. Bellona moved on, and Rome forgot.\\n\\nBut the forgotten are not gone. Gods clash in titanic conflict. It is in war she thrives. No one will forget Bellona the Goddess of War this time."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":4.8,""ManaPerLevel"":35,""Name"":""Bellona"",""OnFreeRotation"":"""",""Pantheon"":""Roman"",""PhysicalPower"":36,""PhysicalPowerPerLevel"":2.0,""PhysicalProtection"":18,""PhysicalProtectionPerLevel""