ty is active and does not suffer Basic Attack penalty.\r\n"",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Duration:"",""value"":""5s""}],""rankitems"":[{""description"":""Damage:"",""value"":""100/145/190/235/280 (+50% of your Magical Power)""},{""description"":""Stun Duration:"",""value"":""1s""},{""description"":""Movement Speed Increase:"",""value"":""15/20/25/30/35%""}],""secondaryDescription"":""""}},""Id"":10453,""Summary"":""Seismic Crush"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2008_10453.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""65/70/75/80/85"",""description"":""Passive: As Cabrakan's shields take damage they store energy and gain Protection stacks.\n\nActive: Cabrakan slams his shields together creating a concussive blast and damaging enemies in front of him. If his shields have the maximum number of Stacks then the enemy gods hit are Stunned, and the Stacks are removed."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Self, Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""100/155/210/265/320 (+50% of your Magical Power)""},{""description"":""Stun Duration:"",""value"":""1.1/1.2/1.3/1.4/1.5s""},{""description"":""Protections per Stack:"",""value"":""2/3/4/5/6 Max 5 Stacks""}],""secondaryDescription"":""""}},""Id"":10262,""Summary"":""Refraction Shield"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2008_10262.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""8s"",""cost"":""15/20/25/30/35 every 0.5s."",""description"":""Cabrakan repeatedly slams the ground with his shields creating an earthquake and causing enemies around him to tremble. Enemies caught in the earthquake are damaged and are slowly sucked in towards Cabrakan. This ability can only be channeled for a maximum amount of 10s."",""menuitems"":[{""description"":""Ability:"",""value"":""AOE""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""22/32/42/52/62 (+35% of your Magical Power) every 0.5s.""}],""secondaryDescription"":""""}},""Id"":10271,""Summary"":""Tremors"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2008_10271.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""75s"",""cost"":""100 "",""description"":""Cabrakan stomps the ground creating a wall of earth and a fissure that travels out in front of him and damages any enemies caught in its path. The walls may be destroyed if they take enough hits. Cabrakan may destroy his own walls with a single Basic Attack."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""35""}],""rankitems"":[{""description"":""Damage:"",""value"":""150/250/350/450/550 (+70% of your Magical Power)""},{""description"":""Hits to destroy:"",""value"":""3 hits ""}],""secondaryDescription"":""""}},""Id"":10387,""Summary"":""Tectonic Shift"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2008_10387.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Cabrakan and nearby allies take 5% reduced damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Allies""},{""description"":""Range:"",""value"":""30""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":10252,""Summary"":""Shadow Zone"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2008_10252.jpg""},""AttackSpeed"":0.9,""AttackSpeedPerLevel"":0.011,""Cons"":"""",""HP5PerLevel"":0.75,""Health"":490,""HealthPerFive"":8,""HealthPerLevel"":90,""Lore"":""Feel the earth trembling beneath your feet? Only a titan of tremendous power could cause such fear. He is the Render of Stone, the Earthsunder. He is Cabrakan, Destroyer of Mountains.\\n\\nProud, boastful, confident to the point of arrogance, Cabrakan revels in his strength, tearing down what the earth has labored to rise. These traits – and worse - he inherited from his sire, the demon bird Seven Macaw.\\n\\nSeeking to end Seven Macaw's entire lineage, the Hero Twins tracked Cabrakan by his quaking footfalls. They found him in a valley, surrounded by great peaks, shattering rock into dust.\\n\\n\""How mighty you are,\"" they told him, playing to his pride.\\n\\n\""I am,\"" he boasted.\\n\\n\""Can you shatter that distant mountain?\"" they asked.\\n\\n\""Of course,\"" Cabrakan roared.\\n\\n\""You must be hungry,\"" the Hero Twins offered.\\n\\n\""Always!\""\\n\\nAnd so they shot a bird from the sky for the giant to feast upon, yet as they turned the carcass over the flame, Hun-apu coated it with poisonous mud.\\n\\nWithout a thought, Cabrakan devoured the feast and rose, but already the poison had taken him. Teetering, losing sight, the Earthsunder collapsed. Mountains crumbled a final time. The valley became his tomb.\\n\\nYet vengeance is a cycle. Blood for blood, and a Titan is not so easily slain. The destroyer of mountains cannot be buried beneath stone, and Cabrakan's pained slumber is at an end. Bursting free, he now thunders across the field of war, seeking the Twins that played him the fool. Why stop at mountains when Cabrakan can destroy Gods."",""MP5PerLevel"":0.42,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.5,""Mana"":200,""ManaPerFive"":4.6,""ManaPerLev