alue"":""Physical""},{""description"":""Range:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/140/200/260/320 (75% of your Physical Power)""},{""description"":""Heal Per Hit:"",""value"":""15/25/35/45/55 (25% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":13562,""Summary"":""Devour"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/10/Camazotz_Ability_Three.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100 "",""description"":""Camazotz flies into the air for the next 4s. While flying, he may swoop forward to deal damage. He may do this up to 3 times, landing on the 3rd time. Hitting more than one enemy god in a single swoop will deal increased damage per god."",""menuitems"":[{""description"":""Ability:"",""value"":""Flight""},{""description"":""Affects:"",""value"":""Self / Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""35""}],""rankitems"":[{""description"":""Damage Per Hit:"",""value"":""120/165/210/255/300 (+40% of your Physical Power)""},{""description"":""Bonus Damage:"",""value"":""10% Per God""}],""secondaryDescription"":""""}},""Id"":13509,""Summary"":""Bat Out of Hell"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/10/Icons_Camazotz_Four.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Camazotz has a passive Vampirism bonus. Also, anytime a god dies they leave behind a pool of their essence in the spot they were slain. Camazotz may stand inside these pools to drink the essence every .5s, replenishing his Health and Mana."",""menuitems"":[{""description"":""Ability:"",""value"":""Deployables""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Heal per drink:"",""value"":""2% Max Health""},{""description"":""Mana per drink:"",""value"":""2% Max Mana""},{""description"":""Drinks per pool:"",""value"":""10""},{""description"":""Vampirism Buff:"",""value"":""5% Physical Lifesteal and Increased Healing""}],""secondaryDescription"":""""}},""Id"":13389,""Summary"":""Essence Drinker"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/10/Icons_Camazotz_Passive.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.02,""Cons"":"""",""HP5PerLevel"":0.67,""Health"":440,""HealthPerFive"":8,""HealthPerLevel"":78,""Lore"":""In darkness he lurks. Patient as the night in all its silence. For beneath his inverted perch scampers prey. Whether beast, mortal, or God matters not, only satisfying the unquenchable thrum in his veins for the boiling blood of another creature. But there is never enough. There will never be enough. So Camazotz, bat-god, whose bestial form matches that of his nocturnal servants, lurks in the darkness, waiting only to feed.\\n\\nOnce before, when the hero twins, Xbalanque and Hunahpu ventured to the Xibalba, stumbling blindly into the blackness of his cave, did Camazotz defeat a God. Finding themselves surrounded by a swarm of leathery bats, screeching and flapping with frenzied glee, the hero twins cowered and hid, hoping for dawn to light their way out. Patient, as always, Camazotz waited. Hunahpu, unable to hold out, lifted his head from concealment to check for light. Camazotz leapt, sliding through the blackness like a dagger through skin, and snatched Hunahpu’s head from his neck. Victorious, he presented his prize as a trophy to the other underworld Gods. However, come the morning light, Xbalanque fashioned a new head for his brother from a gourd and the two escaped while Camazotz was away.\\n\\nLong has Camazotz hung from his perch, watching as Gods clash and spill their sweet blood upon the earth. He’s waited, ever watchful, ever patient, for the moment to strike. Now that the moon has risen, and night has come, Camazotz has disappeared into the darkness. When next he’s seen, there will be blood on his fangs."",""MP5PerLevel"":0.3,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":215,""ManaPerFive"":4.4,""ManaPerLevel"":35,""Name"":""Camazotz"",""OnFreeRotation"":"""",""Pantheon"":""Mayan"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.3,""PhysicalProtection"":13,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Sustain, Great Jungler"",""Roles"":"" Assassin"",""Speed"":375,""Title"":""Deadly God of Bats"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""13s"",""cost"":""60/65/70/75/80"",""description"":""Camazotz screeches loudly and launches a sound wave that pierces through minions and deals damage.\n\nIf the screech hits an enemy god, the sound wave will echo. If Camazotz is hit by an echo, he gains vision of the god that was hit by screech for the next 15s and gains bonus Physical Power for the duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemies / Self""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/135/180/225/270 (+70% of your Physical Power)""},{""description"":""Echo Buff:"",""value"":""20/25/30/35/40 Physical Power ""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""60/65/70/75/80"",""description"":""Camazotz commands a swarm of bats to fly out and attack a single target, damaging and slowing them by 30% for 3s and then carrying back a heal.\n\nIf the target was a jungle buff monster they will be marked and Camazotz will receive a heal as well as a stackable Vampirism buff that lasts 210s. Marked monsters will not provide Camazotz with another stack of Vampirism."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemies""},{""description""