yId1"":14244,""AbilityId2"":14241,""AbilityId3"":14245,""AbilityId4"":14246,""AbilityId5"":14329,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""0s"",""cost"":""None"",""description"":""Cernnunos imbues his glaive with the power of the 4 seasons. Activating this ability rotates him through 4 different bonuses to his basic attacks.\n\nSpring Growth: Bonus Physical Lifesteal\nSummer Heat: Bonus Damage\nAutumn Decay: Debuff for 5s\nWinter Chill: Slows for 1s"",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Spring Growth:"",""value"":""5/7.5/10/12.5/15% Physical Lifesteal""},{""description"":""Summer Heat:"",""value"":""5/10/15/20/25(+5% of your Physical Power)""},{""description"":""Autumn Decay:"",""value"":""5/10/15/20/25 Reduced Physical Protections""},{""description"":""Winter Chill:"",""value"":""7/9/11/13/15% Slow""}],""secondaryDescription"":""""}},""Id"":14244,""Summary"":""Shifter of Seasons"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/03/Icons_Cernunnos_A01.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Cernunnos fires a bramble forward in a line that roots a single enemy hit. Upon hitting an enemy, wall, or reaching max range it will explode dealing damage and spawning an area of brambles at the location. This area deals damage every .5s and persists for 5s."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""40/80/120/160/200 (+75% of your Physical Power)""},{""description"":""Root Duration:"",""value"":""1s""},{""description"":""Area Damage:"",""value"":""4/8/12/16/20 (+5% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":14241,""Summary"":""Bramble Blast"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/03/Icons_Cernunnos_A02.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""17/16/15/14/13s"",""cost"":""70/75/80/85/90"",""description"":""Cernunnos charges forward, damaging and crashing through all types of enemies."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/125/180/235/290 (+80% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":14245,""Summary"":""Horn Charge"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/03/Icons_Cernunnos_A03.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""100s"",""cost"":""100/110/120/130/140"",""description"":""Cernunnos selects an area where The Wild Hunt will begin. After a 1s delay, enemy gods in the area will be damaged and Polymorphed into wild boars. Polymorphed gods are silenced and disarmed. Polymorph is not affected by diminishing returns."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy Gods""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""25""}],""rankitems"":[{""description"":""Damage:"",""value"":""200/250/300/350/400 (90% of your Physical Power)""},{""description"":""Polymorph Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""Id"":14246,""Summary"":""The Wild Hunt"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/03/Icons_Cernunnos_A04.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Cernunnos wields a Glaive as a weapon. His basic attacks deal additional damage to all enemies in melee range while he is throwing it. The additional damage from Heavy Glaive does not trigger any effects from items or abilities. It also can not Critical Strike."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""12""}],""rankitems"":[{""description"":""Damage:"",""value"":""25% of your Basic Attack damage""}],""secondaryDescription"":""""}},""Id"":14329,""Summary"":""Heavy Glaive"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/03/Icons_Cernunnos_Passive.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.014,""Cons"":"""",""HP5PerLevel"":0.69,""Health"":480,""HealthPerFive"":8,""HealthPerLevel"":80,""Lore"":""Standing upon the edge of the wooded realm of Cernunnos, one can feel the invitation and the threat. “Come and feast,” it calls. “Nature provides an abundance of crops and wild game.” Yet, the same voice turns dark. “Treat everything with due respect,” it warns. “This is not your home.” And, should one peer intently enough through the shadowed branches, a figure can be seen, horned as a stag, clothed in moss and leaves, eyes burning like untended embers. Cernunnos is master here, and although he has much to offer, he will not tolerate greed.\\n\\nTime turns on the Sacred Wheel, Spring to Summer, Summer to Autumn and Autumn at last to Winter. Cernunnos was there at the shaping of the wheel, born of the womb of the All Mother before Gods were Gods, when the land was shapeless. This wheel is not of his making. He is both master of it and slave to it, transforming with the seasons like the world beneath his feet. He bears a heavy metal torc around his neck as a permanent pledge of loyalty to this cycle of life and death that only he can drive.\\n\\nOnce, it was said, there was no break between his realm and this world. They were the same. Perhaps a time will come when the world shall once again be his. Then, all can walk among the whispering leaves. So long as they remain humble. For the arrogant, Cernunnos hunts. What are these other Gods? Guest or prey?"",""MP5PerLevel"":0.32,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":4.5,""ManaPerLevel"":37,""Name"":""Cernunnos"",""OnFreeRotation"":"""",""Pantheon"":""Celtic"",""PhysicalPower"":37,""PhysicalPowerPerLevel"":2.5,""PhysicalProtection"":13,""PhysicalProtectionPerLevel"":2.9,""Pros"":"" High Area Damage, High Crowd Control"",""Roles"":"" Hunter"",""Speed"":365,""Title"":""The Horned God"",""Type"":"" Ranged"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""0s"",""cost"":""None"",""description"":""Cernnunos imbues his glaive with the power of the 4 seasons. Activating this ability rotates him through 4 different bonuses to his basic attacks.\n\nSpring Growth: Bonus Physical Lifesteal\nSummer Heat: Bonus Damage\nAutumn Decay: Debuff for 5s\nWinter Chill: Slows for 1s"",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Spring Growth:"",""value"":""5/7.5/10/12.5/15% Physical Lifesteal""},{""description"":""Summer Heat:"",""value"":""5/10/15/20/25(+5% of your Physical Power)""},{""description"":""Autumn Decay:"",""value"":""5/10/15/20/25 Reduced Physical Protections""},{""description"":""Winter Chill:"",""value"":""7/9/11/13/15% Slow""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Cernunnos fires a bramble forward in a line that roots a single enemy hit. Upon hitting an enemy, wall, or reaching max range it will explode dealing damage and spawning an area of brambles at the location. This area deal