g""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""60/65/70/75/80"",""description"":""Chang'e twirls, scattering flowers around her, and healing herself and all nearby allies and damaging nearby enemies.  Moonflower Dance also reduces the healing of all nearby enemies."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy and Ally""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Heal:"",""value"":""50/70/90/110/130 (+30% of your Magical Power)""},{""description"":""Damage:"",""value"":""65/90/115/140/165 (+50% of your Magical Power)""},{""description"":""Healing Reduction:"",""value"":""50%""},{""description"":""Lifetime:"",""value"":""4s""}],""secondaryDescription"":""""}},""Id"":9123,""Summary"":""Moonflower Dance"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1921_9123.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""80/90/100/110/120"",""description"":""Chang'e's Waxing Moon dance is captivating, with this dance dealing damage and Stunning enemy gods in front of her.  Each subsequent god that gets Stunned is Stunned for longer than the previous one."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""160/235/310/385/460 (+70% of your Magical Power)""},{""description"":""Stun:"",""value"":""1s + 1s for each god already Stunned""}],""secondaryDescription"":""""}},""Id"":8966,""Summary"":""Waxing Moon"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1921_8966.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Chang'e can purchase or sell items from anywhere and her Jade Rabbit companion will fetch them. When the Rabbit reaches the store then returns, the transaction completes. Only one item can be purchased or sold in this way at a time. Chang'e also gains +25% movement speed with no backpedal penalty when using her dances."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Dance Move Speed:"",""value"":""+25%""}],""secondaryDescription"":""""}},""Id"":8967,""Summary"":""Jade Rabbit"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1921_8967.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.01,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":375,""HealthPerFive"":6,""HealthPerLevel"":70,""Lore"":""Not always born in the crucible of creation, sometimes Gods ascend by tragic happenstance. Such is the tale of Chang’e, Goddess of the Moon.\\n\\nAmong the immortals that lived in the Heavens, Chang’e was the most elegant dancer, like a dove on windswept currents. She drew the affection of the hero archer, Hou Yi, and the two were soon married. Everything was perfect.\\n\\nYet, beneath the Heavens, all was not well. Ten suns, the ten children of the Jade Emperor, rose to scorch the earth and boil the seas. Brave Hou Yi, bow in hand, shot nine from the sky, sparing only one. Though the world was saved, the Jade Emperor was furious his children were killed. In punishment, Hou Yi and Chang’e were made mortal.\\n\\nChang’e grew melancholy and danced no more. To restore their status in the Heavens, Hou Yi found the Elixir of Immortality, but thieves came to steal it while he was hunting. Chang’e struggled to hide the Elixir, but, in the end, was forced to drink it. Too much for one person, the Elixir gave her immortality, but it also swept her into the sky.\\n\\nSince then, Chang’e has lived on the moon, forbidden to see her husband, a Jade Rabbit her only companion. Yet, the Earth is once again in peril, and Chang’e finds herself upon the mortal surface. Perhaps, this is a second chance. If only she can save the world without angering the Jade Emperor, she can at last reunite with her husband."",""MP5PerLevel"":0.44,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":160,""MagicalPowerPerLevel"":7.25,""Mana"":290,""ManaPerFive"":5.5,""ManaPerLevel"":43,""Name"":""Chang'e"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":11,""PhysicalProtectionPerLevel"":2.7,""Pros"":"" High Sustain, High Mobility"",""Roles"":"" Mage"",""Speed"":355,""Title"":""Faerie of the Moon"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""5s"",""cost"":""60/65/70/75/80"",""description"":""Chang'e flings a crescent moon in an arc, dealing damage to all enemies in its path."",""menuitems"":[{""description"":""Ability:"",""value"":""Arc""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/120/160/200/240 (+60% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""20/18.5/17/15.5/14s"",""cost"":""60"",""description"":""Chang'e performs an evasive spin dance. She is unable to be hit during the action. For each tick of damage from an ability or Basic Attack that was avoided, Chang'e restores Mana to herself and her allies."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Self and Ally""}],""rankitems"":[{""description"":""Mana Restored:"",""value"":""20/30/40/50/60 per tick avoided""}],""secondaryDescription"":""""}},""abilityDescription3"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""60/65/70/75/80"",""description"":""Chang'e twirls, scattering flowers around her, and healing herself and all nearby allies and damaging nearby enemies.  Moonflower Dance also reduces the healing of all nearby e