trious students, Chiron, it seems, must constantly teach them the art of war. \\n\\nFame and legend are the hallmarks of his pupils. Perseus, who beheaded Medusa, Ajax, who battled bravely against Troy, and Achilles, who Chiron practically raised from infancy, all are figures of renown. But it is for their acts of violence, not art or science, for which songs are sung of these heroes. Chiron would prefer the world a more contemplative place where mankind adored nature and kindled bonds of friendship over scholarly discussions. \\n\\nThough, to his wizened eyes, the brink has been reached and the world he finds so fascinating tilts toward annihilation. Set aside are his books and scrolls, the easel and brush, and taken up are his bow and armor. On thunderous hooves Chiron gallops to the field. To save all that he holds dear, Chiron, the Great Teacher, will go to war."",""MP5PerLevel"":0.38,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":225,""ManaPerFive"":4.4,""ManaPerLevel"":40,""Name"":""Chiron"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":35,""PhysicalPowerPerLevel"":2.35,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":2.8,""Pros"":"" High Sustain, High Movement Speed"",""Roles"":"" Hunter"",""Speed"":380,""Title"":""The Great Teacher"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""13s"",""cost"":""55/60/65/70/75"",""description"":""Chiron warns his teammates to evade the area, removing crowd control effects so they can escape before it explodes, and does damage to all enemies in the area.\n\nApplies Target Mark"",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemies and Allies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""17.5""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/120/170/220/270 (