ds/2015/11/Chiron.png"",""id"":2075,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Time Rift"",""Ability2"":""Accelerate"",""Ability3"":""Stop Time"",""Ability4"":""Rewind"",""Ability5"":""Time Lord"",""AbilityId1"":8995,""AbilityId2"":8973,""AbilityId3"":8955,""AbilityId4"":8980,""AbilityId5"":9069,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""5s"",""cost"":""50/55/60/65/70"",""description"":""Chronos creates a rift in time, damaging all enemies in the area."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""10""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/125/170/215/260 (+85% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":8995,""Summary"":""Time Rift"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1920_8995.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Chronos accelerates himself over time, allowing him to move faster initially and gain speed over time. While active, his Attack Speed is increased. This ability also stops the Wheel of Time.\n\nSection I: Heal 1.5% Max Health Per Second.\nSection II: 100% Mana Refund On Abilities.\nSection III: +25% Magical Power.\nSection IV: +45% Magical Power Contribution to Basic Attacks."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Movement Speed:"",""value"":""25% initial + 12/14/16/18/20% over time""},{""description"":""Attack Speed:"",""value"":""15/20/25/30/35%""},{""description"":""Lifetime:"",""value"":""7s""}],""secondaryDescription"":""""}},""Id"":8973,""Summary"":""Accelerate"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1920_8973.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18/17/16/15/14s"",""cost"":""65/70/75/80/85"",""description"":""Shooting forward spinning gears of time, any enemies hit by Chronos' attack have their Attack and movement speed slowed to a Stun, taking damage on the initial hit and again when they are stunned."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage (applied twice):"",""value"":""50/70/90/110/130 (+40% of your Magical Power)""},{""description"":""Stun:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":8955,""Summary"":""Stop Time"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1920_8955.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""100/95/90/85/80s"",""cost"":""100"",""description"":""Chronos travels through time to where he was 8 seconds ago, gaining Health and Mana back to the values of that time.  All of his Cooldowns are instantly reset as well."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":8980,""Summary"":""Rewind"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1920_8980.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Chronos becomes empowered as time flows around him. Every 2 minutes he gains a stack that increases his Magical Power. Stacks up to 25 times, stacks are permanent."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Magical Power Per Stack:"",""value"":""3""}],""secondaryDescription"":""""}},""Id"":9069,""Summary"":""Time Lord"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1920_9069.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.48,""Health"":370,""HealthPerFive"":7,""HealthPerLevel"":70,""Lore"":""Existence is measured in age. How many years has a mortal lived? What was the construction date of the Parthenon? When were the cosmos formed? Time begins at birth, at creation. But, inevitably, time for all things comes to an end.\\n\\nExcept, of course, time itself.\\n\\nBearer of the clock of eternity, rimmed by signs of the Zodiac, the Keeper of Time, Chronos, counts every tick of the second hand, preventing interference with that essential forward momentum.\\n\\nIf he knows who or when the eternal clock was wound, Chronos does not tell, but upon the first stroke, he came to be. Emptiness was the ocean, then, and his only companion was Ananke, Queen of Fate. Together, their powers divided the vastness into heaven and earth and sea and sky. Thereafter, Chronos became an observer, the watchman of infinity.\\n\\nPatient to a fault, Chronos knows no urgency. He does not fear pain, or war, or death, for he is time itself and will outlast all. For this reason, his presence on the field of battle is alarming. This war between Gods must portend a conclusion so dire as to threaten the very existence of time. Perhaps, all the Gods should begin counting the seconds of the eternal clock. There may be few of them remaining."",""MP5PerLevel"":0.44,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":175,""MagicalPowerPerLevel"":7.5,""Mana"":240,""ManaPerFive"":4.4,""ManaPerLevel"":42,""Name"":""Chronos"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":11,""PhysicalProtectionPerLevel"":2.9,""Pros"":"" Medium Crowd Control, High Mobility"",""Roles"":"" Mage"",""Speed"":360,""Title"":""Keeper of Time"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""5s"",""cost"":""50/55/60/65/70"",""description"":""Chronos creates a rift in time, damaging all enemies in the area."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""10""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/125/170/215/260 (+85% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Chronos accelerates himself over time, allowing him to move faster initially and gain speed over time. While active, his Attack Speed is increased. This ability also stops the Wheel of Time.\n\nSection I: Heal 1.5% Max Health Per Second.\nSection II: 100% Mana Refund On Abilities.\nSection III: +25% Magical Power.\nSection IV: +45% Magical Power Contribution to Basic Attacks."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Movement Speed:"",""value"":""25% initial + 12/14/16/18/20% over time""},{""description"":""Attack Speed:"",""value"":""15/20/25/30/35%""},{""description"":""Lifetime:"",""value"":""7s""}],""secondaryDescription"":""""}},""abilityDescription3"":{""itemDescription"":{""cooldown"":""18/17/16/15/14s"",""cost"":""65/70/75/80/85"",""description"":""Shooting forward spinning gears of time, any enemies hit by Chronos' attack have their Attack and movement speed slowed to a Stun, taking damage on the initial hit and again when they are stunned."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage (applied twice):"",""value"":""50/70/90/110/130 (+40% of your Magical Power)""},{""description"":""Stun:"",""value"":""1s""}],""secondaryDescription"":""""}},""abilityDescription