":""Salmon's Leap (Furious Charge)"",""Ability4"":""Spear of Mortal Pain (War Cry)"",""Ability5"":""Berserk"",""AbilityId1"":14578,""AbilityId2"":14581,""AbilityId3"":14580,""AbilityId4"":14579,""AbilityId5"":14594,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""16/15/14/13/12s"",""cost"":""9 Rage"",""description"":""Cu Chulainn thrusts his spear forward, damaging all enemies in front of him and stunning less powerful minions. Successfully hitting an enemy with this ability restores 6 Rage (to a max of 18). Barbs from his spear stick in opponents and reduce their healing received for 4s.\n\nIn his Berserk Form, Cu Chulainn instead slams his massive arms down, damaging and rooting all enemies in front of him."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""45""}],""rankitems"":[{""description"":""Damage:"",""value"":""75/135/195/255/315 (+45% of your Physical Power)""},{""description"":""Healing Reduction:"",""value"":""40%""},{""description"":""Stun Duration:"",""value"":""2s""},{""description"":""Root Duration:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":14578,""Summary"":""Barbed Spear (Ground Slam)"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/06/Barbed-Spear-1.png""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""6s"",""cost"":""16 Rage"",""description"":""Cu Chulainn vents his anger as superheated steam, increasing his Movement Speed and draining his Rage. Every .5s while in this state, all enemies within range are damaged by the heat. Vent Anger does not return Rage.\r\n\r\nIn his Berserk form, Cu Chulainn Vents Anger automatically."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Self and Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"