/smite//wp-content/uploads/2017/05/Icons_Daji_A03.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""100s"",""cost"":""100"",""description"":""Da Ji Summons her signature torture device, the Paolao. As she hovers above the device she may fire up to 3 shots. Enemy gods hit take damage and become Chained and Slowed. At the end of her ability Chained enemies are pulled to the Paolao becoming Stunned and then taking damage 3 times over 2s. If a god hit by this ability becomes Crowd Control Immune at any time, they break the Chain on them and cannot be Chained again until this ability ends."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range: "",""value"":""80""}],""rankitems"":[{""description"":""Shot Damage:"",""value"":""70/80/90/100/110 (60% of your Physical Power)""},{""description"":""Chain Slow:"",""value"":""20%""},{""description"":""Pull Damage per Tick:"",""value"":""60/90/120/150/180 (+20% of your Physical Power)""},{""description"":""Pull Stun Duration:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":14636,""Summary"":""Paolao"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/05/Icons_Daji_A04.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Da Ji's sharp claws cause her enemies to Bleed when struck by her basic attacks. Bleeding causes the enemy to take additional damage every 1s for 2s (This damage does not trigger Item effects). Bleed can stack any number of times on the same target. "",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage Per Tick:"",""value"":""7 (+10% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":14420,""Summary"":""Torture Blades"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/05/Icons_Daji_Passive.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.02,""Cons"":"""",""HP5PerLevel"":0.7,""Health"":425,""HealthPerFive"":9,""HealthPerLevel"":74,""Lore"":""Emperor Zhou’s desire for the Goddess Nu Wa was considered an obsession, perhaps even madness. She sent signs and missives to reject him, but Zhou would not be dissuaded. At night, he slipped into her temple and scrawled poetry across the walls espousing his undying love. This defilement could not go unanswered. Nu Wa summoned the most conniving and wicked Fox Spirit she could and thrust it upon the Emperor with intent to spiral his life into misery. Little did Nu Wa know what she had just unleashed.\\n\\nFor thousands of years the nine-tailed Fox spirit had lived, biding its time, honing its malicious appetites. Finally in human form, it assumed the irresistible guise of Da Ji, and to Emperor Zhou, she could do no wrong.\\n\\nWith free reign of the Empire and its people, Da Ji reveled in torture and malice. She took delight in their screams of pain as she danced to playful music composed at her command, the musicians trembling for every note.\\n\\nSo grievous did these atrocities grow that the people rose up and overthrew their ruler. They stormed the gates, toppled the throne, and pursued Zhou to his bed chamber, where the crazed emperor finally took his own life.\\n\\nYet, Da Ji managed to escape and conceal herself. Now she joins the fray, not to save the universe, nor empower her pantheon, but instead to soak up every last cry of anguish from her enemies."",""MP5PerLevel"":0.37,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":210,""ManaPerFive"":4.6,""ManaPerLevel"":40,""Name"":""Da Ji"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.25,""PhysicalProtection"":14,""PhysicalPro