"75/125/175/225/275 (+40% of your Physical Power)""},{""description"":""Shield Health:"",""value"":""70/110/150/190/230 ""},{""description"":""Mink Damage:"",""value"":""90/150/210/270/330 (+85% of your Physical Power)""},{""description"":""Mink Attack Speed:"",""value"":""15/20/25/30/35%""}],""secondaryDescription"":""""}},""Id"":13019,""Summary"":""72 Transformations"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/Icons_ErLangShen_A03_1.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""85s"",""cost"":""80/85/90/95/100"",""description"":""Erlang Shen Taunts nearby Enemy gods, gaining Damage Mitigation for the next 4s. Afterwards, if Erlang Shen is still alive he is Healed for a flat amount plus 15% of his Maximum Health."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Self and Enemies""}],""rankitems"":[{""description"":""Heal:"",""value"":""150/225/300/375/450 (15% of your Maximum Health)""},{""description"":""Damage Mitigation:"",""value"":""10/11.25/12.5/13.75/15%""},{""description"":""Taunt Duration:"",""value"":"".8/.9/1/1.1/1.2s""}],""secondaryDescription"":""""}},""Id"":13156,""Summary"":""9 Turns Blessing"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/Icons_ErLangShen_A04_1.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Each time Erlang Shen hits an enemy with a Basic Attack, his dog hits as well for 15% of his Basic Attack power, which triggers items for Basic Attacks at 15% of their normal damage and can Critical Hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self and Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""(pexistsppropppower/0.15/+#/+15% of your Basic Attack Power)""}],""secondaryDescription"":""""}},""Id"":13022,""Summary"":""Howling Celestial Dog"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/Icons_ErLangShen_Passive_1.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.01,""Cons"":"""",""HP5PerLevel"":0.6,""Health"":475,""HealthPerFive"":8,""HealthPerLevel"":82,""Lore"":""Many are the legendary tales of Erlang Shen.\\n\\nHearing the riverlands surrounding his home were consumed by floods, he went to engineer new dams and canals. Yet the true  source of the disaster proved to be an evil dragon. With seven companions, Erlang Shen ambushed the beast. Cowardly and quick the dragon slithered into the rapid river waters, but Erlang Shen captured it with a great chain and bound it beneath a shrine. Thus the floods subsided.\\n\\nWhen Sun Wukong’s troublesome antics drew the ire of the Jade Emperor, Erlang Shen faced the Monkey King on the battlefield. For every form Sun Wukong took, Erlang Shen transformed as well. Across sea and sky and land they battled. Thus was Sun Wukong sent fleeing for his life.\\n\\nWhen the people were plagued by demons and monsters, Erlang Shen slaughtered them to keep his countrymen safe. Three-bladed spear in hand and hunting dog at his side, no evil could threaten the innocent or the Empire. Thus, Erlang came to be loved and worshipped.\\n\\nA Goddess mother and a mere mortal father, he is of two worlds. He is both sage and a soldier, humble yet regal, his veins filled with the blood of men and the divine blood of his uncle, the Jade Emperor. Having risen above his forbidden origins, Erlang Shen has proven himself among the greatest of heroes in the Jade Empire. Perhaps that is why he now takes the field. No demon, nor dragon, nor even the Monkey King himself has stood against him and won. To save the people, to save the world, Erlang Shen will fight, and another legend will be born!"",""MP5PerLevel"":0.3,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":4.