ing."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/125/170/215/260 (+50% of your Magical Power)""},{""description"":""Slow:"",""value"":""20%""},{""description"":""Dragon Damage Per Tick:"",""value"":""50/70/90/110/130 (+25% of your Magical Power)""},{""description"":""Dragon Protection Debuff:"",""value"":""20%""}],""secondaryDescription"":""""}},""Id"":12923,""Summary"":""Cursed Strength"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/139243471697046.lTbkB1q2zEnEONpJlpaD_height640.png""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""50/55/60/65/70"",""description"":""Fafnir coerces his allies into fighting harder, boosting Attack Speed for 5s and healing himself. While Coerce is active Fafnir deals bonus Magic Damage whenever the affected ally damages an enemy.\n\nIn dragon form, this ability has a larger area of effect and can buff multiple allies."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Allies and/or Self""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Attack Speed Buff:"",""value"":""10/20/30/40/50%""},{""description"":""Bonus Damage:"",""value"":""5/10/15/20/25% of the target's power""},{""description"":""Self Heal:"",""value"":""50/75/100/125/150 (+40% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":12922,""Summary"":""Coerce"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/139243471697054.KoIeOmBm3CAko5jJihDX_height640.png""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""70"",""description"":""Fafnir leaps to a target location and executes a despicable strike, dealing damage and disarming enemies in front of him for 2s.\n\nIn dragon form, Fafnir can leap much further. Also, this ability deals increased damage that ticks three times over 3s and Fafnir Stuns the enemy god closest to him for 2s in addition to Disarming. "",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/120/160/200/240 (+60% of your Magical Power)""},{""description"":""Dragon Damage Per Tick:"",""value"":""40/60/80/100/120 (+30% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":12926,""Summary"":""Underhanded Tactics"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/139243471697052.n4D25I4bN8APkbJlQ9pl_height640.png""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Fafnir transforms into a terrifying dragon and is untargetable during the process. When he emerges in dragon form, nearby enemies are poisoned, taking damage three times over 3s. He remains in this form for a duration or until the ability is activated again. As a dragon, his abilities have additional effects and his basic attack changes to a Dragon Breath that deals damage 3 times per second. Dragon Breath can not proc item hit effects."",""menuitems"":[{""description"":""Ability:"",""value"":""Stim""},{""description"":""Affects:"",""value"":""Self and Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage Per Tick:"",""value"":""80/100/120/140/160 (+40% of your Magical Power)""},{""description"":""Duration:"",""value"":""20/25/30/35/40s ""},{""description"":""Dragon Breath Damage:"",""value"":""20/25/30/35/40 (+10% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":12946,""Summary"":""Draconic Corruption"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/139243471697060.vxC2PMHo3IVabYGB9Xz4_height640.png""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Fafnir gains 2 bonus gold from all  enemy kills and assists, including minions. Fafnir also gains bonus Protections based on the amount of gold he is currently holding. The bonuses gained from this ability are capped at 1000 gold in hand."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""}],""rankitems"":[{""description"":""Bonus Protections:"",""value"":""Up to 20 Magical and Physical Protections ""}],""secondaryDescription"":""""}},""Id"":12942,""Summary"":""Endless Greed"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/139243471697056.HPEX2fqRHYxV1WEHURvy_height640.png""},""AttackSpeed"":0.9,""AttackSpeedPerLevel"":0.011,""Cons"":"""",""HP5PerLevel"":0.54,""Health"":495,""HealthPerFive"":5,""HealthPerLevel"":90,""Lore"":""There is no creature, living nor dead, more greedy, more vile than a dwarf. In the frozen reaches of Asgard, beneath her mighty stone peaks, do they dwell, ever hammering to forge more gold jewelry, to carve more gleaming gems, to breathe curses into their finery.\\n\\nAmong these wretched kin is Fafnir, son of Hreidmar, with a swollen smithing arm and a ravenous hunger for violence, both of which are eclipsed by his avarice.\\n\\nOne Spring, Odin, Loki, and Honir visited Hreidmar’s realm, bearing an otter pelt they’d skinned on their journey. Horrified, Hreidmar entombed the Aesir, for the otter was, in truth, his third son. Freedom would not be theirs until Loki returned with the hide filled with gold.  Refusing to be outdone, the Trickster God, stuffed the pelt to bursting with the cursed treasure of Andvarri. Hreidmar, unaware of the maligned hoard, greedily exchanged the Aesir for the wealth. That night, curling his powerful arm, Fafnir strangled his father and vanished into the frosted night with the cursed gold.\\n\\nAnd so it was that madness took him. Paranoid his last brother would steal the treasure, Fafnir guarded it jealously while the curse whispered in his ear. Slowly, surely, twisted he became, scaled and nightmarish. His breath turned to poison, his maw, fanged, his demeanor, fouler. A dragon, he became. The very symbol of greed.\\n\\nFor centuries Fafnir kept no company, but the War of the Gods grows ever closer, and the clink of coin runs rampant; a bulging sack on the belt of every warrior. He craves every piece, and spares no thought to shed blood for the glittering gold."",""MP5PerLevel"":0.45,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":185,""MagicalPowerPerLevel"":7.75,""Mana"":200,""ManaPerFive"":4.5,""ManaPerLevel"":40,""Name"":""Fafnir"",""OnFreeRotation"":"""",""Pantheon"":""Norse"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":21,""PhysicalProtectionPerLevel"":3.4,""Pros"":"" High Defense, High Mobility"",""Roles"":"" Guardian"",""Speed"":365,""Title"":""The Lord of Glittering Gold"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Fafnir hurls his hammer forward, dealing damage to enemies in its path. If Fafnir hits a god the hammer stops short and Stuns them for 1.5s. The Stunned god also radiates out a cursed pulse, Slowing them and nearby enemies for 3s.\n\nIn dragon form, this ability deals increased damage that ticks 3 times over 3s. Also, the cursed pulse shreds Protections in addition to Slowing."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/125/170/215/260 (+50% of your Magical Power)""},{""description"":""Slow:"",""value"":""20%""},{""description"":""Dragon Damage Per Tick:"",""value"":""50/70/90/110/130 (+25% of your Magical Power)""},{""description"":""Dragon Protection Debuff:"",""value"":""20%""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""50/55/60/65/70"",""description"":""Fafnir coerces his allies into fighting harder, boosting Attack Speed for 5s and healing himself. While Coerce is active Fafnir deals bonus Magic Damage whenever the affected ally damages an enemy.\n\nIn dragon form, this ability has a larger area of effect and can buff multiple allies."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Allies and/or Self""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Attack Speed Buff:"",""value"":""10/20/30/40/50%""},{""description"":""Bonus Damage:"",""value"":""5/10/15/20/25% of the target's power""},{""description"":""Self Heal:"",""value"":""50/75/100/125/150 (+40% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription3"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""70"",""description"":""Fafnir leaps to a target location and executes a despicable strike, dealing damage and disarming enemies in front of him for 2s.\n\nIn dragon form, Fafnir can leap much further. Also, this ability deals increased damage that ticks three times over 3s and Fafnir Stuns the enemy god closest to him for 2s in addition to Disarming. "",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/120/160/200/240 (+60% of your Magical Power)""},{""description"":""Dragon Damage Per Tick:"",""v