kitems"":[],""secondaryDescription"":""""}},""godAbility1_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/139243471697046.lTbkB1q2zEnEONpJlpaD_height640.png"",""godAbility2_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/139243471697054.KoIeOmBm3CAko5jJihDX_height640.png"",""godAbility3_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/139243471697052.n4D25I4bN8APkbJlQ9pl_height640.png"",""godAbility4_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/139243471697060.vxC2PMHo3IVabYGB9Xz4_height640.png"",""godAbility5_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/139243471697056.HPEX2fqRHYxV1WEHURvy_height640.png"",""godCard_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/Fafnir_Default_Card.jpg"",""godIcon_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/06/Fafnir_Default_Icon.png"",""id"":2136,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Unchained"",""Ability2"":""Seething Howl"",""Ability3"":""Brutalize"",""Ability4"":""Ragnarok"",""Ability5"":""Unbound Runes"",""AbilityId1"":8831,""AbilityId2"":8830,""AbilityId3"":8857,""AbilityId4"":8825,""AbilityId5"":8485,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""65/70/75/80/85"",""description"":""Fenrir leaps forward, dealing damage to all enemies when he lands.  At full Runes, the leap Stuns the enemies hit.  If the leap hits a god, the Cooldown is halved."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""95/155/215/275/335 (+80% of your Physical Power)""},{""description"":""Stun:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":8831,""Summary"":""Unchained"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1843_8831.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""13s"",""cost"":""60/65/70/75/80"",""description"":""Fenrir rears back and howls, inspiring himself with a Physical Power and Lifesteal Buff.  At full Runes, the Buff is increased by 50%."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Allies""}],""rankitems"":[{""description"":""Physical Power:"",""value"":""10/25/40/55/70""},{""description"":""Physical Lifesteal:"",""value"":""30%""},{""description"":""Buff Duration:"",""value"":""6s""}],""secondaryDescription"":""""}},""Id"":8830,""Summary"":""Seething Howl"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1843_8830.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""70/75/80/85/90"",""description"":""Fenrir pounces to his ground target location.  If there was an enemy in the radius, he strikes them 4 times, dealing damage with each strike while being immune to knockups.  At full Runes, each strike deals 75% damage to nearby enemies."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""45/75/105/135/165 (+50% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":8857,""Summary"":""Brutalize"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1843_8857.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Upon Ragnarok, Fenrir grows massive in size, becoming immune to CC while moving faster.  Fenrir bites enemy gods, dealing Physical damage and carrying them away.  Biting a CC immune target deals the damage but ends his Ultimate.  At full Runes, his Protections double."",""menuitems"":[{""description"":""Ability:"",""value"":""Single Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""200/275/350/420/500 (+120% of your Physical Power)""},{""description"":""Movement Speed:"",""value"":""50%""},{""description"":""Carry Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""Id"":8825,""Summary"":""Ragnarok"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1843_8825.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Fenrir gains efficiency as he attacks.  Every hit from a Basic Attack activates 1 Rune, up to a max. of 5.  Each of Fenrir's abilities gain an additional benefit when used at maximum Runes and the Runes are consumed.  Enemy gods that Fenrir kills will fully activate all of his Runes."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":8485,""Summary"":""Unbound Runes"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1843_8485.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.017,""Cons"":"""",""HP5PerLevel"":0.73,""Health"":455,""HealthPerFive"":8,""HealthPerLevel"":78,""Lore"":""Mortals must rely on the wisdom of the Gods, but never forget they are fallible. They can be petty, churlish, and worst of all, wrong. What are the consequences for their mistakes? They should have slain the wolf-beast Fenrir, but they chose instead to bind him. Despite the warnings and prophecies he would tear Odin apart at Ragnorok and devour the earth and sky, they did not end Loki's son. Now, terror roams free. It is unknown how, but Fenrir is Unbound.\\n\\nThrice they tried to bind him, each time convincing Fenrir that the chains were nothing more than a challenge for his strength, a test to see if he could shatter them. The first two God-forged fetters were easily broken beneath the beast’s terrible power, but the third was a ribbon, dwarf made, and Fenrir grew suspicious of the God’s intentions. As a show of faith, he demanded one of them place a hand in his mouth, and if the ribbon proved magical in nature, he would exact punishment. Brave, if foolish, Tyr put his fist in Fenrir’s maw as the ribbon was secured to the wolf’s leg. Fenrir strained and screamed, but could not break free, and in rage, he devoured Tyr’s hand.\\n\\nFor a time, Fenrir was forgotten, the dire prophecy just a memory. But they were all warned and the Gods did nothing. Fenrir is hungry now, the first hunter, an alpha among sheep, but no flesh will satisfy his need. It is revenge he craves, and now he is Unbound."",""MP5PerLevel"":0.26,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":230,""ManaPerFive"":4.2,""ManaPerLevel"":35,""Name"":""Fenrir"",""OnFreeRotation"":"""",""Pantheon"":""Norse"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.3,""PhysicalProtection"":14,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Single Target Damage, High Mobility"",""Roles"":"" Assassin"",""Speed"":370,""Title"":""the Unbound"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""65/70/75/80/85"",""description"":""Fenrir leaps forward, dealing damage to all enemies when he lands.  At full Runes, the leap Stuns the enemies hit.  If the leap hits a god, the Cooldown is halved."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""95/155/215/275/335 (+80% of your Physical Power)""},{""description"":""Stun:"",""value"":""1s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""13s"",""cost"":""60/65/70/75/80"",""description"":""Fenrir rears back and howls, inspiring himself with a Physical Power and Lifesteal Buff.  