ption"":""Freya uses her Cloak of Feathers to fly above the battlefield where she fires down blasts of Magical damage up to 4 times while flying.  Freya can't be hit when at full ascension and can cancel it anytime."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""12""}],""rankitems"":[{""description"":""Damage per Blast:"",""value"":""100/135/170/205/240 (+35% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":8371,""Summary"":""Valkyrie's Discretion"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1784_83711.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Freya's necklace grants her additional Magical Lifesteal."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Magical Lifesteal:"",""value"":""15%""}],""secondaryDescription"":""""}},""Id"":8364,""Summary"":""Brisingamen's Blessing"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1784_83641.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.019,""Cons"":"""",""HP5PerLevel"":0.52,""Health"":405,""HealthPerFive"":7,""HealthPerLevel"":80,""Lore"":""Valkyries, the elite and angelic warriors of the Nordic Pantheon, are as beautiful and dangerous as a midnight winter storm. Yet their queen, Freya, so irresistibly desirable, so uncompromising in warfare, make the Valkyries seem nothing more than plain paper dolls. She’s the object of desire for every God, every man, and the envy of every woman. Even the Frost Giants crave her for their own, often devising devious plans to trick or force her into marriage. But Freya is proud and strong, with the cunning to escape her enemies and ruthlessly retaliate. Every rose bears thorns, but this one wields swords.\\n\\nWere it up to her, Freya would have little to do with blood and blades. Her name literally means “the lady,” and none of more worthy of the title. She adores bright flowers, pleasant company, and the sweet lilt of a sad love song. She’s sensual and amorous, invoked by worshipers seeking to bear a child or find a lover. Ruler of the realm of Sessrumnir, a place much like Valhalla, where the souls of dead warriors spend eternity, Freya provides comfort and bliss to the fallen.\\n\\nOnce, Freya was married to the mysterious and elusive God, Od. Immediately following their wedding, Od went on a journey to distant and inhospitable lands. So long was he gone the Gods presumed him dead. Distraught and heartbroken, Freya spilled tears of gold and searched the globe for him. Finally, she discovered him ship-wrecked and twisted into a hideous sea monster. Melancholy but loyal, she stayed and comforted him. Though one night, while she slept, a daring hunter slew the beast Od had become. Moved by Freya’s utter despair, the Gods agreed to allow Od into Sussrumnir, despite the fact he had not died in battle, so he and Freya could remain together forever."",""MP5PerLevel"":0.39,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":175,""MagicalPowerPerLevel"":7.5,""Mana"":220,""ManaPerFive"":4.5,""ManaPerLevel"":37,""Name"":""Freya"",""OnFreeRotation"":"""",""Pantheon"":""Norse"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":14,""PhysicalProtectionPerLevel"":2.8,""Pros"":"" High Area Damage, Medium Crowd Control"",""Roles"":"" Mage"",""Speed"":375,""Title"":""Queen of the Valkyries"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""11s"",""cost"":""60/65/70/75/80"",""description"":""Freya activates a Buff that makes her Basic Attacks do additional Magical damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""des