5/70/75/80/85"",""description"":""Ganesha curses his Enemies with his considerable willpower, damaging them. For each Enemy he hits (up to a maximum of 5), all Allied Gods within 55 units of Ganesha gain bonus Damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/150/210/270/330 (+55% of your Magical Power)""},{""description"":""Bonus Damage per Stack:"",""value"":""2%""},{""description"":""Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":14499,""Summary"":""Turn of Fate"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2017/04/Ganesha_Icon_01_64.png""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""14/13/12/11/10s"",""cost"":""55/60/65/70/75"",""description"":""Ganesha begins chanting and rises into the lotus position, where he is slowed slightly but may travel freely in all directions. While chanting, he silences Enemy gods in a cone in front of him and increases Physical Protections for all nearby Allied Gods."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Radius:"",""value"":""35""}],""rankitems"":[{""description"":""Duration:"",""value"":""1.8s""},{""description"":""Protections:"",""value"":""20/30/40/50/60""}],""secondaryDescription"":""""}},""Id"":14498,""Summary"":""Ohm"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2017/04/Ganesha_Icon_02_64.png""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70/75/80/85/90"",""description"":""Ganesha charges forward, hooking an enemy with his goad, holding them in place and damaging the enemy before knocking them up. While dashing, Ganesha passes through player-made deployables."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""75/120/165/210/255 (+45% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":14346,""Summary"":""Remove Obstacles"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2017/04/Ganesha_Icon_03_64.png""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""75s"",""cost"":""80/90/100/110/120"",""description"":""Ganesha summons the Four Great Pillars of Righteousness to imprison his Enemies. Between each pair of pillars a magical field is created, and Enemies who pass through the field take Damage, are Slowed, and have their Protections reduced for 3s.\n\nEnemy Minions and Jungle Monsters take 40% of this Damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Duration:"",""value"":""6s""},{""description"":""Damage per Hit:"",""value"":""95/135/175/215/255 (40% of your magical power)""},{""description"":""Slow:"",""value"":""35%""},{""description"":""Protection Reduction:"",""value"":""15/25/35/45/55""},{""description"":""Debuff Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":14350,""Summary"":""Dharmic Pillars"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2017/04/Ganesha_Icon_04_64.png""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Any time Ganesha deals a killing blow, the nearest Friendly God receives credit for the kill and Ganesha receives the rewards for an assist instead. In addition, his assist range is increased by 20 and the time before he loses his assist credit is increased by 5s."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Allied Gods""},{""description"":""Radius:"",""value"":""100""}],""rankitems"":[{""description"":""Duration:"",""value"":""15s""}],""secondaryDescription"":""""}},""Id"":14409,""Summary"":""Good Fortune"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2017/04/Ganesha_Passive_64.png""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.67,""Health"":495,""HealthPerFive"":6,""HealthPerLevel"":95,""Lore"":""After rigorous celebration, Parvati, Goddess of fertility and love, washed the dirt and sweat from her body. It floated upon the surface of her pool, formless and purposeless. With a wave of her hand, it was transformed into a boy, her son, and set him to guard the door as she finished washing. Shiva, the supreme being, returned and found this child doggedly blocking his path. Fearing the safety of his wife, Shiva drew his sword and cut him down.\\n\\n“This is your son!” Parvati cried. “You must save him!”\\n\\nHurriedly, Shiva replaced the head of the child with the wisest creature in the world, that of an elephant. Thus, was Ganesha truly born.\\n\\nGenerous, warm-hearted, and optimistic, Ganesha has assumed authority over the very thing his mother tasked of him - obstacles. For those whose hearts are filled with boastful arrogance, Ganesha challenges progress. Financial difficulties, faulty materials, and unhappiness plague their every action. But, for the honest, the hard working, Ganesha clears the way. A life of good fortune, bright skies, and joyous laughter. \\n\\nObstacles can be either placed or removed. So, to Ganesha all mortals pray when starting a new endeavor, that their path will be open and their future bright. That he may grant them success.\\n\\nOnly with reluctance has Ganesha joined the Battle of the Gods. Violence is the last obstacle the elephant-God would ever place. But these are not mortals that threaten existence. They are Gods, and it is time that Ganesha determined who should succeed, and who should fail."",""MP5PerLevel"":0.42,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.75,""Mana"":200,""ManaPerFive"":4.6,""ManaPerLevel"":40,""Name"":""Ganesha"",""OnFreeRotation"":"""",""Pantheon"":""Hindu"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":20,""PhysicalProtectionPerLevel"":3.2,""Pros"":"" High Crowd Control, High Defense"",""Roles"":"" Guardian"",""Speed"":360,""Title"":""God of Success"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""65/70/75/80/85"",""description"":""Ganesha curses his Enemies with his considerable willpower, damaging them. For each Enemy he hits (up to a maximum of 5), all Allied Gods within 55 units of Ganesha gain bonus Damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/150/210/270/330 (+55% of your Magical Power)""},{""description"":""Bonus Damage per Stack:"",""value"":""2%""},{""description"":""Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""14/13/12/11/10s"",""cost"":""55/60/65/70/75"",""description"":""Ganesha begins chanting and rises into the lotus position, where he is slowed slightly but may travel freely in all directions. While chanting, he silences Enemy gods in a cone in front of him and increases Physical Protections for all nearby Allied Gods."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Radius:"",""value"":""35""}],""rankitems"":[{""description"":""Duration:"",""value"":""1.8s""},{""description"":""Protections:"",""value"