top speed, Geb becomes CC immune, and will also Knockback enemy gods."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""100/175/250/325/400 (+50% of your Magical Power)""},{""description"":""Slow:"",""value"":""30%""},{""description"":""Slow Duration:"",""value"":""1/1.25/1.5/1.75/2s""}],""secondaryDescription"":""""}},""Id"":9569,""Summary"":""Roll Out"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1978_9569.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Geb creates a shock wave, which ripples out from him in a cone, causing damage and Knockup to all enemies. The damage decreases the further the enemy is from Geb, down to 50% at the maximum range."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""45""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/160/230/300/370 (+50% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":9559,""Summary"":""Shock Wave"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1978_9559.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""60"",""description"":""Geb targets himself or an ally to put a Shield around. The Shield blocks all damage and lasts until its time expires or it takes enough damage to be destroyed. The Shield also cleanses any Crowd Control when applied."",""menuitems"":[{""description"":""Ability:"",""value"":""Shield""},{""description"":""Affects:"",""value"":""Allies or Self""}],""rankitems"":[{""description"":""Shield Health:"",""value"":""50/100/150/200/250 +20 per Geb's Level""},{""description"":""Shield Duration:"",""value"":""3/3.5/4/4.5/5 ""}],""secondaryDescription"":""""}},""Id"":9565,""Summary"":""Stone Shield"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1978_9565.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Geb pulls apart the earth, dealing Magical damage to all enemy gods based on a percent of their current Health, and Stunning them."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy Gods""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""15/20/25/30/35% of current target's Health""},{""description"":""Stun Duration:"",""value"":""1.6/1.7/1.8/1.9/2s""}],""secondaryDescription"":""""}},""Id"":9648,""Summary"":""Cataclysm"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1978_9648.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Crits only do +25% damage to Geb, rather than the normal +100%."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":9561,""Summary"":""Hard as Rock"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1978_9561.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.8,""Health"":510,""HealthPerFive"":8,""HealthPerLevel"":90,""Lore"":""Behold the rumble from the deep, for it is the bellow of rock and stone. A titan of immortal ages has awoken from fitful slumber to crush all who tread upon his realm. A lumbering giant, patient, deliberate, unmovable; he is Geb, God of Earth.\\n\\nWhen a mortal’s heart is weighed in the halls of Ma’at, Geb sits among the Gods in judgment. Those burdened with guilt and regret are claimed by Geb and dragged through the earthen crust to the underworld. Hearts free of such heaviness are taught words of power and ascend to the sky.\\n\\nAh, the sky.\\n\\nIt is but the one thing Geb longs for. In his eye, she is glorious sapphire, an unreachable object. But it was not always so. Once, the earth and sky were as one, Geb and Nut, Goddess of the Sky, locked in a lover’s embrace. Ra deemed their union unfit and sent Shu, God of Wind, between them. In his rage, Geb thundered and broke the earth, but for naught, Nut was now forever out of reach.\\n\\nThough his desire has not weathered with the ages, Geb has rested peacefully for time immemorial, nurturing Mankind through bountiful harvest and stable ground for pyramids and palaces. It is the clash of Gods upon his surface that stirs him. He has risen to war, though his motives are unclear. Does he fight to prevent the destruction of his realm, or will he seize the chance to shatter the wind and reunite the earth and sky? Whatever the outcome, the earth will always remain."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.5,""Mana"":190,""ManaPerFive"":4.6,""ManaPerLevel"":34,""Name"":""Geb"",""OnFreeRotation"":"""",""Pantheon"":""Egyptian"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":19,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Crowd Control, High Defense"",""Roles"":"" Guardian"",""Speed"":360,""Title"":""God of Earth"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""14/13/12/11/10s"",""cost"":""50/55/60/65/70"",""description"":""Geb turns into a mass of rolling earth, damaging and Slowing enemies he encounters, stopping at the first god he hits. He increases speed as he travels and his damage increases from 75% to 100% over 3s. Once at his top speed, Geb becomes CC immune, and will also Knockback enemy gods."",""menuitems"":[{""description"":""Ability:"