scription"":{""cooldown"":""12s"",""cost"":""60/65/70/75/80"",""description"":""Guan Yu's courageous leadership is infectious and, when focused, heals himself and his allies. Healing friendly gods reduces all Cooldowns by 2s."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Allies""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Healing:"",""value"":""50/75/100/125/150""},{""description"":""Boosted Healing:"",""value"":""100/150/200/250/300""}],""secondaryDescription"":""""}},""Id"":9146,""Summary"":""Conviction"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1763_9146.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""60/65/70/75/80"",""description"":""Guan Yu charges forward, his Green Dragon Crescent Blade extended in front of him. All enemies in his path take damage and are Slowed. Hitting enemy gods lowers all of Guan Yu's Cooldowns by 2s. Guan Yu is immune to Roots, Cripples, and Knockups while dashing."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/135/190/245/300 (+60% of your Physical Power)""},{""description"":""Slow:"",""value"":""20%""},{""description"":""Slow Duration:"",""value"":""2s""},{""description"":""Boosted Slow:"",""value"":""40%""}],""secondaryDescription"":""""}},""Id"":9147,""Summary"":""Warrior's Will"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1763_9147.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Guan Yu spins his blade in a controlled but furious display, slicing enemies for damage every .3s for 3s.  Each hit steals enemy Protections, giving them to Guan Yu. Guan Yu is immune to Knockback for the duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage per Hit:"",""value"":""15/25/35/45/55 (+20% of your Physical Power)""},{""description"":""Protections Stolen:"",""value"":""2/4/6/8/10 Max. 3 Stacks.""},{""description"":""Protection Duration:"",""value"":""3/3.5/4/4.5/5s""},{""description"":""Boosted Protections Stolen:"",""value"":""3/6/9/12/15 Max. 3 Stacks.""}],""secondaryDescription"":""""}},""Id"":10132,""Summary"":""Taolu Assault"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1763_10132.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""80/90/100/110/120"",""description"":""Guan Yu mounts his warhorse and charges for 4s. While mounted, he can steer and attack and is immune to Crowd Control. Enemies hit take damage and are Slowed. Each hit increases damage from consecutive hits against that target by 20%. Enemies hit on the dismount are Stunned. You can dismount at any time by canceling."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""85/115/145/175/205 (+30% of your Physical Power)""},{""description"":""Damage Escalation:"",""value"":""20% per hit""},{""description"":""Slow:"",""value"":""25% for 2s""},{""description"":""Stun:"",""value"":""1.5s""},{""description"":""Boosted CC:"",""value"":""40% Slow and 2s Stun""}],""secondaryDescription"":""""}},""Id"":9177,""Summary"":""Cavalry Charge"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1763_9177.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Each time Guan Yu damages or receives damage from an enemy he gains stacks. At max stacks the next ability used will have a boosted effect."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Num Hits to Full Charge:"",""value"":""20 Stacks ""},{""description"":""Conviction Boost:"",""value"":""Healing""},{""description"":""Warrior's Will Boost:"",""value"":""Slow""},{""description"":""Taolu Assault Boost:"",""value"":""Protection Steal""},{""description"":""Cavalry Charge Boost:"",""value"":""Slow and Stun""}],""secondaryDescription"":""""}},""Id"":13181,""Summary"":""Painless"",""URL"":""""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.009,""Cons"":"""",""HP5PerLevel"":0.7,""Health"":470,""HealthPerFive"":6,""HealthPerLevel"":84,""Lore"":""As a man, Guan Yu was the embodiment of loyalty, honor, and strength. As a God, he is a guardian of justice, a hero to the downtrodden, the Saint of War.\\n\\nIn the ancient times of the East, a great war between Three Kingdoms raged. The warlord Liu Bei, and his friends, Zheng Fei, and the mighty Guan Yu swore an oath of brotherhood in a mystical peach garden, vowing to create a new, righteous world. Together, they fought countless battles against the warlords Cao Cao and Sun Quan, and Guan Yu grew famous for his combat prowess and unwavering honor.\\n\\nDuring the war, Cao Cao captured Guan Yu. At the time, Liu Bei’s fate was uncertain, so he agreed to fight for Cao Cao under specific terms, chiefly that he would abandon Cao Cao if ever he learned the whereabouts of his sworn brother. Despite Cao Cao’s gifts and promises of wealth, when Liu Bei resurfaced, Guan Yu immediately went to his side. Years later, Guan Yu again faced Cao Cao on the battlefield as the warlord fled from his defeat at Red Cliffs. Guan Yu cut off Cao Cao’s retreat and obliterated his forces. Cao Cao, however, he spared and released, as a matter of honor.\\n\\nAfter his death, Guan Yu’s spirit remained at a holy shrine, coming to the aid of nearby villagers in need, battling the cruel and selfish. From all over the East, worshippers came to the shrine and burned incense to honor him. Such popularity led to Faith, and thus Guan Yu was raised as a God, deified a few hundred years later.\\n\\nNow, he embodies the virtues he lived by. His statues, wielding a massive guan dao, ward against evil. Red faced to represent loyalty, his likeness is carried by merchants as proof they can be trusted. If their cause is just, he leads armies to victory. Among the Gods of any Pantheon, there are few as deadly and none as righteous as Guan Yu."",""MP5PerLevel"":0.45,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":4.8,""ManaPerLevel"":32,""Name"":""Guan Yu"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":37,""PhysicalPowerPerLevel"":2.0,""PhysicalProtection"":16,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Sustain, High Mobility"",""Roles"":"" Warrior"",""Speed"":375,""Title"":""Saint of War"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""60/65/70/75/80"",""description"":""Guan Yu's courageous leadership is infectious and, when focused, heals himself and his allies. Healing friendly gods reduces all Cooldowns by 2s."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Allies""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Healing:"",""value"":""50/75/100/125/150""},{""description"":""Boosted Healing:"",""value"":""100/150/200/250/300""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""60/65/70/75/80"",""description"":""Guan Yu charges forward, his Green Dragon Crescent Blade extended in front of him. All enemies in his path take damage and are Slowed. Hitting enemy gods lowers all of Guan Yu's C