n_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1763.jpg"",""id"":1763,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Death From Below"",""Ability2"":""Shroud of Darkness"",""Ability3"":""Devour Souls"",""Ability4"":""Pillar of Agony"",""Ability5"":""Blight"",""AbilityId1"":7343,""AbilityId2"":7354,""AbilityId3"":7356,""AbilityId4"":7357,""AbilityId5"":7550,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""50/55/60/65/70"",""description"":""Hades descends into the ground and erupts from below at his ground location, doing damage to all enemies in the area. If the enemy is Blighted, they are also Slowed. Applies Blight."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/120/170/220/270 (+60% of your Magical Power)""},{""description"":""Slow:"",""value"":""20/25/30/35/40%""},{""description"":""Slow Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""Id"":7343,""Summary"":""Death From Below"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1676_7343.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""14/13/12/11/10s"",""cost"":""60"",""description"":""Hades Silences all enemies in a cone in front of him. If the enemy is Blighted, they are also Feared. Applies Blight."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""}],""rankitems"":[{""description"":""Silence:"",""value"":""1/1.25/1.5/1.75/2s""}],""secondaryDescription"":""""}},""Id"":7354,""Summary"":""Shroud of Darkness"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1676_7354.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""60/65/70/75/80"",""description"":""Hades devours the souls of his enemies, dealing damage in an area around him. Blighted hit by this ability are Detonated, dealing damage to enemies and healing your allies around the Detonated targets. Enemy gods only take 50% of the damage from Detonating Blights. Consumes Blight."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""75/115/155/195/235 (+70% of your Magical Power)""},{""description"":""Detonated Damage:"",""value"":""20/27/34/41/48 (+50% of your Magical Power)""},{""description"":""Detonated Healing:"",""value"":""25/35/45/55/65 (+10% of your Magical Power)""},{""description"":""Detonation Radius:"",""value"":""20""}],""secondaryDescription"":""""}},""Id"":7356,""Summary"":""Devour Souls"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1676_7356.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Hades calls to all enemy souls nearby, pulling them closer to him over time, doing damage every .5s for 4s. If the enemy is Blighted, their Protections are reduced.  Hades also gains Protections for the duration. Does not consume or apply Blight."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""45/60/75/90/105 (+30% of your Magical Power)""},{""description"":""Protections:"",""value"":""60/70/80/90/100""},{""description"":""Protections Debuff:"",""value"":""10/15/20/25/30""},{""description"":""Protections Debuff Lifetime:"",""value"":""4s""}],""secondaryDescription"":""""}},""Id"":7357,""Summary"":""Pillar of Agony"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1676_7357.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Hades' normal staff attacks apply a Debuff to the enemy, called Blight. This Debuff stays on the target and can be refreshed. If an enemy is afflicted by Blight, each of Hades' other powers have an additional effect."",""menuitems"":[{""description"":""Ability:"",""value"":""Debuff""},{""description"":""Affects:"",""value"":""Enemy""}],""rankitems"":[{""description"":""Duration:"",""value"":""8s""}],""secondaryDescription"":""""}},""Id"":7550,""Summary"":""Blight"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1676_7550.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.01,""Cons"":"""",""HP5PerLevel"":0.54,""Health"":450,""HealthPerFive"":5,""HealthPerLevel"":80,""Lore"":""Inevitably, death sends everyone to Hades, God of the Underworld. In the end, he always gets his way.\\n\\nEldest son of the Titans Cronus and Rhea, Hades was swallowed by his father as an infant along with five other siblings. Zeus, the youngest brother, escaped this fate and freed them once he’d grown strong enough to battle Cronus. Together, the six siblings defeated the Titans and banished them to the dark realm of Tartarus. Now the reigning Gods, Zeus, Poseidon, and Hades drew lots for dominion. Hades drew the Underworld.\\n\\nOf the few that have entered the Underworld and come back, all speak dismally of the place, never wishing to return. Yet Hades, himself, rarely leaves the subterranean realm, constantly seeking ways to grow the numbers of the dead.\\n\\nWhen he desired a wife, Hades captured the radiant Persephone, daughter of the Goddess Demeter. Concealed in the Underworld, none could reach her, so Demeter cursed the land with a great famine. The other Gods pleaded with her to end it lest she destroy mankind, but she would not relent until her daughter was returned. Hades finally let Persephone leave, though not before feeding her pomegranate seeds. Having consumed the fruit, she was bound forever to Hades and required to return to her husband once per year to eat of the seeds again. This, it is said, is a time of mourning and the cause of winter.\\n\\nWhile many fear death and view it as evil, in truth, Hades endeavors only to keep balance. He is stern but fair. As God of the Dead and the Underworld, he views his authority on this matter absolute, forbidding anyone to leave his realm and growing wrathful when disobeyed or when someone tries to cheat death or steal from him.\\n\\nFor everyone, death is unavoidable and service to Hades inevitable. Even the Gods."",""MP5PerLevel"":0.36,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":160,""MagicalPowerPerLevel"":7.5,""Mana"":265,""ManaPerFive"":5.0,""ManaPerLevel"":53,""Name"":""Hades"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":18,""PhysicalProtectionPerLevel"":2.6,""Pros"":"" High Defense, High Sustain"",""Roles"":"" Mage"",""Speed"":355,""Title"":""King of the Underworld"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""50/55/60/65/70"",""description"":""Hades descends into the ground and erupts from below at his ground location, doing damage to all enemies in the area. If the enemy is Blighted, they are also Slowed. Applies Blight."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/120/170/220/270 (+60% of your Magical Power)""},{""description"":""Slow:"",""value"":""20/25/30/35/40%""},{""description"":""Slow Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDes