},{""description"":""Radius:"",""value"":""10""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/130/180/230/280 (+85% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":7329,""Summary"":""Waterspout"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1674_7329.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""He Bo transforms into a wave and crashes forward, damaging all enemies in his path."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""370/450/530/610/690 (+115% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":7330,""Summary"":""Crushing Wave"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1674_7330.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Each time He Bo uses an ability, he gains the Steady Flow buff which increases his Magical Power. The timer refreshes when another ability is used."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Magical Power Buff:"",""value"":""5%""},{""description"":""Duration:"",""value"":""5s""},{""description"":""Max Stacks:"",""value"":""3""}],""secondaryDescription"":""""}},""Id"":7551,""Summary"":""Steady Flow"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1674_7551.jpg""},""AttackSpeed"":0.86,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":365,""HealthPerFive"":6,""HealthPerLevel"":68,""Lore"":""As God of the Yellow River, He-Bo tamed the massive and turbulent waters with humility and sacrifice. Now, the forces of the great river are at his command!\\n\\nThroughout history, no river has been the source of more nourishment or more destruction than China’s Yellow River. Its basin valley was the cradle that birthed Chinese civilization, feeding fields with water and millions of tons of collected sediments, which give the river its yellow hue. The river is also treacherous and prone to flooding, destroying shoreline settlements and drowning thousands.\\n\\nLong ago, Feng Yi, a mortal man living along the riverside, watched in dismay as a storm stirred the waters and gorged the banks. It would not be long before the mighty river consumed his village. Both humble and wise, Feng Yi tied rocks to his belt before casting himself into the waters. This act of sacrifice did more than appease the angry river, it promoted Feng Yi to Godhood over it. Thus, he became He Bo.\\n\\nMuch time passed, and He Bo grew proud of his great river, so proud that he declared the Yellow River the biggest body of water anywhere. A passerby asked if He Bo had seen the North Sea, but He Bo dismissed the comment, for heavy rains were falling and the river was roaring and full. As time wore on, thought of the North Sea tickled his mind, so he made the journey. There, the Dragon King of the Northern Sea warmly met him.  Viewing the endless expanse of water, He Bo was humbled and returned to his River wiser.\\n\\nFor He Bo, there are no greater virtues than wisdom and humility. With the force of the Yellow River at his command, He Bo will remind his enemies what it means to be humble."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":170,""MagicalPowerPerLevel"":7.25,""Mana"":298,""ManaPerFive"":4.9,""ManaPerLevel"":56,""Name"":""He Bo"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":9,""PhysicalProtectionPerLevel"":2.6,""Pros"":"" High Area Damage, Medium Crowd Control"",""Roles"":"" Mage"",""Speed"":350,""Title"":""God of the Yellow River"",""Type"":"" Ranged, Magical"",""abi