ityId1"":9180,""AbilityId2"":9183,""AbilityId3"":9185,""AbilityId4"":9186,""AbilityId5"":9188,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""8s"",""cost"":""70/75/80/85/90"",""description"":""DECAY (Dark Stance) - Hel fires an orb of decay that deals damage and passes through minions. The orb will explode in a 15 unit radius if it hits a god, a wall, or reaches max range.\n\nRESTORATION (Light Stance) - Hel fires an orb of restoration that hits gods only. Hitting an enemy god deals damage. Hitting an allied god heals that god and heals Hel on a successful hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemies or Allies""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Dark Damage:"",""value"":""70/120/170/220/270 (+50% of your Magical Power)""},{""description"":""Light Ally Heal:"",""value"":""60/90/120/150/180 (+30% of your Magical Power)""},{""description"":""Light Self Heal: "",""value"":""60/90/120/150/180 (+30% of your Magical Power)""},{""description"":""Light Damage:"",""value"":""70/120/170/220/270 (+50% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":9180,""Summary"":""Decay (Restoration)"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1718_9180.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""16/15/14/13/12s"",""cost"":""60/65/70/75/80"",""description"":""HINDER (Dark Stance) - Hel debuffs all enemies in the targeted area, reducing their Magical Protection and slowing them for 3s.\n\nCLEANSE (Light Stance) - Hel cleanses all allied gods in the targeted area, removing all Crowd Control effects instantly and protecting them from future ones for a duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemies or Allies""},{""description"":""Damage: "",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Dark Protections Debuff:"",""value"":""5/10/15/20/25""},{""description"":""Dark Slow:"",""value"":""20/25/30/35/40%""},{""description"":""Light CC Immunity Duration:"",""value"":""1.5s""}],""secondaryDescription"":""""}},""Id"":9183,""Summary"":""Hinder (Cleanse)"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1718_9183.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""60/65/70/75/80"",""description"":""REPULSE (Dark Stance) - Hel conjures a burst of dark energy around her, damaging all nearby enemies.\n\nINSPIRE (Light Stance) - Hel conjures a burst of light energy around her, healing herself instantly and applying a heal over time to nearby allies that ticks every 1s. All targets affected gain Increased Movement Speed for the duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemies or Allies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Dark Damage:"",""value"":""80/130/180/230/280 (+70% of your Magical Power)""},{""description"":""Light Self Heal: "",""value"":""60/90/120/150/180 (+30% of your Magical Power)""},{""description"":""Light Heal per Tick:"",""value"":""10/15/20/25/30 (+5% of your Magical Power)""},{""description"":""Light Movement Speed:"",""value"":""25%""},{""description"":""Light Duration:"",""value"":""6s""}],""secondaryDescription"":""""}},""Id"":9185,""Summary"":""Repulse (Inspire)"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1718_9185.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""2s"",""cost"":""0"",""description"":""DARK STANCE - Hel's abilities cause damage and she gains increased Magical Power.\n\nLIGHT STANCE - Hel's abilities heal and support her allies and she gains increased Protections.\n\nPassive - Hel gains increased MP5 and Half of the benefits gained from the stances are shared with allied gods within 30 units."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Dark Magical Power:"",""value"":""20/30/40/50/60""},{""description"":""Light Magical and Physical Protections:"",""value"":""5/10/15/20/25""},{""description"":""MP5:"",""value"":""15/20/25/30/35""}],""secondaryDescription"":""""}},""Id"":9186,""Summary"":""Switch Stances (Light)"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1718_9186.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""When Hel is in a stance, she gradually attunes to the strengths of that stance, gaining up to 20% damage in the Dark Stance and 20% healing in the Light Stance."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":9188,""Summary"":""Stance Attunement"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1718_9188.jpg""},""AttackSpeed"":0.86,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.43,""Health"":380,""HealthPerFive"":5,""HealthPerLevel"":67,""Lore"":""Both beautiful and terrible, the Goddess Hel is keeper of the dead, lays judgment on souls, and decides who is reborn. She is both sides of two extremes.\\n\\nAs the daughter of Loki, the trickster God, Hel’s destiny, much like her brothers Fenrir and Jormungandr, was doomed to darkness from the start. Odin, the All-Father, uncovered prophecies that Hel and her siblings would be the source of great calamity resulting in Ragnarök, the battle that would end all things. In an effort to prevent this, he cast each of the three into different realms; not quite a prison, though far from freedom. For Hel, Odin gave her charge of the realm of the dead, specifically those that died of sickness and old age. For himself, Odin retained Valhalla for those that died in battle.\\n\\nAt birth, Hel’s face was cast half in shadow, half in light; she was both living and dead, so took immediately and graciously to her new role, gifting Odin with the ravens Huginn and Muninn in appreciation. As the spirits of the kind-hearted, the sick, the elderly were brought to her, she cared for them, gave them comfort, yet those she deemed evil she mercilessly hurled into the frozen depths of Niflheim.\\n\\nYet, despite Odin’s efforts, destiny cannot be averted. Hel’s conflicting struggle between benevolence and malice will force her to one extreme or the other. A time will come when Hel will fulfill her prophecy, though it is yet unknown if she will be a shadow of darkness or a force of light."",""MP5PerLevel"":0.45,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":165,""MagicalPowerPerLevel"":7.5,""Mana"":300,""ManaPerFive"":5.0,""ManaPerLevel"":57,""Name"":""Hel"",""OnFreeRotation"":"""",""Pantheon"":""Norse"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":9,""PhysicalProtectionPerLevel"":2.6,""Pros"":"" High Area Damage, High Sustain"",""Roles"":"" Mage"",""Speed"":350,""Title"":""Goddess of the Underworld"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""8s"",""cost"":""70/75/80/85/90"",""description"":""DECAY (Dark Stance) - Hel fires an orb of decay that deals damage and passes through minions. The orb will explode in a 15 unit radius if it hits a god, a wall, or reaches max range.\n\nRESTORATION (Light Stance) - Hel fires an orb of restoration that hits gods only. Hitting an enemy god deals damage. Hitting an allied god heals that god and heals Hel on a successful hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemies or Allies""},{""description"":""Damage:"",""value"":""Ma