iption"":""Damage:"",""value"":""300/425/550/675/800 (+100% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":8632,""Summary"":""Excavate"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1848_8632.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Every time Hercules takes damage from an enemy god he gains a stacking self buff that provides increased Physical Power."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Physical Power per Stack"",""value"":""5 + 1 * your level""},{""description"":""Duration:"",""value"":""5s""},{""description"":""Max Stacks:"",""value"":""3""}],""secondaryDescription"":""""}},""Id"":8498,""Summary"":""Strength from Pain"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1848_8498.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.63,""Health"":480,""HealthPerFive"":7,""HealthPerLevel"":86,""Lore"":""Brave Hercules, a demigod son of Jupiter, born with impossible strength and force of will; for whom no task is insurmountable, no heroic deed unachievable. Yet, Like all of Jupiter’s illegitimate children, Hercules once drew the ire of Juno, and though he is now known as a hero, his greatest achievements might never have been done without Juno’s initial tragic involvement.\\n\\nShe struck Hercules mad, and he slew his own children.\\n\\nOnce recovered, grief stricken, Hercules sought penance for his crimes. An oracle of Jupiter advised he should pledge his service to the king Eurystheus, and so Hercules reluctantly did so. Jealous of the demigod, the king set him to twelve impossible tasks, expecting him to fail at the first, to slay the Nemean Lion and return with its hide.\\n\\nThe Nemean Lion captured women and devoured soldiers. Its fur was so thick no weapon could pierce it, and its claws so sharp, no armor could guard against them. Hercules tracked the lion to its mountain caves and drew it out, firing arrows that shattered against the beast’s impenetrable coat. Agilely, he dodged as the lion leapt to maul him. In the end, Hercules aimed a powerful shot straight into the lion’s roaring maw, a place the powerful fur did not protect, and slew it. Then, using the beasts own claws, he skinned the hide, wearing the mantle proudly as his new armor.\\n\\nEurystheus was aghast upon the hero’s return. Immediately the legend of Hercules began to grow. Eleven more labours the confounded king set against him, but time after time, year after year, Hercules performed what could not be done, earning fame, glory, and the peace he so desperately sought."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":205,""ManaPerFive"":4.3,""ManaPerLevel"":32,""Name"":""Hercules"",""OnFreeRotation"":"""",""Pantheon"":""Roman"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.0,""PhysicalProtection"":18,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Single Target Damage, High Sustain"",""Roles"":"" Warrior"",""Speed"":375,""Title"":""Champion of Rome"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""60/65/70/75/80"",""description"":""Hercules delivers a mighty strike, driving all enemies back, damaging and Stunning them. Hercules is immune to Knockback during the dash."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""85/155/225/295/365 (+90% of your Physical Power)""},{""description"":""Stun:"",""value"":""1.1/1.2/1.3/1.4/1.5s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""60/65/70/75/80"",""de