t off of walls. After firing, if this arrow bounces off of a wall it will travel 70 units from that point and gain +40% bonus damage per bounce up to a maximum of 2 bounces. This arrow will stun if the target has Mark of the Golden Crow."",""menuitems"":[{""description"":""Ability:"",""value"":""Line Target""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage:"",""value"":""75/120/165/210/255 (+65% of your physical power)""},{""description"":""Stun Duration:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":11416,""Summary"":""Ricochet"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2040_11416.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""50"",""description"":""Hou Yi marks an enemy with Mark of the Golden Crow. Marked enemies take extra damage for every 10% of their missing health from Hou Yi’s abilities and basic attacks. Also, marked enemies, including stealthed gods, are visible to Hou Yi on the minimap. The mark lasts for 10s."",""menuitems"":[{""description"":""Ability:"",""value"":""Debuff""},{""description"":""Affects:"",""value"":""Enemy Gods""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage Increase:"",""value"":""1/2/3/4/5% for every 10% of missing health""}],""secondaryDescription"":""""}},""Id"":10867,""Summary"":""Mark of the Golden Crow"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2040_10867.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70/75/80/85/90"",""description"":""Hou Yi launches into the air, and for a short time may target some distance away to quickly dive towards the ground damaging any enemies in the immediate area. If the target has Mark of the Golden Crow they are knocked back."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/110/150/190/230 (+60% of your physical power)""}],""secondaryDescription"":""""}},""Id"":11636,""Summary"":""Divebomb"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2040_10988.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Hou Yi shoots nine arrows into the sky, striking one sun with each arrow. The nine suns come crashing down one by one, slowing and dealing damage in a target area over time. A target with Mark of the Golden Crow will have their movement speed slowed by an additional 20%."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/90/100/110/120 (+25% of your Physical power) every 0.5s""},{""description"":""Duration:"",""value"":""4.5s""},{""description"":""Slow:"",""value"":""20%""},{""description"":""Slow Duration:"",""value"":"".5s per Hit""}],""secondaryDescription"":""""}},""Id"":10869,""Summary"":""Sunbreaker"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2040_10869.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""After taking a critical hit, Hou Yi can’t be critically hit again for 3s."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":11027,""Summary"":""Suntouched"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2040_11027.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.011,""Cons"":"""",""HP5PerLevel"":0.68,""Health"":480,""HealthPerFive"":8,""HealthPerLevel"":78,""Lore"":""In a time long past, an unexpected calamity came to be. From whence none knew, ten suns rose above the horizon. Such incessant light and heat ravaged the earth, wilting fields of grain, drying rivers, even melting forged metal. Bent beneath the scorching rays, the people begged the Emperor-God Di Jun to aid them. In reply, he called the great archer, Hou Yi.\\n\\nArmed with a mystical red bow and a quiver of white arrows, Hou Yi traveled to Earth. What he found was a barren land. Shielding his eyes, he peered to the sky where the ten suns cruelly flared.\\n\\nNocking arrow to bow, Hou Yi loosed a warning at the suns hoping to frighten them away, but they impassively remained. So Hou Yi drew again and fired a killing shot. Pierced, the sun exploded in color and a giant red raven with three legs fell to the earth, slain by the white arrow.\\n\\nEight times more Hou Yi drew arrow to cheek. Eight shots more he let fly. Eight more bursts rent the sky, and eight more ravens fell dead. But one sun he left, and so fearful of Hou Yi's archery, this sun behaved, dipping below the horizon.\\n\\nNow armed with the power of the red ravens he smote, sending light and fire against those that threaten the world, be it monster or beast, dragon or sun, man or God, Hou Yi is the Defender of the Earth."",""MP5PerLevel"":0.35,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":240,""ManaPerFive"":5.0,""ManaPerLevel"":38,""Name"":""Hou Yi"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":40,""PhysicalPowerPerLevel"":2.8,""PhysicalProtection"":13,""PhysicalProtectionPerLevel"":2.8,""Pros"":"" High Area Damage, High Single Target Damage"",""Roles"":"" Hunter"",""Speed"":370,""Title"":""Defender of the Earth"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":"