ondaryDescription"":""""}},""Id"":7324,""Summary"":""Overhand Smash"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1673_7324.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""13s"",""cost"":""75/80/85/90/95"",""description"":""Hun Batz commands a monkey through the air that pounces on enemy targets, doing damage on each pounce, hitting each god only once. Pressing the button again teleports Hun Batz to the next target hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile, Teleport""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage per Hit:"",""value"":""80/125/170/215/260 (+70% of your Physical Power)""},{""description"":""Max Targets:"",""value"":""4""}],""secondaryDescription"":""""}},""Id"":7325,""Summary"":""Sacred Monkey"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1673_7325.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""100s"",""cost"":""100"",""description"":""Hun Batz summons a totem from the ground to ward off all evil.  Any enemy caught within the radius is feared directly away from the totem and takes damage every .25s."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""35""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""30/35/40/45/50 (+15% of your Physical Power)""},{""description"":""Lifetime:"",""value"":""1/1.25/1.5/1.75/2s""}],""secondaryDescription"":""""}},""Id"":7339,""Summary"":""Fear No Evil"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1673_7339.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Using an ability gives Hun Batz's next Basic Attack within the next 3 seconds an increased Critical Strike chance."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Critical Strike Chance:"",""value"":""30%""}],""secondaryDescription"":""""}},""Id"":7555,""Summary"":""Infused Strikes"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1673_7555.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.019,""Cons"":"""",""HP5PerLevel"":0.68,""Health"":460,""HealthPerFive"":10,""HealthPerLevel"":75,""Lore"":""A grudge, like any wound, left untended will fester.\\n\\nHun Batz and his twin brother Hun Chouen, led a contented life with their grandmother. Artists and musicians, everything they created was beautiful and enchanting, but they lacked their father’s talent for the ball game, Pitz. Summoned to the underworld, their father, Hun Hunapu never returned. Instead his new offspring, half-brothers to Hun Batz and Hun Chauen, appeared. The Hero Twins were everything the original twins were not, strong, athletic, and clever. And they were extremely gifted at playing Pitz.\\n\\nA jealous rivalry formed between the two sets of twins. The more they played ball together, the more Hun Batz and his brother were defeated. Eventually, the original twins resorted to foul tricks, aggressive tactics, and out-right cheating. Frustrated with these antics, the Hero Twins kicked the ball into a tree, knowing Hun Batz and his brother considered themselves excellent climbers and would go after it. Yet, the higher they climbed, the taller the tree grew, until they could not get back down. Pleased with their magic thus far, The Hero Twins encouraged Hun Batz and Hun Chouen to use their belts like tails in order to escape the terrible height. However, upon doing so, they were mysteriously and humiliatingly transformed into monkeys.\\n\\nThough the Monkey Twins, as they are now called, came to be worshipped as Gods of Art and Music, the animosity they hold for the Hero Twins remains. Time has only sharpened their combined cunning, and they eagerly await a chance to strike back. Like any wound, their grudge has festered, and what was once a brotherly rivalry has grown into a far more deadly game."",""MP5PerLevel"":0.27,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":3.9,""ManaPerLevel"":38,""Name"":""Hun Batz"",""OnFreeRotation"":"""",""Pantheon"":""Mayan"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.16,""PhysicalProtection"":13,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Single Target Damage"",""Roles"":"" Assassin"",""Speed"":370,""Title"":""the Howler Monkey God"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""60"",""description"":""Hun Batz flips through the air, crashing down at his target location, doing damage to all nearby enemies and Slowing them."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""50/90/130/170/210 (+70% of your Physical Power)""},{""description"":""Slow:"",""value"":""20/25/30/35/40%""},{""description"":""Slow Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""12/11/10/9/8s"",""cost"":""60/65/70/75/80"",""description"":""Hun Batz smashes his staff to the ground in front of him, doing damage to all enemies."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""75/130/185/240/295 (+95% of your Physical Powe