alue"":""3s""}],""secondaryDescription"":""""}},""Id"":8920,""Summary"":""Wing Gust"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1918_8920.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""70/80/90/100/110"",""description"":""Isis sends forth a ball of spirit energy. As the ball travels, it gains in power up to 1.5x at max. range. At any time, Isis can activate the ability to detonate the ball, dealing Magical Damage and Stunning enemies within 10 units, scaling in duration up to 1.5s at max range."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""10""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/110/150/190/230 (+70% of your Magical Power)""},{""description"":""Stun:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":8921,""Summary"":""Spirit Ball"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1918_8921.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""80/85/90/95/100"",""description"":""Isis Silences enemies at her target location. Enemies hit also lose a portion of their Magical Protections and are Slowed for a duration. Allies affected by Isis' Funeral Rites aura gain Magical Protection during this time."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Slow:"",""value"":""20%""},{""description"":""Magical Protection / Debuff:"",""value"":""10/15/20/25/30%""},{""description"":""Debuff Duration:"",""value"":""1.5/1.75/2/2.25/2.5s""},{""description"":""Silence:"",""value"":""1/1.25/1.5/1.75/2s""}],""secondaryDescription"":""""}},""Id"":8939,""Summary"":""Dispel Magic"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1918_8939.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""80/90/100/110/120"",""description"":""Isis plants her staff at her target location for 5s. Allies within its radius take less damage. Any damage dealt within the radius charges up the staff. If Isis activates the staff again, it explodes, dealing damage to enemies inside and healing allies."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemies and Allies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""160/200/240/280/320 (+50% of your Magical Power)""},{""description"":""Healing:"",""value"":""80/100/120/140/160 (+25% of your Magical Power)""},{""description"":""Damage Reduction:"",""value"":""15%""},{""description"":""Max Charge:"",""value"":""800/1600/2400/3200/4000""},{""description"":""Max Charge Dmg/Heal Scale:"",""value"":""1.5/2/2.5/3/3.5x""}],""secondaryDescription"":""""}},""Id"":8883,""Summary"":""Circle of Protection"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1918_8883.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Isis shares additional HP5 and MP5 with nearby allies. For every player death she witnesses, her aura gains an additional Stack (max. 10). Upon reaching 10 Stacks, Isis gains an additional 10% Cooldown Reduction."",""menuitems"":[{""description"":""Ability:"",""value"":""Aura""},{""description"":""Affects:"",""value"":""Friendly Gods""},{""description"":""Witness Radius:"",""value"":""80""},{""description"":""Aura Radius:"",""value"":""30""}],""rankitems"":[{""description"":""HP5:"",""value"":""2 HP5 per stack""},{""description"":""MP5:"",""value"":""2 MP5 per stack""}],""secondaryDescription"":""""}},""Id"":8900,""Summary"":""Funeral Rites"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1918_8900.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.0,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":365,""HealthPerFive"":6,""HealthPerLevel"":68,""Lore"":""When Isis was born, she was a Goddess. When she was married, she became a Queen. But a legendary journey to resurrect her murdered husband would make her a savior.\\n\\nFrom the God of Earth and Goddess of Sky, Isis was born, and she was a Goddess in her own right, loved by wealthy and poor alike, champion to sinners and slaves, artisans and aristocrats. She commanded the force of magic, for she knew the True Names of many things. For in the True Names lie true power.\\n\\nIsis and her husband Osiris ruled Egypt, symbols of order and justice, and led their kingdom to true prosperity. But Osiris had a brother, Set, who harbored jealousy and malice, and sought to usurp his throne. For him, murder alone was not enough. Set hacked Osiris to pieces and cast them across Egypt.\\n\\nFleeing Set’s wrath, Isis traveled the land in secret, gathering the remains of her husband. Meanwhile, Set’s rule plunged the land into chaos incarnate, and all seemed truly lost. Unable to locate a final piece, Isis could wait no longer and summoned the potent powers of her magic to reassemble her husband and give him new life. That night, their love became a child, Horus, who would avenge his father and cast evil Set out of Egypt.\\n\\nHer bravery, tenacity, her skill and love drove Isis to save Egypt and become the mother of all Pharaohs. Long has she prayed that chaos would never again rise to threaten the rule of order and prosperity, but peaceful days are at an end. This time, it may not be her husband torn asunder, but all the world, and even the Goddess of Magic may not have the power to reassemble it from oblivion."",""MP5PerLevel"":0.43,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":175,""MagicalPowerPerLevel"":7.5,""Mana"":