ay from her current position.\n\nTaking damage, or firing a damaging Ability or Basic Attack breaks her Stealth."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Duration:"",""value"":""4/4.5/5/5.5/6s""}],""secondaryDescription"":""""}},""Id"":13327,""Summary"":""Fade Away"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/08/Icons_Izanami_A03.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""80"",""cost"":""100"",""description"":""Izanami summons a dark portal which Damages and Silences all Enemies in range."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target Special""},{""description"":""Affects:"",""value"":""Enemy Gods""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""250/350/450/550/650 (+130% of your Physical Power)""},{""description"":""Duration:"",""value"":""1.5/ 1.75/2/2.25/2.5s""}],""secondaryDescription"":""!{rankprog:100,95,90,85,80}!""}},""Id"":13408,""Summary"":""Dark Portal"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/08/Icons_Izanami_A04.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""The closer Izanami gets to death, the more powerful she becomes.  Izanami gains 4% Physical Penetration for each 15% of her Health that is missing, up to a maximum of 20%."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Penetration per Stack:"",""value"":""4%""},{""description"":""Max Stacks:"",""value"":""5""}],""secondaryDescription"":""""}},""Id"":13323,""Summary"":""Death Draws Nigh"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/08/Icons_Izanami_Passive.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.016,""Cons"":"""",""HP5PerLevel"":0.7,""Health"":450,""HealthPerFive"":6,""HealthPerLevel"":77,""Lore"":""As Izanami gave birth to the god of Fire, his searing skin scorched her flesh. Fearful she would die, her husband, Izanagi, the man with whom she had created the world, held her close and wept. But it was too late. So grievous were the wounds, Izanami succumbed to death.\\n\\nTo rescue her soul, Izanagi traveled to Yomi, the realm of darkness and death. Through the black maze he searched, until finally he came upon her, hidden amongst the shadows. He implored her to return with him. She could not, for she had already eaten the fruit that grew in Yomi. Izanagi insisted. He would not leave her in this place. He swore it.\\n\\nIzanami agreed to take her husband to see the Gods of Yomi, to implore them to free her. Meanwhile, remain in darkness, she cautioned him, for the realm of the dead was not meant for the living to see. Taken by foreboding, Izanagi lit a torch and laid eyes upon his wife. No longer the graceful, elegant beauty she once was, Izanami now appeared a rotting corpse, hollow and decayed, maggot ridden and foul. Frightened and disgusted, Izanagi broke his vow and fled.\\n\\nThrough the bowels of Yomi he ran, pursued by the fiend that was once his wife. Escaping the cave entrance, Izanagi rolled a boulder in place to block it. Sealed within, betrayed and cursed, consumed with wrathful anger, Izanami swore, one thousand lives would she take each day. One thousand to pay for the broken promise he made.\\n\\nSince then, Izanami has kept her vow, each day reaching beyond the grave to pull souls to Yomi. But war has broken the boulder that once kept her sealed away, and Izanami has emerged, cold and lifeless, but burning with a vengeance against all that lives. One thousand souls will not be enough."",""MP5PerLevel"":0.38,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""M