ack""},{""description"":""Progression:"",""value"":""None. Kamas return to Izanami after reaching Max Range.""}],""rankitems"":[],""secondaryDescription"":""""}},""godAbility1_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/08/Icons_Izanami_A01.jpg"",""godAbility2_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/08/Icons_Izanami_A02.jpg"",""godAbility3_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/08/Icons_Izanami_A03.jpg"",""godAbility4_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/08/Icons_Izanami_A04.jpg"",""godAbility5_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/08/Icons_Izanami_Passive.jpg"",""godCard_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/08/Izanami_CC_Card.jpg"",""godIcon_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/08/Izanami_Default_Icon_128x128.png"",""id"":2179,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Portal"",""Ability2"":""Unstable Vortex"",""Ability3"":""Threshold"",""Ability4"":""Through Space and Time"",""Ability5"":""Passages"",""AbilityId1"":9938,""AbilityId2"":9990,""AbilityId3"":10056,""AbilityId4"":9984,""AbilityId5"":10030,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""70"",""description"":""Janus creates a portal in the world. If placed on a wall, the portal will create a passage through to the other side of the wall that Janus or any ally may use. The portal may be entered from either side, but closes after 1 use.\n\nIf placed on the ground, enemies and Janus will fall into the portal, being teleported into the air above it. Enemies take damage upon landing, and are considered banished during the fall."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Everyone""},{""description"":""Radius:"",""value"":""10""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/130/180/230/280 (+60% of your Magical Power)""},{""description"":""Banish Duration:"",""value"":""1.5s""},{""description"":""Wall Portal Duration:"",""value"":""5s""},{""description"":""Wall Portal Range:"",""value"":""100""}],""secondaryDescription"":""""}},""Id"":9938,""Summary"":""Portal"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1999_9938.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""8s"",""cost"":""70/75/80/85/90"",""description"":""Janus creates two unstable portals, far too small to fit into, and flings them forward dealing damage to enemies in their path. Enemies hit by both portals take 30% damage on the second hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/150/210/270/330 (+70% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":9990,""Summary"":""Unstable Vortex"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1999_9990.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Passive: Janus increases the movement speed of himself and allies each time they go through a portal or over a Threshold (max. 2 Stacks).\n\nActive: Janus opens a multi-dimensional rift. Enemies who pass over the rift are slowed, and marked with Phase. Targets in Phase take additional Magical scaling damage when hit by Janus' damaging abilities."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Everyone""}],""rankitems"":[{""description"":""Phase Slow:"",""value"":""25%""},{""description"":""Additional Scaling:"",""value"":""20/30/40/50/60""},{""description"":""Rift Duration:"",""value"":""3/4/5/6/7""},{""description"":""Movement Speed:"",""value"":""10/15/20/25/30% per Portal.""},{""description"":""Passive Duration:"",""value"":""5s ""}],""secondaryDescription"":""""}},""Id"":10056,""Summary"":""Threshold"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1999_10056.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""110s"",""cost"":""100"",""description"":""Janus blasts a ball of multi-dimensional energy across the battlefield, burning a portal into every surface it encounters within range 500. These portals last 10s, may be used by allies, and do not vanish after the first use.\n\nEnemies hit by the energy ball take damage, increasing in Magical scaling the further the energy travels. Janus is immune to Crowd Control whilst firing."",""menuitems"":[{""description"":""Ability:"",""value"":""Global Line""},{""description"":""Affects:"",""value"":""Everyone""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""200/300/400/500/600 (+50% of your Magical Power)""},{""description"":""Distance Scaling:"",""value"":""200% of your Magical Power at distance greater than 800.""}],""secondaryDescription"":""""}},""Id"":9984,""Summary"":""Through Space and Time"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1999_9984.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Any time Janus transitions through a Portal or over a Threshold he becomes aged and wizened, gaining additional Magical scaling on his next ability cast."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""}],""rankitems"":[{""description"":""Magical Scaling:"",""value"":""15%""}],""secondaryDescription"":""""}},""Id"":10030,""Summary"":""Passages"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1999_10030.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":400,""HealthPerFive"":6,""HealthPerLevel"":70,""Lore"":""Many fear change. Venturing into the unknown. Deviating from a path of safety and certainty into something unexpected. But life is change; a journey through doorways both physical and emotional, with every moment a passage to something new, and it is Janus, God of Portals and Transitions that governs this.\\n\\nBearing two faces, Janus is ever looking to the future and to the past, knowing both but controlling neither. He is only the in-between, found in the changing of seasons, at the birth of a child, at the entrances to the temple and the tavern. For this reason the Romans named the first month after him: January – a portal between the old year and the new.\\n\\nYet the Roman emperors also attribute a strange tradition to Janus. At each end of his temple stand massive doors. In times of peace, these doors are closed, but in times of war, flung open. As Rome rose to power, rarely were these doors shut, but almost four hundred years of peace have clothed Rome since then and the temple has grown dusty with absence. These days, however, the doors are open once more. It seems war has returned, and the greatest of changes are upon us."",""MP5PerLevel"":0.45,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":170,""MagicalPowerPerLevel"":7.25,""Mana"":350,""ManaPerFive"":5.0,""ManaPerLevel"":58,""Name"":""Janus"",""OnFreeRotation"":"""",""Pantheon"":""Roman"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":8,""PhysicalProtectionPerLevel"":2.6,""Pros"":"" High Area Damage, High Mobility"",""Roles"":"" Mage"",""Speed"":360,""Title"":""God of Portals and Transitions"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""70"",""description"":""Janus creates a portal in the world. If placed on a wall, the portal will create a passage through to the other side of the wall that Janus or any ally may use. The portal may be entered from either side, but closes after 1 use.\n\nIf placed on the ground, enemies and Janus will fall into the portal, being teleported into the air above it. Enemies take damage upon landing, and are considered banished during the fall."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Everyone""},{""description"":""Radius:"",""value"":""10""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/130/180/230/280 (+60% of your Magical Power)""},{""description"":""Banish Duration:"",""value"":""1.5s""},{""description"":""Wall Portal Duration:"",""value"":""5s""},{""description"":""Wall Portal Range:"",""value"":""100""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""8s"",""cost"":""70/75/80/85/90"",""description"":""Janus creates two unstable portals, far too small to fit into, and flings them forward dealing damage to enemies in their path. Enemies hit by both portals take 30% damage on the second hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/150/210/270/330 (+70% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription3"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Passive: Janus increases the movement speed of himself and allies each time they go through a portal or over a Threshold (max. 2 Stacks).\n\nActive: Janus opens a multi-dimensional rift. Enemies who pass over the rift are slowed, and marked with Phase. Targets in Phase take additional Magical scaling damage when hit by Janus' damaging abilities."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Everyone""}],""rankitems"":[{""description"":""Phase Slow:"",""value"":""25%""},{""descri