""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""50"",""description"":""Jing Wei loads her crossbow with explosive bolts that augment her next 3 Basic Attacks. These attacks are wider, have increased critical chance, and deal area of effect damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""8""}],""rankitems"":[{""description"":""Crit Chance:"",""value"":""0/5/10/15/20%""}],""secondaryDescription"":""""}},""Id"":12767,""Summary"":""Explosive Bolts"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/04/Icons_JingWei_A02.png""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18/18/17/17/16s"",""cost"":""75/70/65/60/55"",""description"":""Jing Wei dashes straight forward. She may use this ability while knocked into the air for a longer range dash. She also gains a 4s increase to Physical Power and Movement Speed upon using Agility. The effect of this buff is increased if Agility is used from the air. "",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Range:"",""value"":""!{rankprog:35}!""},{""description"":""Air Dash Range:"",""value"":""!{rankprog:55}!""}],""rankitems"":[{""description"":""Power:"",""value"":""10/15/20/25/30""},{""description"":""Movement Speed:"",""value"":""20%""},{""description"":""Air Power:"",""value"":""20/25/30/35/40""},{""description"":""Air Movement Speed:"",""value"":""30%""}],""secondaryDescription"":""""}},""Id"":12764,""Summary"":""Agility"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/04/Icons_JingWei_A03.png""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100/110/120/130/140"",""description"":""Jing Wei channels briefly before taking to the sky. She then flies forward and upward while covering the area below her in explosions that damage all enemies in the area. After her attack she hovers for up to 2s before landing at a ground target location. "",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical ""}],""rankitems"":[{""description"":""Damage:"",""value"":""220/310/400/490/580 (0% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":13261,""Summary"":""Air Strike"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/04/Icons_JingWei_A04.png""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""When exiting the fountain, Jing Wei prepares for takeoff and then ascends into the sky, allowing her to fly over obstacles at an increased speed with CC immunity. Jing Wei can decline to fly by canceling the ability on her way out of the fountain."",""menuitems"":[{""description"":""Ability:"",""value"":""Flight""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Duration:"",""value"":""4s""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":12766,""Summary"":""Rapid Reincarnation"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/04/Icons_JingWei_Passive.png""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.014,""Cons"":"""",""HP5PerLevel"":0.68,""Health"":445,""HealthPerFive"":7,""HealthPerLevel"":78,""Lore"":""Against the red rising sun, a winged form sweeps out to sea, claw clutched around a pebble. With focused grit, she hurls the small stone into the watery maw, circling above as it sinks into darkness. Resolved, she turns back to collect another. Jing Wei will not cease until the ocean is filled. That is her oath. And she will not break an oath.\\n\\nOnce, she was a young girl, a princess, enamored by the glory of morning light. She gazed in wonder as her father, Yan Di, the Flame Emperor, shepherded the sun from the eastern sea. Desperately, she longed to reach the place where it emerged, but her father refused take her on the waters.\\n\\nOne night, the princess sailed out alone, secretly hoping for a clear view come the dawn. But the waters were churning in a storm. Mountainous waves crashed into her tiny ship. The sea swallowed her whole.\\n\\nYan Di woke and coaxed the sun from the horizon, only to find the shattered remains of his daughter’s boat upon the shore.\\n\\nYet, even as he grieved, a bright goddess burst from the ocean and soared overhead. “Jingwei!” she cried, and Yan Di knew his daughter was reborn.\\n\\nThough given a second chance that day, Jing Wei swore an oath against the seas that took her life. She would fill them with stone until they were gone. An impossible task. But Jing Wei swore an oath. And Jing Wei will not break an oath."",""MP5PerLevel"":0.3,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":205,""ManaPerFive"":4.4,""ManaPerLevel"":36,""Name"":""Jing Wei"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.7,""PhysicalProtection"":11,""PhysicalProtectionPerLevel"":2.9,""Pros"":"" High Mobility"",""Roles"":"" Hunter"",""Speed"":370,""Title"":""The Oathkeeper"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""70/75/80/85/90"",""description"":""Jing Wei creates a gust of wind that damages enemies and knocks up enemy gods when summoned. The gust persists for 6s and continues to knock up and deal additional damage to enemies every 1s.\n\nIf Jing Wei walks onto the area she is knocked into the air and gains an attack speed buff for 7s."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Self and Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value""