70_Reborn.jpg"",""godIcon_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/04/jing_wei_icon.jpg"",""id"":2122,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Nimble Strike"",""Ability2"":""Lash"",""Ability3"":""Incense"",""Ability4"":""Destruction"",""Ability5"":""Marked for Death"",""AbilityId1"":9485,""AbilityId2"":9486,""AbilityId3"":9487,""AbilityId4"":9520,""AbilityId5"":9484,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""70"",""description"":""Kali leaps forward, damaging enemies in the target area and healing herself for a percent of their missing Health."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/120/170/220/270 (+80% of your Physical Power)""},{""description"":""Heal:"",""value"":""20% of target's missing Health""}],""secondaryDescription"":""""}},""Id"":9485,""Summary"":""Nimble Strike"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1649_9485.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""60/65/70/75/80"",""description"":""Kali throws several blades, that converge upon the target location. Each does damage and causes bleed. Kali gains Physical Lifesteal against targets affected by this Bleed."",""menuitems"":[{""description"":""Ability:"",""value"":""Line Special""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage Per Blade:"",""value"":""35/45/55/65/75 (+20% of your Physical Power)""},{""description"":""Bleed Damage:"",""value"":""5/10/15/20/25 (+5% of your Physical Power) every .5s""},{""description"":""Bleed Duration:"",""value"":""3s""},{""description"":""Physical Lifesteal:"",""value"":""10/15/20/25/30%""}],""secondaryDescription"":""""}},""Id"":9486,""Summary"":""Lash"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1649_9486.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""70"",""description"":""Kali hurls her incense at her feet, exploding it. Enemies hit are Stunned, while Kali gains a Physical Power bonus."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemies and Self""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Stun Duration:"",""value"":""1s""},{""description"":""Physical Power Buff:"",""value"":""10/20/30/40/50""},{""description"":""Buff Duration:"",""value"":""4/5/6/7/8s""}],""secondaryDescription"":""""}},""Id"":9487,""Summary"":""Incense"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1649_9487.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""60/70/80/90/100"",""description"":""Kali becomes an unstoppable force of destruction, creating a damage aura around her. During this time, she can be reduced to 1 Health, but cannot die. She is Immune to Knockup, Slow effects, and protected from Root, but still vulnerable to Stuns. If Kali is under 15% of her total Health at the end of the duration, she will heal to 15% Health."",""menuitems"":[{""description"":""Ability:"",""value"":""Self""},{""description"":""Affects:"",""value"":""Enemies and Self""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""25/30/35/40/45 (+5% of your Physical Power) every 0.5s""},{""description"":""Duration:"",""value"":""3.5/3.75/4/4.25/4.5""}],""secondaryDescription"":""""}},""Id"":9520,""Summary"":""Destruction"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1649_9520.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Kali selects a god to Mark. Kali gains Physical Penetration against that god, and Heals 80% of her Max Health for killing the god or 15% for assisting. Gold Bounty from that god is increased by 30% for a Kill or Assist. If her marked target dies the enemy god closest to Kali becomes marked. If Kali is killed by an enemy god she may choose a new target."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""}],""rankitems"":[{""description"":""Physical Penetration:"",""value"":""10%+1% per level""},{""description"":""Heal on Kill:"",""value"":""80%""},{""description"":""Heal on Assist:"",""value"":""15%""}],""secondaryDescription"":""""}},""Id"":9484,""Summary"":""Marked for Death"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1649_9484.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.022,""Cons"":"""",""HP5PerLevel"":0.68,""Health"":470,""HealthPerFive"":9,""HealthPerLevel"":74,""Lore"":""To speak of Kali is to speak of the beginning of time itself.\\n\\nAcross the majestic lands of Hindustan rose an army of demons that conquered the countryside and slaughtered the people. Yet, when the Gods themselves were defeated, Devi, the supreme Goddess, emerged to throw back this host and protect the faithful.\\n\\nThree forms she took during these ancient times. The first, Durga, the Mother of Creation, was as radiant as she was fearsome. Astride her tiger, she scattered the demon horde until she encountered the horrendous Raktabija. For each wound she gave the demon, his cursed blood created a copy, quickly resulting in an unstoppable army of Raktabija clones. Rage boiled at the corners of Durga’s mind, in the quest to slaughter and destroy evil.  From the forehead of Durga sprung her wrathful form, with skin darkened and eyes glowing a menacing red.\\n\\nThus was Kali, the Black One, Goddess of Time and Destruction, the second form of Devi born.\\n\\nRarely has Kali been seen since, kept in the shadows of Devi’s mind, but when the tides of battle shift and evil looms large, there is no solution but unrestrained destruction of evil, and Kali once again, walks the Earth."",""MP5PerLevel"":0.21,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":205,""ManaPerFive"":4.3,""ManaPerLevel"":34,""Name"":""Kali"",""OnFreeRotation"":"""",""Pantheon"":""Hindu"",""PhysicalPower"":37,""PhysicalPowerPerLevel"":2.32,""PhysicalProtection"":15,""PhysicalProtectionPerLevel"":2.9,""Pros"":"" High Single Target Damage, High Sustain"",""Roles"":"" Assassin"",""Speed"":375,""Title"":""Goddess of Destruction"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""70"",""description"":""Kali leaps forward, damaging enemies in the target area and healing herself for a percent of their missing Health."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/120/170/220/270 (+80% of your Physical Power)""},{""description"":""Heal:"",""value"":""20% of target's missing Health""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""60/65/70/75/80"",""description"":""Kali throws several blades, that converge upon the target location. Each does damage and causes bleed. Kali gains Physical Lifesteal against targets affected by this Bleed."",""menuitems"":[{""description"":""Ability:"",""value"":""Line Special""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage Per Blade:"",""value