"},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""50/100/150/200/250 (+30% of your Magical Power)""},{""description"":""Root Duration"",""value"":""1.3/1.4/1.5/1.6/1.7s""}],""secondaryDescription"":""""}},""Id"":11738,""Summary"":""Solar Flare"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/08/sk-3.png""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""110s"",""cost"":""80/90/100/110/120"",""description"":""Khepri blesses an allied god, immediately cleansing them of all crowd control as well as granting them Movement Speed, and immunity to slow effects. If the marked ally would die while blessed, they are instead revived with a percentage of their maximum Health at Khepri's location."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Allies""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Revived Health:"",""value"":""25/30/35/40/45%""},{""description"":""Movement Speed:"",""value"":""20/25/30/35/40%""},{""description"":""Duration:"",""value"":""5s""}],""secondaryDescription"":""""}},""Id"":11597,""Summary"":""Scarab's Blessing"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/08/sk-4.png""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Every 5s, Khepri applies a shield to himself and nearby allied gods for 2% of the target's Maximum Health for 15s.  The rate is slowed to every 10s while in combat. (Max 10%)"",""menuitems"":[{""description"":""Affects:"",""value"":""Self and Allied Gods""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Shield:"",""value"":""2% of Maximum Health""}],""secondaryDescription"":""""}},""Id"":11585,""Summary"":""Fortitude"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/08/sk-0.png""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.8,""Health"":490,""HealthPerFive"":8,""HealthPerLevel"":90,""Lore"":""At dawn, the sun lifts above the horizon, bathing mankind in color and life. At dusk, it sinks beneath the edge of the world, lost to sight, casting all into darkness. While the sun shines on the realm of mortal kind it is radiant Ra that guides it, but at night we share the sun with the underworld. It is not Ra that moves the sun along its subterranean path but Khepri, the scarab God, he who comes with the dawn.\\n\\nScarabs form dirt and dung into perfect spheres. Within, they lay eggs from which their young emerge fully formed. Using powerful arms and legs, scarabs can roll these spheres - many times their own size - incredible distances. It is from their father, Khepri, the sacred scarab gained this power. For the Dawn Bringer, the Sun is his sphere and all souls, living and dead, his children.\\n\\nKhepri is a guardian, a protector and a friend. He is a symbol of power and loyalty. Usually content to stay aloof, Khepri has risen for battle to defend existence from this shattering war. He will fight to shield us until the final sunset. Yet, it is he that brings the dawn."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.5,""Mana"":190,""ManaPerFive"":4.6,""ManaPerLevel"":34,""Name"":""Khepri"",""OnFreeRotation"":"""",""Pantheon"":""Egyptian"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":19,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Crowd Control, High Defense"",""Roles"":"" Guardian"",""Speed"":360,""Title"":""The Dawn Bringer"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60"",""description"":""Khepri lunges forward, dealing damage to enemies he passes through. If he connects wit