cription"":""Duration:"",""value"":""4s""}],""secondaryDescription"":""""}},""Id"":7364,""Summary"":""Slipstream"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1677_7364-e1436203524620.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""70/75/80/85/90"",""description"":""Kukulkan summons a tornado at his ground target location. A smaller tornado branches off onto any enemies that come within the radius, doing damage every .5s for 2.5s and is refreshed if enemies stay within the radius, for a maximum of 12 ticks."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""10/20/30/40/50 (+15% of your Magical Power)""},{""description"":""Tornado Lifetime:"",""value"":""4s""}],""secondaryDescription"":""""}},""Id"":7365,""Summary"":""Whirlwind"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1677_7365-e1436203509217.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""80s"",""cost"":""100/110/120/130/140"",""description"":""Kukulkan summons the Spirit Of The Nine Winds to breathe down destruction onto his enemies in a path in front of him, doing damage and knocking all of the enemies to the side."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""400/500/600/700/800 (+120% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":7966,""Summary"":""Spirit Of The Nine Winds"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1677_7966-e1436203491406.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Increases Magical Power by 5% of maximum Mana."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":7557,""Summary"":""Power Of The Wind Jewel"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1677_7557-e1436203456102.jpg""},""AttackSpeed"":0.87,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.46,""Health"":365,""HealthPerFive"":7,""HealthPerLevel"":68,""Lore"":""Upon the high winds of Mayan lands rides the feathered serpent, Kukulkan. Awesome and terrible to behold, majestic yet sinister, Kukulkan embodies the danger and beauty of a double-edged sword.\\n\\nTime has worn away knowledge of this God like the breeze over stone. Perhaps Kukulkan prefers this. He is known by many names and worn the face of man and beast - and worshipped with the kind of reverence born of fear.\\n\\nDotted across the vast forests of the Mayan lands stand great pyramids bearing his serpentine likeness, architecturally perfect so as to catch the light and bring to life those slithering stone statues. Painted in blood, sacrifices were made upon these sites to appease Kukulkan. He is the lord of death and rebirth.\\n\\nTo the world, he brought the four elements, but of wind he keeps control. A great gem, worn about his sinuous neck is said to be the source of all air.\\n\\nTo the people, he brought the calendar. That glorious, portentous stone disk, which counts time to a distant future, only to stop abruptly and with horrifying finality.\\n\\nTo the battlefield, he brings a legacy of power and domination. Sacrifices made for his favor were measured in blood, but mortal blood is weak. It seems that, for Kukulkan's ultimate appeasement, the blood of a God is required."",""MP5PerLevel"":0.45,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":170,""MagicalPowerPerLevel"":7.25,""Mana"":265,""ManaPerFiv