40% of your Magical Power)""},{""description"":""Knockup Time:"",""value"":""2.2s""}],""secondaryDescription"":""""}},""Id"":9898,""Summary"":""Epic Uppercut"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1993_9898.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Kumbhakarna does not die when he reaches 0 Health, instead he falls asleep. He will awaken after 8s at 25% Health and Mana, unless hit with 6 Basic Attacks (+1 every 5 levels) while sleeping. This passive has a 240s Cooldown."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":9885,""Summary"":""Sleepy"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1993_9885.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.75,""Health"":490,""HealthPerFive"":8,""HealthPerLevel"":100,""Lore"":""Do you hear it? That distant rumble like thunder across the mountains? Like pitched battle from miles away? Like a stampede of elephants across the plains? Know it is none of these things. That rumble you hear is the bellowing snore of Kumbhakarna, the Sleeping Giant.\\n\\nQuick with a laugh, honest with friends, but devastating in battle, Kumbhakarna embodies the traits of a hero, but loyalty to his tyrant brother, Ravana, often leads him to the wrong side.\\n\\nSo jovial and pious is he, that when granted a boon by Brahma, Kumbhakarna wished to take Indra's place and rule the Heavens. Indra was jealously threatened, convinced Brahma would let the good-natured giant usurp him, and magically twisted Kumbhakarna's tongue at the last second. Instead of asking for “Indraasana” (Indra's Seat), he asked for “Nidraasana,” ... to sleep.\\n\\nNow, Kumbhakarna is a dozing behemoth, waking only once every six months. Yet, Ravana is concerned with the growing fervor of the battle between gods and demons, sensing his dominion slipping. Prematurely, he has awoken his brother and pressed him to fight. Though reluctant, as if he knows his brother's stance is unjust, Kumbhakarna fights out of loyalty and a warrior's code.\\n\\nNow, that rumbling you hear, it is not his snores, but Kumbhakarna's mighty roar. Or was that a yawn?"",""MP5PerLevel"":0.42,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.5,""Mana"":200,""ManaPerFive"":4.6,""ManaPerLevel"":34,""Name"":""Kumbhakarna"",""OnFreeRotation"":"""",""Pantheon"":""Hindu"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":18,""PhysicalProtectionPerLevel"":3.2,""Pros"":"" High Crowd Control, High Defense"",""Roles"":"" Guardian"",""Speed"":365,""Title"":""The Sleeping Giant"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Kumbhakarna sleepily runs forward. If he hits an enemy he stops and deals damage. If the enemy is a minion, he throws them, dealing increased damage to each enemy they hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""45""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/140/210/280/350 (+50% of your Magical Power)""},{""description"":""Flying Minion Damage:"",""value"":""90/160/230/300/370 (+60% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""50/55/60/65/70"",""description"":""Kumbhakarna smashes down, damaging all enemies in front of him and Rooting them."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""40""}],""rankitems"":[{""descriptio