Reduction as his head fills with water (Max 10 Stacks).  Stacks last 10s and refresh when he gains another. If he is knocked up, grabbed, pulled, banished or otherwise disrupted, the bowl loses half of its stacks."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Damage Reduction:"",""value"":""1% per 2% of Maximum Health taken""},{""description"":""Maximum Reduction:"",""value"":""10%""},{""description"":""Reduction Lost:"",""value"":""5 stacks""},{""description"":""Duration:"",""value"":""10s""}],""secondaryDescription"":""""}},""Id"":14131,""Summary"":""Water Bowl"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/02/Icons_Kuzenbo_Passive-1.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.85,""Health"":500,""HealthPerFive"":8,""HealthPerLevel"":95,""Lore"":""Kappa are devious creatures. They linger just below the surface of rivers and lakes, waiting for mortals to test the water before snatching and drowning their fleshy meal. Taken merely at their appearance and juvenile sense of humor, they could be mistaken for mischievous turtle-men, almost playful in a rude sort of way, but they are dangerously strong and ruthless when submerging their prey. King among these monsters is Kuzenbo; bigger, stronger, and more cunning than the rest, but just as infantile.\\n\\nKuzenbo led his nine thousand Kappa followers to Japan, where they harried river villages and fishing boats, using their unnatural strength to pull mortals below. So clever, so hungry had the Kappa become, that Japan’s army marched to fight back, but they were no match.\\n\\nAs the bowl-shaped indentation atop a Kappa’s head is filled with water, that Kappa grows impossibly stronger - far stronger than a mortal. Yet, bound by their strange sense of honor, a Kappa must bow when bowed to, spilling their power upon the ground. It is the only known way to defeat one.\\n\\nAnd of the countless battles Kuzenbo has fought, he was defeated only twice. Upon his second defeat at the hands of General Kiyomasa, Kuzenbo was forced to swear to never again sow strife between man and beast. A vow the Kappa King has honored ever since.\\n\\nGods, however, are fair game."",""MP5PerLevel"":0.42,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.5,""Mana"":200,""ManaPerFive"":4.6,""ManaPerLevel"":34,""Name"":""Kuzenbo"",""OnFreeRotation"":"""",""Pantheon"":""Japanese"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":18,""PhysicalProtectionPerLevel"":3.2,""Pros"":"" High Crowd Control, High Defense"",""Roles"":"" Guardian"",""Speed"":365,""Title"":""King Kappa"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""16s"",""cost"":""70/75/80/85/90"",""description"":""Kuzenbo summons and throws the powerful NeNe Kappa, who can ricochet off of walls. After firing, if the NeNe Kappa bounces off of a wall it will travel 70 units from that point up to a maximum of 2 bounces. After reaching maximum range, or if an Enemy God is hit by the NeNe Kappa, it will burst forth from its shell, slowing and attacking them for 6s. Kuzenbo transfers 20% of his Health and Protections to the NeNe Kappa."",""menuitems"":[{""description"":""Ability:"",""value"":""Line Attack Special""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/105/140/175/210 (+55% of your Magical Power)""},{""description"":""Kappa Damage per Hit:"",""value"":""35/45/55/65/75""},{""description"":""Kappa Health:"",""value"":""25/30/35/40/45 (20% of your Maximum Health)""},{""description"":""Slow:"",""value"":""20%""},{""description"":""Slow Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""abilityDesc