n"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""22.5""}],""rankitems"":[{""description"":""Damage first Hit:"",""value"":""80/130/180/230/280 (40% of your Magical Power)""},{""description"":""Damage per Hit:"",""value"":""40/65/90/115/140 (20% of your Magical Power)""},{""description"":""Movement Speed:"",""value"":""45%""}],""secondaryDescription"":""""}},""abilityDescription5"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Each time Kuzenbo takes over 2% of his maximum health worth of damage, pre-mitigation, he is granted stacks of Damage Reduction as his head fills with water (Max 10 Stacks).  Stacks last 10s and refresh when he gains another. If he is knocked up, grabbed, pulled, banished or otherwise disrupted, the bowl loses half of its stacks."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Damage Reduction:"",""value"":""1% per 2% of Maximum Health taken""},{""description"":""Maximum Reduction:"",""value"":""10%""},{""description"":""Reduction Lost:"",""value"":""5 stacks""},{""description"":""Duration:"",""value"":""10s""}],""secondaryDescription"":""""}},""basicAttack"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":"""",""menuitems"":[{""description"":""Damage:"",""value"":""38 + 1.5/Lvl (+20% of Magical Power)""},{""description"":""Progression:"",""value"":""1/1/1 damage and swing time""}],""rankitems"":[],""secondaryDescription"":""""}},""godAbility1_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/02/Icons_Kuzenbo_A01-1.jpg"",""godAbility2_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/02/Icons_Kuzenbo_A02-1.jpg"",""godAbility3_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/02/Icons_Kuzenbo_A03-1.jpg"",""godAbility4_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/02/Icons_Kuzenbo_A04-1.jpg"",""godAbility5_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/02/Icons_Kuzenbo_Passive-1.jpg"",""godCard_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/kaijunbo.jpg"",""godIcon_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2017/02/kuzenbo_icon_128.jpg"",""id"":2260,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Vanish"",""Ability2"":""Decoy"",""Ability3"":""Aimed Strike"",""Ability4"":""Assassinate"",""Ability5"":""Behind You!"",""AbilityId1"":8425,""AbilityId2"":8427,""AbilityId3"":8464,""AbilityId4"":8453,""AbilityId5"":8412,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70/75/80/85/90"",""description"":""Loki disappears in a puff of smoke. While invisible, he moves faster, removes and gains immunity to Slow effects, and takes 25% less damage. His next Basic Attack from Stealth (or for 2s after) applies a Bleed to his target, dealing damage every .5s and reveals Loki."",""menuitems"":[{""description"":""Ability:"",""value"":""Melee Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""30/45/60/75/90 (+25% of your Physical Power)""},{""description"":""Damage Duration:"",""value"":""2s""},{""description"":""Stealth Duration:"",""value"":""4s""},{""description"":""Stealth Movement Speed:"",""value"":""35%""}],""secondaryDescription"":""""}},""Id"":8425,""Summary"":""Vanish"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1797_8425.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""60/65/70/75/80"",""description"":""Loki spawns a decoy version of himself that taunts all nearby enemy minions. After a short time, the decoy explodes dealing damage to all enemies in the radius."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""75/125/175/225/275 (+100% of your Physical Power)""},{""description"":""Decoy Lifetime:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":8427,""Summary"":""Decoy"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1797_8427.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""12/11/10/9/8s"",""cost"":""50"",""description"":""Upon activation, Loki's next Basic Attack does additional damage within a short time. The enemy hit is also Slowed."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""60/100/140/180/220 (+100% of your Physical Power)""},{""description"":""Buff Lifetime:"",""value"":""5s""},{""description"":""Slow:"",""value"":""25%""},{""description"":""Slow Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":8464,""Summary"":""Aimed Strike"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1797_8464.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Upon activation, Loki teleports to his ground target location. If an enemy god is within the radius, Loki will backstab that target doing damage and Stunning them."",""menuitems"":[{""description"":""Ability:"",""value"":""Teleport""},{""description"":""Affects:"",""value"":""Enemy Gods""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""150/225/300/375/450 (+120% of your Physical Power)""},{""description"":""Stun:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":8453,""Summary"":""Assassinate"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1797_8453.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Loki deals more damage from his Basic Attacks when hitting enemies from behind. His Basic Attacks also utilize a 5 swing progressive chain."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Bonus Damage:"",""value"":""20%""}],""secondaryDescription"":""""}},""Id"":8412,""Summary"":""Behind You!"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1797_8412.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.019,""Cons"":"""",""HP5PerLevel"":0.7,""Health"":395,""HealthPerFive"":8,""HealthPerLevel"":75,""Lore"":""Villain. It’s a word used to describe those that break the rules, that take what they want, and care nothing for those hurt along the way. Loki, the trickster God, would say villainy is nothing more than a point of view.\\n\\nThe point of view of fools too mindless to seize opportunity.\\n\\nOf course, with Loki now on the loose, the implications are dire. The end of times may be at hand. The final battle, Ragnarok, possibly on the horizon, for it was foretold that Loki would break free of his prison and herald the horrific final battle that would leave the Gods slain, the heavens sundered, and the world in ashes. None are more eager for that time of chaos than Loki.\\n\\nBefore his confinement, Loki’s malicious mischief managed to affect every God in ways both beneficial and terrible. Yet Loki’s most heinous act was in the death of the God of light, Baldr.\\n\\nBaldr’s prophetic dreams showcased his own death. Fearful for her son, Frigg forced all objects of the world to swear never to harm him. All save mistletoe. Cruelly amused, Loki forged a spear from the plant and provided it to Baldr’s brother Hodr. The Gods had a new favorite game, hurling objects at Baldr and laughing as they harmlessly ricocheted. So Hodr threw the spear, but, to everyone’s horror Baldr was impaled. Hel agreed to release Baldr from the underworld if all creatures of the world mourned the God of Light.  And all did, save one crone who refused. So Baldr died.\\n\\nWhen it was discovered the crone was Loki in disguise, the furious Gods bound him in entrails and hung a venomous serpent overhead. Loki’s wife, Sigyn, collected the dripping venom in a bowl, but when she was forced to empty it, Loki was struck, causing such anguish his thrashing would shake the world.\\n\\nBut now Loki is free and already wreaking havoc. If the prophetic Volva are correct, and they always are, then the end of all things has finally come."",""MP5PerLevel"":0.35,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":210,""ManaPerFive"":4.2,""ManaPerLevel"":35,""Name"":""Loki"",""OnFreeRotation"":"""",""Pantheon"":""Norse"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.4,""PhysicalProtection"":11,""PhysicalProtectionPerLevel"":2.9,""Pros"":"" High Single Target Damage"",""Roles"":"" Assassin"",""Speed"":375,""Title"":""The Trickster God"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70/75/80/85/90"",""description"":""Loki disappears in a puff of smoke. While invisible, he moves faster, removes and gains immunity to Slow effects, and takes 25% less damage. His next Basic Attack from Stealth (or for 2s after) applies a Bleed to his target, dealing damage every .5s and reveals Loki."",""menuitems"":[{""description"":""Ability:"",""value"":""Melee Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""30/45/60/75/90 (+25% of your Physical Power)""},{""description"":""Damage Duration:"",""value"":""2s""},{""description"":""Stealth D