tion"":""Medusa shoots out 3 vipers in rapid succession that poison the targets hit dealing damage over time."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self, Enemies""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""10/15/20/25/30 (+10% of your physical power) every 0.5s for 1.5s per charge ""},{""description"":""Attack Speed Increase:"",""value"":""40/50/60/70/80%""}],""secondaryDescription"":""""}},""Id"":11381,""Summary"":""Viper Shot"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2051_11381.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""14s "",""cost"":""60/65/70/75/80 "",""description"":""Medusa hurls back and spits out acid that damages the first enemy hit and sprays out acid in a cone behind them. Acid Spray will explode on statues Medusa has created."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""40""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/135/180/225/270 (+70% of your physical power)""}],""secondaryDescription"":""""}},""Id"":11420,""Summary"":""Acid Spray"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2051_11420.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70"",""description"":""Medusa quickly slithers forward rooting and slashing the first enemy god she encounters. The slash leaves the enemy god reeling in pain, reducing their healing for a short time."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/130/180/230/280 (+80% of your physical power)""},{""description"":""Healing Reduction:"",""value"":""50% for 3s""}],""secondaryDescription"":""""}},""Id"":11157,""Summary"":""Lacerate"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2051_11157.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Medusa removes her mask revealing her true face, delivering a powerful blast from her horrifying Gorgon gaze. Enemies take damage and are stunned if they are looking at Medusa. Enemies not looking at Medusa take 75% damage and are slowed. Enemy gods that are killed during Medusa's gaze will turn to a stone statue and remain behind as a reminder to others."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Damage:"",""value"":""300/400/500/600/700 (+100% of your physical power)""},{""description"":""Stun Duration:"",""value"":""2s""},{""description"":""Movement Speed Slow:"",""value"":""20/25/30/35/40%""},{""description"":""Slow Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":11377,""Summary"":""Petrify"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2051_11377.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Medusa suffers no movement penalty when side strafing and half of the movement penalty when moving backward."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":11153,""Summary"":""Sidewinder"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2051_11153.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.013,""Cons"":"""",""HP5PerLevel"":0.68,""Health"":470,""HealthPerFive"":8,""HealthPerLevel"":77,""Lore"":""All monsters are hideous and fearful, but some are worse than others. There is only one whose hair is made of slithering serpents, only one with skin of scales, and only one whose very gaze can turn man, beast, or God to stone. Medusa, the Gorgon.\\n\\nStories claim she was beautiful once. A priestess of Athena. Loyal and devout in action, but Poseidon was determined to make her his own. It was the fairness of her features, the golden of her hair, that attracted the Sea God. Medusa, a mortal maiden, could not refuse.\\n\\nWhen Athena learned of Medusa's betrayal, she punished the priestess. Those fair features were hideously wrought and those golden locks twisted to hissing vipers. Anyone that met her eyes was petrified – a statue for all eternity.\\n\\nMedusa fled, frightened, ashamed and furious. For years she hid from the world, nursing a festering hatred for all things, craving beauty but having none, seeing none, until she became the monster she appeared to be.\\n\\nShe slithers now to the field of battle. Those wretched features concealed behind a cruel mask of porcelain perfection, eyes burning from within. All that she perceives, all that is wonderful in this world, she seeks to destroy. Perhaps then she will be the fairest monster of them all."",""MP5PerLevel"":0.25,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":4.4,""ManaPerLevel"":34,""Name"":""Medusa"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.6,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Single Target Damage"",""Roles"":"" Hunter"",""Speed"":365,""Title"":""The Gorgon"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""50/55/60/65/70"",""description"":""Medusa shoots out 3 vipers in rapid succession that poison the targets hit dealing damage over time."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self, Enemies""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""10/15/20/25/30 (+10% of your physical power) every 0.5s for 1.5s per charge ""},{""description"":""Attack Speed Increase:"",""value"":""40/50/60/70/80%""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""14s "",""cost"":""60/65/70/75/80 "",""description"":""Medusa hurls back and spits out acid that damages the first enemy hit and sprays out acid in a cone behind them. Acid Spray will explode on statues Medusa has created."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""40""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/135/180/225/270 (+70% of your physical power)""}],""secondaryDescription"":""""}},""abilityDescription3"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70"",""description"":""Medusa quickly slithers forward rooting and slashing the first enemy god she encounters. The slash leaves the enemy god reeling in pain, reducing their healing for a short time."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/130/180/230/280 (+80% of your physical power)""},{""description"":""Healing Reduction:"",""value"":""50% for 3s""}],""secondaryDescription"":""""}},""abilityDescription4"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Medusa removes her mask revealing her true face, delivering a powerful blast from her h