/1941_9269.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Mercury dashes forward, knocking aside minions, grabbing the first enemy god he encounters and spinning them. The enemy god takes damage until the effect ends, and Mercury throws the god in the direction of his choice."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Minion Damage:"",""value"":""70/115/160/205/250 (+80% of your Physical Power)""},{""description"":""Damage per Tick:"",""value"":""10/15/20/25/30 (+20% of your Physical Power) every 0.25s""},{""description"":""Duration:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":9270,""Summary"":""Special Delivery"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1941_9270.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""80/90/100/110/120"",""description"":""Mercury gathers energy for a powerful Dash, with the range extending as he does so. He travels the distance faster than the speed of sound, dealing damage to all enemies, stunning them and spinning them around in a random direction."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""200/275/350/425/500 (+100% of your Physical Power)""},{""description"":""Disorient Duration:"",""value"":""1.5s""}],""secondaryDescription"":""""}},""Id"":9308,""Summary"":""Sonic Boom"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1941_9308.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""For every 1 unit traveled, Mercury gains a 0.1% Physical Power bonus on his next Basic Attack (max 50%).\n\nMercury also gains additional Physical Power equal to 25% of movement speed from items or abilities."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":9215,""Summary"":""Fastest God Alive"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1941_9215.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.024,""Cons"":"""",""HP5PerLevel"":0.7,""Health"":400,""HealthPerFive"":10,""HealthPerLevel"":75,""Lore"":""Mercurial. A word that evokes volatility, quickness, and cunning. But to compare anything to the speed and wit of the Messenger God Mercury would be to compare a hot day to the searing forge of Vulcan, or a blooming rose to the glory of Venus. It is but a pale comparison. Mercury can leap the space between lightning and thunder, outfox the fox king, and reach tomorrow before the sun.\\n\\nAs an infant, Mercury escaped the watchful eye of his half-brother, Apollo, stole his cattle, fashioned a lyre from a tortoise shell, and snuck in a nap, all before Apollo found him missing. His father, Jupiter, found the child’s mischief boisterously entertaining, and awarded him the task of delivering messages for the Gods, traveling between the Heavens, the Earth, and even to the depths of the Underworld.\\n\\nNow war looms and Mercury races to keep the lines of communication open, though he is often caught in the thick of battle. No stranger to combat, he once slew the monster Argus, the demon with one hundred watchful eyes, using speed and guile alone. But this war is different. The foes are stronger, the stakes higher, and Mercury a pivotal cog in the machine. Should he fail to deliver even a single order the balance could tip, and the time left for this world would be truly mercurial."",""MP5PerLevel"":0.35,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":