tion"":""Ne Zha dashes forward. If he hits an enemy god, he knocks them skyward for 4s, unleashing a 3-hit combo (successfully timed attacks during the combo result in critical strikes), then smashing them back to Earth in his starting location. This ability hits one initial time upon knockup, the three-hit combo, a fifth time while in air, and then again dealing additional damage to enemies in the radius as he lands for a total of 6 times."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy Gods""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage per Hit:"",""value"":""40/60/80/100/120 (+30% of your Physical Power)""},{""description"":""Damage (Initial/Landing):"",""value"":""60/100/140/180/220 (50% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":8801,""Summary"":""Wind Fire Wheels"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1915_8801.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Ne Zha's spirit is strengthened as he successfully hits enemies with abilities and basic attacks. Each hit provides 1 stack and each Critical Hit provides 2 stacks. Stacks remain until Ne Zha is out of combat for 5s."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Maximum Stacks:"",""value"":""20""},{""description"":""Critical Strike Chance per stack:"",""value"":"".5%""}],""secondaryDescription"":""""}},""Id"":13178,""Summary"":""Righteous Spirit"",""URL"":""""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.021,""Cons"":"""",""HP5PerLevel"":0.71,""Health"":400,""HealthPerFive"":10,""HealthPerLevel"":75,""Lore"":""Born to innocence, forced to fight, destined to be a hero, the child-god, Nezha, defends those that cannot defend themselves, especially against tyrant Gods.\\n\\nFor three and a half years, Nezha’s mother carried him in her womb. During this time, the Dragon Gods, led by Ao Kuang, terrorized the people, sending floods and storms, and demanding not just food, but child sacrifices to feast upon as well.\\n\\nInto this world was Nezha born, a full grown boy with laughter in his eyes, trained by the immortal sage Taiyi Zhenren, who gave him the powerful Universe Ring and Armillary Sash. Youthful and carefree, Nezha was also headstrong, often arguing with his father what was right and wrong.\\n\\nBut youth does not last forever, and Nezha’s life changed defending two friends against a captain of Ao Kuang’s army. Insulted, the Dragon God commanded his third son, Ao Bing, to defeat the boy, but in the end, Nehza slew his opponent. Furious with grief, Ao Kuang demanded Nezha’s father make reparations for the offense committed by his son, or he would send floods and storms to ravage the land. Nezha, humbly, sacrificed himself to appease the Dragon God, but evil Ao Kuang sent storms anyway.\\n\\nTaiyi Zhenren worked his wisdom, and from the petals of a Lotus plant, Nezha was reborn. The immortal sage gave him new weapons – the Fire Tipped Spear and Wind Fire Wheels – weapons to challenge even the Dragon God and defeat him once and for all.\\n\\nTime has passed since Ao Kuang’s ruin, but the winds of war are rising and new Gods of Tyranny challenge the safety of the defenseless. Once again, Nezha will set aside his youth and stand against the tide, for not even death can stop him."",""MP5PerLevel"":0.27,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":200,""ManaPerFive"":3.9,""ManaPerLevel"":35,""Name"":""Ne Zha"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.2,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":2.9,""Pros"":"" High Single Target Damage, Medium Crowd Control"",""Roles"":"" Assassin"",""Speed"":375,""Ti