nstinct to protect and nurture the people led her to champion the hunt. With meat she fed them and with hides she clothed them, but as the people she sought to protect grew old, or sick, or died on the battlefield, Neith’s compassion forced her to change her calling.\\n\\nWith nimble fingers, the Goddess wove shrouds to shield the lost spirits of the dead on their journey to the underworld, leaving a loose thread she could trace as the ghosts ventured down the river. As time passed, more and more threads spread across the world, weaving an intricate pattern of fate that only Neith could see.\\n\\nNow, the war between Gods grows ever more fevered, and Neith can no longer sit idle. The threads of fate are fraying at the edges and she must once again pick up her bow and hunt, or watch the world return to the waters from whence it came."",""MP5PerLevel"":0.35,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":230,""ManaPerFive"":4.4,""ManaPerLevel"":39,""Name"":""Neith"",""OnFreeRotation"":"""",""Pantheon"":""Egyptian"",""PhysicalPower"":35,""PhysicalPowerPerLevel"":2.3,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Crowd Control, High Sustain"",""Roles"":"" Hunter"",""Speed"":365,""Title"":""Weaver of Fate"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Neith fires a shot that passes through everything.  Each enemy hit takes damage and is Rooted. If the Spirit Arrow hits a Broken Weave, the Weave detonates, dealing an additional 100% of the damage and applying the Root to all enemies in the area."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/155/220/285/350 (+90% of your Physical Power)""},{""de