ield."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self and Enemies""}],""rankitems"":[{""description"":""Damage Reflect:"",""value"":""30/35/40/45/50% of damage received""},{""description"":""Healing:"",""value"":""60/70/80/90/100% of damage received""},{""description"":""Shield Health:"",""value"":""100/200/300/400/500""},{""description"":""Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""Id"":9688,""Summary"":""Retribution"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1980_9688.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90/85/80/75/70s"",""cost"":""90/95/100/105/110"",""description"":""Nemesis chooses a single enemy god, reducing their Health and movement speed and stealing a portion of their Protections for a time period. Her movement speed is also increased during this time."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self and Enemy God""}],""rankitems"":[{""description"":""Damage:"",""value"":""20/25/30/35/40% of current HP""},{""description"":""Protections:"",""value"":""30%""},{""description"":""Move Speed:"",""value"":""15/15/20/20/25%""},{""description"":""Target Debuff Duration:"",""value"":""5s""},{""description"":""Nemesis Buff Duration:"",""value"":""8s""}],""secondaryDescription"":""""}},""Id"":9686,""Summary"":""Divine Judgement"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1980_9686.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Nemesis holds the scales of balance. Hitting enemies with Basic Attacks tips the scales in her favor, reducing her target's Physical and Magical power and increasing hers (Stacking)."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Power Gain:"",""value"":""5% per hit""},{""description"":""Power Loss:"",""value"":""5% per hit""},{""description"":""Max Stacks:"",""value"":""4""},{""description"":""Duration:"",""value"":""5s""}],""secondaryDescription"":""""}},""Id"":9734,""Summary"":""Scales of Fate"",""URL"":""""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.022,""Cons"":"""",""HP5PerLevel"":0.7,""Health"":470,""HealthPerFive"":8,""HealthPerLevel"":76,""Lore"":""Of arrogance and pride, the Greeks have but one word: hubris. It is a crime against Gods and Men, but a crime many commit with impunity. Even mighty Zeus is guilty. But when punishment is due, there is one from whom even the God of Thunder shrinks. She is Nemesis, the red-washed blade of Divine Retribution.\\n\\nRecall the tale of Narcissus, so taken by his own beauty. Proudly, his visage was flaunted, to the detriment of all. Until, at last, he was led to a pond of crystal hue where his own reflection enraptured him. So long did he remain to gaze upon this self-image that hunger claimed his life. Thus does Nemesis respond to hubris. It is consequence equal to the crime.\\n\\nNow, behold the war torn land, beset by the wrath of wanton Gods filling the air with blood and boasts. This battlefield is stained with hubris. Unwittingly, these foolish warriors have summoned their greatest adversary. Nemesis has come!\\n\\nNo longer will foul deeds engender success, no hoard of wealth held in undeserving hands, no legends told when falsely earned. Nemesis will unleash a tide of retribution. Punishment for the crime of hubris is death."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":210,""ManaPerFive"":4.3,""ManaPerLevel"":38,""Name"":""Nemesis"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.25,""PhysicalProtection"":11,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Mobility"",""Roles"":"" Assassin"",""Speed"":375,""T