ins bonus damage and a special effect."",""menuitems"":[{""description"":""Ability:"",""value"":""Stim""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""HP5:"",""value"":""10/15/20/25/30""},{""description"":""Bonus Damage:"",""value"":""20/30/40/50/60""}],""secondaryDescription"":""""}},""Id"":13647,""Summary"":""Plan of Action"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/PlanOfAction.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""55/60/65/70/75"",""description"":""Nike leaps into the air, then crashes down at a location dealing damage and knocking up enemies.\r\nIf Nike's 'Plan of Action' is active, she travels to the location much faster."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Range:"",""value"":""55""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""65/115/165/215/265 (+60% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":13682,""Summary"":""Valiant Leap"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/ValiantLeap.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""100s"",""cost"":""90/95/100/105/110"",""description"":""Nike transforms into an armored sentinel and sends out a shockwave that damages and slows enemies around her. While in this form, she gains a percentage of her max health as a shield that lasts for 10 seconds.\r\nIf Nike's 'Plan of Action' is active, Nike instead gains an additional 20% shield and applies an additional 20% slow."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Radius:"",""value"":""40""}],""rankitems"":[{""description"":""Damage:"",""value"":""100/165/230/295/360 (+70% of your Physical Power)""},{""description"":""Slow:"",""value"":""20%""},{""description"":""Shield:"",""value"":""20/25/30/35/40% of Max Health""},{""description"":""Slow Duration:"",""value"":""6s""}],""secondaryDescription"":""""}},""Id"":13649,""Summary"":""Sentinel of Zeus"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/SentinelOfZeus.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Nike sets three goals that the team can achieve to gain increased strength. Upon completing a goal, Nike's team gains a Laurel that increases Power and Movement Speed. This Laurel can increase up to 3 times."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Allies""},{""description"":""Bonus Power:"",""value"":""+4/6/8%""},{""description"":""Bonus Movement Speed:"",""value"":""+2/4/6%""}],""rankitems"":[{""description"":""Goal #1:"",""value"":""Eliminate 10 Gods as a team.""},{""description"":""Goal #2:"",""value"":""Eliminate 250 minions as a team.""},{""description"":""Goal #3:"",""value"":""At least two allies are level 20.""}],""secondaryDescription"":""""}},""Id"":13656,""Summary"":""To Victory!"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/ToVictory.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.8,""Health"":470,""HealthPerFive"":7,""HealthPerLevel"":80,""Lore"":""It is often said that history is written by the victor. If that is true, then history is shaped by a single Goddess: Nike, the winged warrior.\\n\\nWhen the fastest runner bears a golden medal, when a cunning hunter slays the fiercest beast, when the soldiers seize the day, the Faithful of Olympus praise Nike. Without her favor, failure is ensured, and obscurity certain.\\n\\nEven mighty Zeus, a king among Gods, seeks the favor of Nike. On the smoke strewn fields of antiquity, when the God of Thunder marched against his Titan forebears, Nike fought by his side, her dauntless blade inspiring confidence in her allies as they faced an impossible foe. Without her, all the heavens are left to wonder if Zeus would have carried that day. Had Zeus fallen, the world as it is known would have fallen with him.\\n\\nSo, all hail the victor! She has finally taken the field. As Gods and Gorgons clash and battles most fierce and foul are fought, she alone shapes the day. For history is written by the victor, and Nike is victory incarnate."",""MP5PerLevel"":0.39,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":4.6,""ManaPerLevel"":38,""Name"":""Nike"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":37,""PhysicalPowerPerLevel"":2.0,""PhysicalProtection"":15,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Defense, Medium Crowd Control"",""Roles"":"" Warrior"",""Speed"":375,""Title"":""Goddess of Victory"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""60/65/70/75/80"",""description"":""Nike slams the ground twice, sending out fissures that deal damage. If a target is hit twice, that target loses protections for 5 seconds.\r\nIf Nike's 'Plan of Action' is active, Rend gains an additional attack. If a target is hit three times, that target is disarmed."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Range:"",""value"":""50""}],""rankitems"":[{""description"":""Damage:"",""value"":""50/85/120/155/190 (+40% of your Physical Power)""},{""description"":""Protections Shred:"",""value"":""4/8/12/16/20""},{""description"":""Disarm Duration:"",""value"":""1/1.25/1.5/1.75/2s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""18/17/16/15/14s"",""cost"":""30/35/40/45/50"",""description"":""Nike draws upon her vast battle experience to plan her next move.\r\nPassive: Nike gains HP5.\r\nActive: Nike's next ability gains bonus damage and a special effect."",""menuitems"":[{""description"":""Ability:"",""value"":""Stim""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""HP5:"",""value"":""10/15/20/25/30""},{""description"":""Bonus Damage:"",""value"":""20/30/40/50/60""}],""secondaryDescription"":""""}},""abilityDescription3"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""55/60/65/70/75"",""description"":""Nike leaps into the air, then crashes down at a location dealing damage and knocking up enemies.\r\nIf Nike's 'Plan of Action' is active, she travels to the location much faster."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Range:"",""value"":""55""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""65/115/165/215/265 (+60% of your Physical Power)""}],""secondaryDescription"":""""}},""abilityDescription4"":{""itemDescription"":{""cooldown"":""100s"",""cost"":""90/95/100/105/110"",""description"":""Nike transforms into an armored sentinel and sends out a shockwave that damages and slows enemies around her. While in this form, she gains a percentage of her max health as a shield that lasts for 10 seconds.\r\nIf Nike's 'Plan of Action' is active, Nike instead gains an additional 20% shield and applies an additional 20% slow."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Radius:"",""value"":""40""}],""rankitems"":[{""description"":""Damage:"",""value"":""100/165/230/295/360 (+70% of your Physical Power)""},{""description"":""Slow:"",""value"":""20%""},{""description"":""Shield:"",""value"":""20/25/30/35/40% of Max Health""},{""description"":""Slow Duration:"",""value"":""6s""}],""secondaryDescription"":""""}},""abilityDescription5"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Nike sets three goals that the team can achieve to gain increased strength. Upon completing a goal, Nike's team gains a Laurel that increases Power and Movement Speed. This Laurel can increase up to 3 times."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Allies""},{""description"":""Bonus Power:"",""value"":""+4/6/8%""},{""description"":""Bonus Movement Speed:"",""value"":""+2/4/6%""}],""rankitems"":[{""description"":""Goal #1:"",""value"":""Eliminate 10 Gods as a team.""},{""description"":""Goal #2:"",""value"":""Eliminate 250 minions as a team.""},{""description"":""Goal #3:"",""value"":""At least two allies are level 20.""}],""secondaryDescription"":""""}},""basicAttack"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":"""",""menuitems"":[{""description"":""Damage:"",""value"":""37 + 2/Lvl (+100% of Physical Power)""},{""description"":""Progression:"",""value"":""1/1/1.5x damage and swing time""}],""rankitems"":[],""secondaryDescription"":""""}},""godAbility1_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/Rend.jpg"",""godAbility2_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/PlanOfAction.jpg"",""godAbility3_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/ValiantLeap.jpg"",""godAbility4_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/SentinelOfZeus.jpg"",""godAbility5_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/ToVictory.jpg"",""godCard_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/Nike_Default_Card.jpg"",""godIcon_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/12/Nike_Web128x128.jpg"",""id"":2214,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Shadow Lock"",""Ability2"":""Siphon Darkness"",""Ability3"":""Shadow Step"",""Ability4"":""Night Terror"",""Ability5"":""Flame of the Night"",""AbilityId1"":11648,""AbilityId2"":11612,""AbilityId3"":11640,""AbilityId4"":11659,""AbilityId5"":10717,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""50/55/60/65/70"",""description"":""Nox extends her shadow, rooting and crippling a single enemy god in place and dealing damage over time. Nox must channel and stay within range to maintain hold on the target, but may cancel this ability early. Nox will continue to channel this ability even if she is hit Crowd Control effects. While channeling this ability Nox suffers no directional movement penalty."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""65""}],""rankitems"":[{""description"":""Damage:"",""value"":""30/40/50/60/70 (+20% of your magical power) every 0.5s""},{""description"":""Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""Id"":11648,""Summary"":""Shadow Lock"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2036_11648.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""13s"",""cost"":""70/75/80/85/90"",""description"":""Nox creates a void of darkness that silences all enemies within. After a short duration it explodes, dealing damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/160/230/300/370 (100% of your Magical Power)""},{""description"":""Duration:"",""value"":""2s""}],""secondaryDescription"":""""}},""Id"":11612,""Summary"":""Siphon Darkness"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2036_10712.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""90"",""description"":""Nox dashes forward, dealing damage to all enemies. If she hits an allied god, she leaps into their shadow, traveling with them. When Nox exits a shadow, she deals damage again in a radius around her. Nox may cancel this ability early to exit shadows."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""All""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/110/150/190/230 (+70% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":11640,""Summary"":""Shadow Step"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2036_10721.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90/85/80/75/70s"",""cost"":""100"",""description"":""Nox unleashes a vortex of dark energy that explodes on contact with an enemy god, dealing damage to all enemies in range 20 and applying damage over time. Enemies hit are also weakened, dealing less damage for the duration."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""120""}],""rankitems"":[{""description"":""Initial Damage:"",""value"":""200/250/300/350/400 (+75% of your Magical Power)""},{""description"":""Damage:"",""value"":""20/25/30/35/40 (+5% of your magical power) every 1s for 5s""},{""description"":""Damage Reduction:"",""value"":""40% for 5s""}],""secondaryDescription"":""""}},""Id"":11659,""Summary"":""Night Terror"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1864_8528.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Nox’s candles gather energy from all abilities she uses. For every ability Nox casts, a candle is lit. For every candle lit Nox gains +3% magical power. When Nox takes damage from an enemy god one of her candles is blown out."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":10717,""Summary"":""Flame of the Night"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2036_10717.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.6,""Health"":365,""HealthPerFive"":8,""HealthPerLevel"":75,""Lore"":""So fragile is the line between sleep and death, the difference only waking with the dawn. In that darkness she reigns, as the sun sinks below the horizon, as stalkers hunt their prey, as shadows thicken to consume the light. She is primal in a way that even the mightiest of Gods must fear, for she is the Goddess of Night, Nox, and from her was born all the certainties of life.\\n\\nFriendship and Love, Sunsets and Dreams, these are the Gods of inspiration. Nox is mother to them all. So too is she the mother of misfortune: Doom and Blame, Deceit, Strife, Woe and Death. Nox must love and protect all her children equally, as any mother would. They are her calling and her curse; her greatest pride and deepest shame. It is for her children she has now come to war.\\n\\nClothed not in black, but blackness, Nox is rarely seen. She glides between the light, just at the edge of vision. A specter. Even the God of Thunder is known to fear her, for Nox could steal his whispered breath and send him to a sleep eternal where dreams do not exist and no one ever wakes with the dawn."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":170,""MagicalPowerPerLevel"":7.5,""Mana"":250,""ManaPerFive"":5.0,""ManaPerLevel"":38,""Name"":""Nox"",""OnFreeRotation"":"""",""Pantheon"":""Roman"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":18,""PhysicalProtectionPerLevel"":2.6,""Pros"":"" High Crowd Control"",""