}},""godAbility1_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2036_11648.jpg"",""godAbility2_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2036_10712.jpg"",""godAbility3_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2036_10721.jpg"",""godAbility4_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1864_8528.jpg"",""godAbility5_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2036_10717.jpg"",""godCard_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/standardnox_card.jpg"",""godIcon_URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2036.jpg"",""id"":2036,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Mysterious Fog"",""Ability2"":""Clay Soldiers"",""Ability3"":""Shining Metal"",""Ability4"":""Fire Shards"",""Ability5"":""Strength of Wood"",""AbilityId1"":9438,""AbilityId2"":9443,""AbilityId3"":10335,""AbilityId4"":10362,""AbilityId5"":10250,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70/75/80/85/90"",""description"":""Nu Wa condenses moisture into fog at her location which then rolls forward away from her. She and all allies are Stealthed while inside the fog, and have increased movement speed. Attacking breaks the Stealth effect.\n\nEnemies that run into the fog take damage, and continue to take additional damage again every second they are in the fog."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""All""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""50/75/100/125/150 (+50% of your Magical Power)""},{""description"":""Damage per Tick:"",""value"":""10/20/30/40/50 (+10% of your magical power)""},{""description"":""Lifetime:"",""value"":""6s""},{""description"":""Movement Speed:"",""value"":""10%""}],""secondaryDescription"":""""}},""Id"":9438,""Summary"":""Mysterious Fog"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1958_9438.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""60/70/80/90/100"",""description"":""Nu Wa conjures Clay Soldiers from the Earth. If she marked a target while summoning them, they will pursue that target until it dies. If she summoned them with no target, they will attack enemy gods who damage Nu Wa, or closest enemies.\n\nSoldiers live for 10s. First they will dash at enemies within 45 units, applying a stack of protection reduction. Stacks up to 3 times, stacks last 2s. They will basic attack after that. "",""menuitems"":[{""description"":""Ability:"",""value"":""Summon Pet""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""40 ""}],""rankitems"":[{""description"":""Number Conjured:"",""value"":""1/2/2/2/3 Soldiers""},{""description"":""Soldier's Health:"",""value"":""200 (20% of your Maximum Health)""},{""description"":""Dash Magical Protection Reduction Per Stack:"",""value"":""4/8/12/16/20 ""},{""description"":""Basic Attack Damage:"",""value"":""20/30/40/50/60 Per Hit""}],""secondaryDescription"":""""}},""Id"":9443,""Summary"":""Clay Soldiers"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1958_9443.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""8s"",""cost"":""60"",""description"":""Nu Wa launches a mass of shining metal, damaging all enemies it hits. If it hits one of her Clay Soldiers, it explodes, dealing additional damage and Stunning enemies."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""65""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/130/170/210/250 (+65% of your Magical Power)""},{""description"":""Minion Explode:"",""value"":""30/60/90/120/150 (+25% of your Magical Power)""},{""description"":""Minion Stun:"",""value"":""1/1.2/1.3/1.4/1.5s""}],""secondaryDescription"":""""}},""Id"":10335,""Summary"":""Shining Metal"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1958_10335.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""110s"",""cost"":""100"",""description"":""Nu Wa flies up into the clouds, gaining visibility on all enemy gods, and summoning fire shards from the sky to damage each of them."",""menuitems"":[{""description"":""Ability:"",""value"":""Global""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""100/175/250/325/400 (+30% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":10362,""Summary"":""Fire Shards"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1958_10362.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""After 5 successful Basic Attacks, Nu Wa's next Basic Attack will Root enemies."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Root Duration:"",""value"":""1.5s""}],""secondaryDescription"":""""}},""Id"":10250,""Summary"":""Strength of Wood"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1958_10250.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.017,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":400,""HealthPerFive"":7,""HealthPerLevel"":75,""Lore"":""When two warring Gods shattered the World Pillar, Heaven and Earth dangerously shifted, and Armageddon was unleashed. Firestorms, floods, and bloodthirsty monsters ravaged the land and stole the lives of more than can be counted. In ages past, Nu Wa, Guardian of Heaven and Earth, hand-crafted all people from clay. They were her creations, her children, her responsibility.\\n\\nAs the Earth shuddered and broke, and the skies turned black with ash, Nu Wa forged five mystic stones, one for each of the elemental forces of nature: Earth, Water, Fire, Wood, and Metal. With the power of these stones, she slew a gargantuan tortoise, severed its legs, and raced to the broken World Pillar. One leg she used to prop the Heavens aloft and with the elemental stones, she sealed it in place. Balance between Heaven and Earth was restored, but the world was never the same. Skies cleared, but the stars had shifted. Seas retreated, but rivers drained westward. Everything leaned, but the End was averted.\\n\\nIn the years that followed, Nu Wa and her brother, Fu Xi, took the throne of China. They ruled with wisdom and ushered in an age of recovery and prosperity, for which she is adored and worshipped to this day.\\n\\nYet, the skies grow dark once more and chaos threatens to engulf the land. Gods from all Pantheons have chosen Earth as a battleground, trading blows with the same thoughtless fervor that destroyed the World Pillar so long ago. Determined to prevent such calamity from repeating, Nu Wa has summoned the elemental stones once more. For she is the Guardian of Heaven and Earth; all mankind are her creations, her children, her responsibility."",""MP5PerLevel"":0.43,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":175,""MagicalPowerPerLevel"":7.5,""Mana"":265,""ManaPerFive"":4.6,""ManaPerLevel"":43,""Name"":""Nu Wa"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":9,""PhysicalProtectionPerLevel"":2.7,""Pros"":"" Pusher"",""Roles"":"" Mage"",""Speed"":355,""Title"":""Guardian of Heaven"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70/75/80/85/90"",""description"":""Nu Wa condenses moisture into fog at her location which then rolls forward away from her. She and all allies are Stealthed while inside the fog, and have increased movement speed. Attacking breaks the Stealth effect.\n\nEnemies that run into the fog take damage, and continue to take additional damage again every second they are in the fog."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""All""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""50/75/100/125/150 (+50% of your Magical Power)""},{""description"":""Damage per Tick:"",""value"":""10/20/30/40/50 (+10% of your magical power)""},{""description"":""Lifetime:"",""value"":""6s""},{""description"":""Movement Speed:"",""value"":""10%""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""60/70/80/90/100"",""description"":""Nu Wa conjures Clay Soldiers from the Earth. If she marked a target while summoning them, they will pursue that target until it dies. If she summoned them with no target, they will attack enemy gods who damage Nu Wa, or closest enemies.\n\nSoldiers live for 10s. First they will dash at enemies within 45 units, applying a stack of protection reduction. Stacks up to 3 times, stacks last 2s. They will basic attack after that. "",""menuitems"":[{""description"":""Ability:"",""value"":""Summon Pet""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""40 ""}],""rankitems"":[{""description"":""Number Conjured:"",""value"":""1/2/2/2/3 Soldiers""},{""description"":""Soldier's Health:"",""value"":""200 (20% of your Maximum Health)""},{""description"":""Dash Magical Protection Reduction Per Stack:"",""value"":""4/8/12/16/20 ""},{""description"":""Basic Attack Damage:""