ield expires it explodes outward, dealing damage to nearby enemies based on how much Health it had remaining. If the Shield is at full Health, it deals additional bonus damage.\n\nThe Shield will not expire while Odin is using Lunge, and will always detonate upon landing."",""menuitems"":[{""description"":""Ability:"",""value"":""Shield""},{""description"":""Affects:"",""value"":""Self and Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Shield Health:"",""value"":""100/175/250/325/400 (+60% of your Physical Power)""},{""description"":""Duration:"",""value"":""4s""},{""description"":""Bonus Damage:"",""value"":""25%""}],""secondaryDescription"":""""}},""Id"":10488,""Summary"":""Raven Shout"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1669_10488.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""70"",""description"":""Odin does a sweeping spear attack that hits twice dealing damage and Slowing all enemies around him on both hits."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage Per Hit:"",""value"":""45/65/85/105/125 (+30% of your Physical Power)""},{""description"":""Slow:"",""value"":""40%""},{""description"":""Slow Duration:"",""value"":""2/2.2/2.4/2.6/2.8s""}],""secondaryDescription"":""""}},""Id"":7284,""Summary"":""Gungnir's Might"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1669_7284.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""75"",""cost"":""100"",""description"":""Odin summons a wall of spears that blocks his enemies movement, but Odin and his allies may move freely through. It does not block attacks. Enemies inside the ring have their attack speed lowered, and are prevented from healing. Odin is immune to Slow and Root effects while in his Ring.\n\nEnemies that die inside Ring of Spears grant Odin a permanent bonus to Physical Power."",""menuitems"":[{""description"":""Ability:"",""value"":""Wall""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Attack Speed Reduction:"",""value"":""20/30/40/50/60%""},{""description"":""Duration:"",""value"":""6s""},{""description"":""Physical Power:"",""value"":""5 Power per stack/ max 10 stacks.""},{""description"":""Healing Reduction:"",""value"":""All Healing""}],""secondaryDescription"":""""}},""Id"":10479,""Summary"":""Ring of Spears"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1669_10479.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Odin is empowered as he escorts fallen warriors to Valhalla. Whenever any god dies on the battleground, Odin gains a bonus to Movement Speed and Power. This effect can stack up to 5 times."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Duration:"",""value"":""8s""},{""description"":""Movement Speed per stack:"",""value"":""8%""},{""description"":""Power per stack"",""value"":""8%""}],""secondaryDescription"":""""}},""Id"":10489,""Summary"":""Path to Valhalla"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1669_10489.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.011,""Cons"":"""",""HP5PerLevel"":0.63,""Health"":460,""HealthPerFive"":9,""HealthPerLevel"":80,""Lore"":""Mightiest of the Aesir, warrior and king, the All-Father is a doomed God.\\n\\nIt seems strange to imagine a God concerned with his fate, but Odin regularly consults the volva, the seers in the North. They speak of a final war, Ragnarok, when the mightiest Gods are slain and the world is consumed by the sea. For this day, Odin constantly prepares.\\n\\nThe All-Father can trace his lineage to the evil Frost Giant, Ymir, whom he slew with the aid of his two brothers, Vili and Ve, and with his remains forged the world. Atop Asgard, where Odin presides, he is known as the bringer of war, a sage of wisdom, and the keeper of souls slain in battle.\\n\\nAs a warrior, Odin rides his eight legged steed, Sleipnir, and wields the mighty spear Gungnir. Accompanying him are two wolves and his two trusted ravens, Huginn (thought) and Muninn (memory), who fly around Midgard and return to Odin with all they see and hear.\\n\\nAs a sage, Odin travels disguised as a simple wanderer, seeking wisdom. His thirst for knowledge has come at great personal cost, having been hanged from the branches of Yggdrasil, the world tree, for nine days and nights and sacrificed one of his eyes to the Well of Wisdom.\\n\\nAs keeper of souls, Odin welcomes slain warriors to his mighty hall of Valhalla on the agreement they will aid him at Ragnarok. Favored female warriors become his elite Valkyrie that usher those worthy of entry to Valhalla.\\n\\nIt is in preparation for the final days of Ragnarok he does all this. For the seers claim his death will come at the fangs of the great wolf Fenrir, and like anyone, Odin seeks to change his fate. Yet, never once have the volva been mistaken."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":200,""ManaPerFive"":4.1,""ManaPerLevel"":35,""Name"":""Odin"",""OnFreeRotation"":"""",""Pantheon"":""Norse"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.0,""PhysicalProtection"":16,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Area Damage, High Crowd Control"",""Roles"":"" Warrior"",""Speed"":375,""Title"":""The Allfather"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cos