ing damage and preventing them from healing. Targets are Rooted for 0.4s during the attack. Enemy minions in the target area also take damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Area:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""220/320/420/520/620 (80% of your Physical Power)""},{""description"":""Healing Reduction:"",""value"":""All Healing""},{""description"":""Duration:"",""value"":""6s""}],""secondaryDescription"":""""}},""Id"":10000,""Summary"":""Lord of the Afterlife"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2000_10000.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Each time Osiris uses an ability he burns away a fragment of his body, gaining Damage Mitigation for each missing fragment. After losing 8 fragments, he becomes his spirit form. He may walk through enemies and enemy blockers, and his Basic Attacks do not incur a movement penalty. This effect lasts for 6 successful Basic Attacks."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Physical Damage Mitigation:"",""value"":""2% per missing fragment""},{""description"":""Magical Damage Mitigation:"",""value"":""1% per missing fragment""}],""secondaryDescription"":""""}},""Id"":9973,""Summary"":""Fragmented"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/2000_9973.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.014,""Cons"":"""",""HP5PerLevel"":0.8,""Health"":475,""HealthPerFive"":6,""HealthPerLevel"":85,""Lore"":""Never has there been, nor shall there be a king more perfect than Osiris. Son of the Earth God, Geb, Osiris was divine royalty by birth, and all the land his birthright. Benevolence and prosperity were the hallmarks of his reign. Would that he had been left to shape the world, but the jealousy of his brother, Set, changed the course of fate.\\n\\nSeeking to usurp the throne, Set deceived and murdered his brother, tearing his body to pieces and casting them across the land. Isis, Osiris’ wife, secretly fled while Set plunged the kingdom into darkness. For years she toiled to reassemble her husband while his spirit form, his Ba, endured. Yet for all her searching, she could not find every part of him, and Isis was forced to reanimate Osiris without. Though not strong enough to defy Set in this incomplete form, Osiris gave Isis a son that would topple the tyrant Set and restore balance to Egypt.\\n\\nWhat remains of Osiris is a fragment of what he once was. Robbed of his crown over the earth, he now governs the realm of the dead with the same benevolence he ruled the living. But darkness looms again, and though broken, Osiris refuses to sit idly by. Mustering the last of his strength and spirit, Osiris seeks to change the course of fate, this time for the light over darkness."",""MP5PerLevel"":0.39,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":230,""ManaPerFive"":4.7,""ManaPerLevel"":40,""Name"":""Osiris"",""OnFreeRotation"":"""",""Pantheon"":""Egyptian"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.25,""PhysicalProtection"":17,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Defense, High Attack Speed"",""Roles"":"" Warrior"",""Speed"":375,""Title"":""Broken God of the Afterlife"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""5s"",""cost"":""30"",""description"":""Osiris throws his Sickle forward. It stops at the first enemy hit, dealing damage and Slowing them. The Sickle remains for the duration of the Slow."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""descripti