eidon's Tide on successful hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Base Damage per Hit:"",""value"":""30/40/50/60/70""},{""description"":""Movement Speed:"",""value"":""5/10/15/20/25%""},{""description"":""Lifetime:"",""value"":""6s""}],""secondaryDescription"":""""}},""Id"":8698,""Summary"":""Trident"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1881_8698.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""60/70/80/90/100"",""description"":""Poseidon summons a whirlpool at his ground target location that Cripples targets, preventing movement abilities, and pulls targets toward the center dealing Magical damage every .5s for 3s. Reduces Poseidon's Tide by 25% when cast."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""15/25/35/45/55  (+15% of your Magical Power)""},{""description"":""Tidal Meter:"",""value"":""-20% Tide""}],""secondaryDescription"":""""}},""Id"":8703,""Summary"":""Whirlpool"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1881_8703.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100/110/120/130/140"",""description"":""Poseidon releases the Kraken, damaging and Slowing targets in its radius. Enemies in the center of the effect when it spawns take additional damage, are bounced into the air and Stunned."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""170/195/220/245/270 (+30% of your Magical Power)""},{""description"":""Damage (Center):"",""value"":""180/220/260/300/340 (60% of your Magical Power)""},{""description"":""Slow:"",""value"":""30%""},{""description"":""Stun (Center):"",""value"":""1/1.25/1.5/1.75/2s""},{""description"":""Tidal Meter:"",""value"":""-50% Tide""}],""secondaryDescription"":""""}},""Id"":8705,""Summary"":""Release the Kraken!"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1881_8705.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Poseidon's movement speed increases and his abilities do additional damage as his Tide Level increases. Successful Basic Attack hits increase his Tide, and using abilities decreases it."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""High Tide Damage:"",""value"":""Abilities deal up to 20% additional damage at max Tide Level""},{""description"":""High Tide Speed:"",""value"":""Movement speed increases up to 15% at max Tide Level""},{""description"":""Basic Attacks:"",""value"":""+10% Tide Level on Hit""}],""secondaryDescription"":""""}},""Id"":8697,""Summary"":""Changing Tides"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1881_8697.jpg""},""AttackSpeed"":0.87,""AttackSpeedPerLevel"":0.01,""Cons"":"""",""HP5PerLevel"":0.5,""Health"":380,""HealthPerFive"":6,""HealthPerLevel"":67,""Lore"":""Deep beneath the turbulent tides of the ocean lingers a God of idle rage. What must it be like to live forever in the shadow of your brother? To be denied again and again that which you desire, despite the power of the wrathful seas at your command? So Poseidon broods on his throne at the ocean floor.\\n\\nAs a child, Poseidon and his brother, Hades, were consumed by their father, Cronus. Powerless to escape, it was left to mighty Zeus to free them and slay their patron. Together, they defeated the last of the Titans and ushered in a new age of dominance for Olympian Gods, but their freedom, their very lives, Zeus would never let either brother forget were owed to him. Even as the heavens, the underworld, and the seas were divided among them, Zeus positioned himself as king of all, and what was Poseidon to do but be thankful he had been spared a fate in his father’s belly? So he retired to his new realm and began the pursuit of gathering worshippers.\\n\\nSoon rose a great ocean front city of mankind, and Poseidon presented himself as their God, but another had already come, Athena, Zeus’ daughter. A competition was held – each God would offer a gift and the people would select their sponsor. Confident, Poseidon drove his Trident, a trophy from the battle against the Titans, into the ground and a limitless spring emerged, but the people found the water salty and undrinkable. Athena extended her hand and a graceful olive tree rose from the earth. Wood, food, and oil, all from one gift. The people decided and the city was called Athens.\\n\\nIt may be that Poseidon never desired greatness as Zeus did. Had his father never consumed him, had he never been made God of the Sea, had his brother never crowned himself King of the Gods, Poseidon might have lived contentedly, but that chance is gone. Now, with the very tides at his command, an army of sea beasts at his back, and the formidable Kraken at his call, the glowering God of the deep seeks to quench his thirsty rage and plunge all the world in endless, wrathful seas."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":175,""MagicalPowerPerLevel"":7.5,""Mana"":245,""ManaPerFive"":4.6,""ManaPerLevel"":40,""Name"":""Poseidon"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":8,""PhysicalProtectionPerLevel"":2.2,""Pros"":"" High Area Damage"",""Roles"":"" Mage"",""Speed"":