d twice as fast on enemies facing him. After 2s, the light detonates, doing damage, applying another Slow stack, and increasing the Slow duration. Any enemies facing Ra at the time of the explosion are also Blinded."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""60/100/140/180/220 (+40% of your Magical Power)""},{""description"":""Slow per Stack:"",""value"":""5%""},{""description"":""Detonate Lifetime:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":7663,""Summary"":""Divine Light"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1698_7663.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""65/75/85/95/105"",""description"":""Ra summons a pillar of blessed light.  Allies inside the blessing have increased Protections and are Healed every second.  Enemies are damaged every second."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy and Allies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""20/32/44/56/68 (+20% of your Magical Power)""},{""description"":""Heal per Tick:"",""value"":""10/20/30/40/50 (10% of your Magical Power)""},{""description"":""Protections:"",""value"":""10/15/20/25/30""},{""description"":""Lifetime:"",""value"":""6s""}],""secondaryDescription"":""""}},""Id"":7661,""Summary"":""Solar Blessing"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1698_7661.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""70/65/60/55/50s"",""cost"":""90"",""description"":""Ra calls on the power of the sun to decimate his foes in an extreme blast of heat in front of him, doing damage to all enemies unlucky enough to find themselves in the path."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""400/475/550/625/700 (+100% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":7662,""Summary"":""Searing Pain"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1698_7662.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Every time Ra uses an ability, his movement speed is increased."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Movement Speed:"",""value"":""6%""},{""description"":""Max Stacks:"",""value"":""3""},{""description"":""Lifetime:"",""value"":""15s""}],""secondaryDescription"":""""}},""Id"":7660,""Summary"":""Speed of Light"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1698_7660.jpg""},""AttackSpeed"":0.88,""AttackSpeedPerLevel"":0.009,""Cons"":"""",""HP5PerLevel"":0.48,""Health"":385,""HealthPerFive"":7,""HealthPerLevel"":68,""Lore"":""Without the sun, there would be no light, no warmth, no life. Without Ra, there would be no sun.\\n\\nRa is a guardian, the keeper of Ma’at - order and truth, and master of the sun. Each day he sails across the sky in a golden ship, and each night traverses the underworld, bringing light and warmth to the dead beneath the horizon. For those in the scorched South, Ra was the first God, creator of earth and sky and father to all other Gods.\\n\\nBut Ra’s time is fading like a twilight sky. His descendants have grown in power and prominence and seek to replace him as the figure of authority. His own granddaughter, Isis, cleverly poisoned him by secretly summoning a viper under his feet. When he stepped on it, the serpent’s venomous bite poisoned him. Isis promised to heal Ra if he revealed to her his True Name. At first, he refused, for knowledge of his True Name would give Isis unparalleled power over him, but as the pain mounted, Ra was forced to relent. Isis kept her word and Ra was healed, though the cost may have been too high.\\n\\nLight can heal, but light can also burn, and the great protector is showing signs of wrath not seen since mankind’s insolence. In that rare moment of anger, Ra sent his daughter, Hathor, in the form of a lion, to devour the people. However, he ended her bloody feeding before she consumed all mankind. This time, his burning gaze is set on the other Gods. When his wrath finally cools, nothing may be left but ash."",""MP5PerLevel"":0.44,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":170,""MagicalPowerPerLevel"":7.5,""Mana"":255,""ManaPerFive"":4.8,""ManaPerLevel"":48,""Name"":""Ra"",""OnFreeRotation"":"""",""Pantheon"":""Egyptian"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":10,""PhysicalProtectionPerLevel"":2.5,""Pros"":"" High Sustain, Pusher"",""Roles"":"" Mage"",""Speed"":350,""Title"":""Sun God"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""60/65/70/75/80"",""description"":""Ra summons a moving beam of intense light from the sky, doing damage to anyone caught under the beam."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""95/155/215/275/335 (+80% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""60/70/80/90/100"",""description"":""Light starts to emanate from Ra, Stacking a Slow every .5s on enemies near him, and twice as fast on enemie