pounds his drums sending forth a peal of thunder in a line, then another, then two at once, each growing wider as it travels. The thunder deals Magical Damage to Enemies it hits."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""65""}],""rankitems"":[{""description"":""Damage per Shot:"",""value"":""35/50/65/80/95 (/+25% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":14746,""Summary"":""Percussive Storm"",""URL"":""""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""16/15/14/13/12s"",""cost"":""60/65/70/75/80"",""description"":""Raijin marks a target enemy by dismissing his ally Raiju, who hides in the enemy's navel. While asleep, Raiju slows and reveals the target to Raijin's team on the minimap. The next time Raijin damages the target, Raiju awakens and claws his way out, doubling the slow and damaging the target and 5 nearby enemies every .5s for 2.5s in his attempt to flee."",""menuitems"":[{""description"":""Ability:"",""value"":""Debuff""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""12.5""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""15/25/35/45/55 (/+13% of your Magical Power)""},{""description"":""Mark Duration:"",""value"":""4/4.5/5/5.5/6s""},{""description"":""Slow:"",""value"":""15%""}],""secondaryDescription"":""""}},""Id"":14747,""Summary"":""Raiju"",""URL"":""""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70/75/80/85/90"",""description"":""Raijin sends a bolt of lightning crashing down at his ground target location damaging and mesmerizing enemies, while Raijin himself ascends into the sky.  Shortly thereafter he crashes down at that location, doing a second burst of damage to all enemies in the area.\r\n"",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""15, 25""}],""rankitems"":[{""description"":""Lightning Damage:"",""value"":""20/25/30/35/40 (/+20% of your magical power)""},{""description"":""Thunder Damage:"",""value"":""40/50/60/70/80 (/+20% of your Magical Power)""},{""description"":""Mesmerize Duration:"",""value"":"".3s""}],""secondaryDescription"":""""}},""Id"":14748,""Summary"":""Thunder Crash"",""URL"":""""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""90"",""description"":""Raijin flies above the battlefield, beating his drums 4 times to summon peals of thunder. With each hit, he has a choice of three beats:\n\nBeat one: 100% damage.\nBeat two: Taunt and 30% Damage\nBeat three: Fear and 30% Damage\n\nWhile in the air, Raijin suffers a 20% Movement Speed Slow."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""100""}],""rankitems"":[{""description"":""Damage per Hit:"",""value"":""120/150/180/210/240 (+50% of your Magical Power)""},{""description"":""Taunt Duration per Hit:"",""value"":"".5s""},{""description"":""Fear Duration per Hit:"",""value"":"".5s""}],""secondaryDescription"":""""}},""Id"":14745,""Summary"":""Taiko Drums"",""URL"":""""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""For every 5 abilities cast, Raijin reduces the cooldown of all abilities currently on cooldown (including the one just cast) by 2s."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":14698,""Summary"":""Charged Tempo"",""URL"":""""},""AttackSpeed"":0.87,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":385,""HealthPerFive"":6,""HealthPerLevel"":80,""Lore"":""Thunder is a terrifying element, trembling the very earth with its sound. Herald to storms, accomplice to lightning, thunder is primal, powerful and chaotic. Let this speak, then, of its master, the demon faced God, Raijin, who summons this force with the pounding of his great drums.\\n\\nEver in conflict with his equally fearsome brother, Fujin, Master of Wind, Raijin vies for control of the skies above the Realm of the Rising Sun. For mortals, their battles form dramatic storms and devastating tidal waves, but for the brothers, this is just friendly competition; an ongoing tournament to determine the strongest.\\n\\nThough monstrous in appearance and intimidating in battle, Raijin is generous to his Faithful, clearing the detritus with lightning to leave rice fields all the more fertile. That doesn’t stop parents from warning their children to hide when a storm comes, lest Raijin devour their bellies. Raijin no doubt finds this tale amusing but has yet to actually feast on any toddlers.\\n\\nWar has reached the distant shores of Raijin’s island realm, and for the first time, he has encountered other Gods that claim dominion over lightning, thunder, and the sky itself. Relishing this opportunity to prove dominance, Raijin enters the fray, drums pounding, and his boisterous laugh indistinguishable from rolling thunder."",""MP5PerLevel"":0.46,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":170,""MagicalPowerPerLevel"":7.5,""Mana"":255,""ManaPerFive"":4.6,""ManaPerLevel"":43,""Name"":""Raijin"",""OnFreeRotation"":"""",""Pantheon"":""Japanese"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":9,""PhysicalProtectionPerLevel"":3.1,""Pros"":"" Pusher, High Mobility"",""Roles"":"" Mage"",""Speed"":355,""Title"":""Master of Thunder"",""Type"":"" Ranged, Magical"",""ab