)""},{""description"":""Progression:"",""value"":""None""}],""rankitems"":[],""secondaryDescription"":""""}},""godAbility1_URL"":"""",""godAbility2_URL"":"""",""godAbility3_URL"":"""",""godAbility4_URL"":"""",""godAbility5_URL"":"""",""godCard_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/02/Raijin_CCSkin_Card.jpg"",""godIcon_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/02/Raijin_Default_Icon.jpg"",""id"":2113,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Astral Strike"",""Ability2"":""Pick Me Up"",""Ability3"":""Rolling Assault"",""Ability4"":""Astral Barrage"",""Ability5"":""Astral Quiver"",""AbilityId1"":10160,""AbilityId2"":10162,""AbilityId3"":10038,""AbilityId4"":10116,""AbilityId5"":10144,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":""20 + 1 arrow per shot"",""description"":""Rama switches to a more powerful arrow that Pierces and Slows enemies. This ability consumes 1 of Rama's Astral Arrows and deals bonus damage with every shot. Damage from this ability is reduced to 75% for each enemy hit after the first. Rama cannot toggle this ability if he has no Astral Arrows.\r\n\r\n The Slow can be Stacked up to 3 times."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Slow %:"",""value"":""10% ""},{""description"":""Time Slowed:"",""value"":""2s""},{""description"":""Bonus Damage:"",""value"":""10/20/30/40/50""}],""secondaryDescription"":""""}},""Id"":10160,""Summary"":""Astral Strike"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2002_10160.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""80/85/90/95/100"",""description"":""Passive: Any time an enemy is hit by an Astral Arrow there is a % chance that an Astral Arrow pickup will appear on the ground (only procs on 