ankitems"":[{""description"":""Damage:"",""value"":""200/300/400/500/600 (+60% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":10116,""Summary"":""Astral Barrage"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2002_10116.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Rama's Astral Quiver generates an Astral Arrow every 12s. Also, every Basic Attack that Rama lands will reduce the amount of time to generate an arrow by 2s. Astral Arrows are used with his other abilities. "",""menuitems"":[{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":10144,""Summary"":""Astral Quiver"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2002_10144.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.016,""Cons"":"""",""HP5PerLevel"":0.65,""Health"":460,""HealthPerFive"":8,""HealthPerLevel"":76,""Lore"":""Ravana's immortal reign subjugates the people. Shiva's boon grants the demon-king invulnerability against gods and beasts. Only mortal men stand a chance of defeating him, but Ravana's might is too potent for a mere man to overcome. All seems lost.\\n\\nTo save us, Vishnu took human form. Rama, prince of Ayodhya.\\n\\nAt age 16 he was already the perfect embodiment of man. Strong, humble, handsome, patient, devout; he is what mankind strives to be, yet, for all our flaws, can never reach.\\n\\nWhen a neighboring kingdom, cursed by Ravana's magic, asked for aid, Rama answered, despite the misgivings of his father. With his brother Laksharma, Rama set out and slew a horde of demons. At the palace, Rama cleansed the curse by freeing the queen from stone. The city celebrated and Rama was invited to string Shiva's bow – with the prize princess Sita's hand in marriage. Shiva's bow could not be lifted by any man, let alone strung, but Rama broke the bow in half. He and Sita wed immediately.\\n\\nReturning home, Rama was to be crown prince, but the jealousy of queen Kaikeyi forced Rama into exile, where he's remained these past fourteen years.\\n\\nYet Rama was recently seen on the field of battle. Word is, Ravana stole Rama's wife, and Rama left exile to embrace his destiny. He must defeat Ravana, free his wife, and set mankind on a path for peace, else darkness and evil will conquer all."",""MP5PerLevel"":0.25,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":205,""ManaPerFive"":4.5,""ManaPerLevel"":34,""Name"":""Rama"",""OnFreeRotation"":"""",""Pantheon"":""Hindu"",""PhysicalPower"":40,""PhysicalPowerPerLevel"":2.5,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":2.8,""Pros"":"" High Mobility, High Attack Speed"",""Roles"":"" Hunter"",""Speed"":365,""Title"":""Seventh Avatar of Vishnu"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":"""",""cost"":""20 + 1 arrow per shot"",""description"":""Rama switches to a more powerful arrow that Pierces and Slows enemies. This ability consumes 1 of Rama's Astral Arrows and deals bonus damage with every shot. Damage from this ability is reduced to 75% for each enemy hit after the first. Rama cannot toggle this ability if he has no Astral Arrows.\r\n\r\n The Slow can be Stacked up to 3 times."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Slow %:"",""value"":""10% ""},{""description"":""Time Slowed:"",""value"":""2s""},{""description"":""Bonus Damage:"",""value"":""10/20/30/40/50""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""80/85/90/95/100"",""description"":""Passive: Any time an enemy is hit by an Astral Arrow there is a % chance that an Astral Arrow pickup will appear on the ground (only proc