oughs are held the nine realms of existence, and nests the wise Eagle. Far below, across the galaxy spanning trunk, and beneath the roots, coils Nidhogg, the deplorable serpent. In eternal, bloodless conflict are the Eagle and Serpent locked. Perhaps these two enemies would have forgotten each other long ago were they not able to trade jabs and threats across that impossible distance. Yet, there is one that takes great pleasure enabling this feud, one whose mischievous talent for insults and barbs knows no bounds. And he’s just a squirrel.\\n\\nRatatoskr, the sly messenger, has lived in the World Tree since time immemorial. Where he came from or why is truly unknown, but if there’s a way for him to stir the pot between any two gods, he’ll do it. He’s a master of gossip and coy, backhanded compliments. And yet, all the Gods come to him for news. His home on the trunk of Yggdrasil conveniently places Ratatoskr at the center of all cosmic activity.\\n\\nAs Gods from every Pantheons clash, how could Ratatoskr pass up the opportunity to instigate new rivalries? Quite simply, he cannot. Beware the squirrel."",""MP5PerLevel"":0.46,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":240,""ManaPerFive"":4.6,""ManaPerLevel"":41,""Name"":""Ratatoskr"",""OnFreeRotation"":"""",""Pantheon"":""Norse"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.25,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" Great Jungler, High Mobility"",""Roles"":"" Assassin"",""Speed"":375,""Title"":""The Sly Messenger"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""12s"",""cost"":""50/55/60/65/70 "",""description"":""Ratatoskr dashes forward, damaging and slowing enemies for 3s. Dart pierces through minions and stops at the first god hit.\n\nAlso, Dart's cooldown is reduced by 1s for each enemy god hit by Flurry or Acorn Blast."",""menuitems"":[{""description"":""Ability:"",