10 (+70% of your physical power)""},{""description"":""Movement Speed:"",""value"":""50%""},{""description"":""Lifetime:"",""value"":"".75s""}],""secondaryDescription"":""""}},""Id"":11528,""Summary"":""Overhead kick"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/06/2065_11528.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""55/60/65/70/75"",""description"":""Ravana's fists fly forward, damaging and passing through minions and damaging and rooting the first god hit. Ravana heals for each enemy hit - with maximum damage sources of one god and up to three minions."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy God""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""45""}],""rankitems"":[{""description"":""Damage:"",""value"":""100/140/180/220/260 (+55% of your physical power)""},{""description"":""Root Duration:"",""value"":""1.25s""},{""description"":""Healing:"",""value"":""10/25/40/55/70""}],""secondaryDescription"":""""}},""Id"":11530,""Summary"":""10-Hand Shadow Fist"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/06/2065_11530.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90/85/80/75/70s"",""cost"":""80/90/100/110/120"",""description"":""Ravana leaps to a target location, damaging all enemies in the area and applying a debuff to enemy gods that increases the damage they take from all sources. After landing, Ravana receives a buff that reduces the damage he takes from all sources."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemy Gods""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Range:"",""value"":""55""},{""description"":""Damage:"",""value"":""200/275/350/425/500 (100% of your physical power)""},{""description"":""Damage Increase:"",""value"":""10%""},{""description"":""Damage Reduction:"",""value"":""40%""},{""description"":""Duration:"",""value"":""5s""}],""secondaryDescription"":""""}},""Id"":11639,""Summary"":""Mystic Rush"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/06/2065_11639.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Successful Basic Attacks and abilities against an Enemy add to Ravana's Combo Chain.  Each time his Chain reaches 8 he receives a Shield equal to 5% of his Maximum Health. This may stack up to 3 times.\r\n"",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Maximum Stacks:"",""value"":""3""}],""secondaryDescription"":""""}},""Id"":11532,""Summary"":""Chain of Blows"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/06/2065_11532.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.01,""Cons"":"""",""HP5PerLevel"":0.63,""Health"":470,""HealthPerFive"":7,""HealthPerLevel"":82,""Lore"":""Power does not come without sacrifice. The greater the sacrifice, the more immeasurable the power. Ravana, the Demon King of Lanka knew this. For years he worshipped, showing his devotion through isolation, prayer, and penance before the shrine of Shiva. Yet for years he was met with only silence. In his pursuit of immortality, he sacrificed his very life. He cut off his own head.\\n\\nAgony and pain met him as it regrew. He was greeted not by Death, but by rejection. Shiva the destroyer did not want him. Ravana was undaunted. Nine more times his head was offered, and on his tenth sacrifice, finally Shiva was sated.\\n\\nFor the Demon King, Shiva granted a boon. Instead of immortality, he gained invulnerability against those he viewed as threats: Gods and Demons. Ravana could not be destroyed.\\n\\nA master of combat, a genius scholar, a peerless leader, and now invincible, Ravana amassed an army of fiends and monsters to conquer the world. None could stop him. The Monkey King tried, but Ravana fought off his attacks. The Demon King’s armies conquered all, leaving Ravana to rule from a golden throne.\\n\\nVishnu, in his wisdom and grace, would not permit Ravana’s dominance. By Gods and Demons Ravana could not be harmed, but by mortals...\\n\\nThus was Vishnu reborn Rama, a mere man. Now trained as a warrior, Rama calls the Demon King to battle.\\n\\nPride scraping like a knee on stone, Ravana rallies his monstrous siblings, his conquered allies, and his formidable army to answer Rama’s taunt. And their rivalry will shake the world."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":230,""ManaPerFive"":4.8,""ManaPerLevel"":37,""Name"":""Ravana"",""OnFreeRotation"":"""",""Pantheon"":""Hindu"",""PhysicalPower"":35,""PhysicalPowerPerLevel"":2.0,""PhysicalProtection"":16,""PhysicalProtectionPerLevel"":2.9,""Pros"":"" High Single Target Damage, High Sustain"",""Roles"":"" Warrior"",""Speed"":375,""Title"":""Demon King of Lanka"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""9s"",""cost"":""30/38/45/53/60"",""description"":""Ravana throws a powerful punch, projecting his prana with it to damage and slow all enemies in front of him."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/135/190/245/300 (+80% of your physical power)""},{""description"":""Slow Percentage:"",""value"":""25%""},{""description"":""Slow Duration:"",""value"":""2.5s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""20/18/16/14/12s"",""cost"":""60/65/7