mite/wp-content/uploads/2015/05/1988_9663.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70/75/80/85/90"",""description"":""Passive: Scylla gains MP5.\n\nActive: Scylla summons a sentinel to the target area, granting vision of enemies for 5s. Scylla may activate the ability again within 5s to move to the sentinel location.\n\nAt max rank, the vision is granted through line of sight blockers, and placement range increases."",""menuitems"":[{""description"":""Ability:"",""value"":""Ward, Leap""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Passive MP5:"",""value"":""4/6/8/10/12""},{""description"":""Vision Range:"",""value"":""40/50/60/70/80""},{""description"":""Summon Range:"",""value"":""65/65/65/65/70""}],""secondaryDescription"":""""}},""Id"":9662,""Summary"":""Sentinel"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1988_9662.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Scylla reveals her true nature, becoming CC immune for the next 6s, and gaining movement speed. She may make one powerful attack during this time. If she kills an enemy god with the attack, she gains another 6s and may attack again.\n\nAt max rank, the movement speed bonus doubles."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""60""}],""rankitems"":[{""description"":""Damage per Hit:"",""value"":""400/500/600/700/800 (120% of your Magical Power)""},{""description"":""Movement Speed:"",""value"":""35/35/35/35/70%""}],""secondaryDescription"":""""}},""Id"":9682,""Summary"":""I'm a Monster"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1988_9682.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Each of Scylla's abilities gain an additional effect at max rank. In addition, Scylla gains 20 Magical Power for each max rank ability."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":9698,""Summary"":""Quick Learner"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1988_9698.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.008,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":365,""HealthPerFive"":6,""HealthPerLevel"":68,""Lore"":""Ancient poems warn of a narrow channel of water so treacherous that death touches all who approach. Sailors must choose to risk their ship, traveling close to the monstrous whirlpool Charybdis, or instead hug the rocky shoals where dwells a creature some say is made from the nightmares of all men.\\n\\nScylla, they call her, Horror of the Sea. No ship that dares sail in her waters goes unscathed. Those that cling to survival whisper panicked tales of enormous black tentacles tipped with slavering hound heads ravaging whole ships to splinters with pitiless precision. Though it’s her laughter, they say, that’s most horrible; child-like, delighting in blood soaked murder as men are dragged into the dark abyss.\\n\\nPoets have tried to romanticize this beast, to provide some humanity to her monstrosity. They write she was once a beautiful Naiad, wronged by a jealous priestess and transformed. Yet the old poems say she was born this way, beget by gods full of jealousy and loathing; dropped into the sea to terrorize mankind.\\n\\nWould that she had remained in the sea, but the nightmare has come ashore. Dragged by dog-headed tentacles she roams our streets, plucks us from our beds, and fills the night with disturbing laughter. Scylla has come, and not even the gods can help us."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":170,""MagicalPowerPerLevel"":7.25,""Mana"":298,""ManaPerFive