lue"":""34 + 1.45/Lvl (+20% of Magical Power)""},{""description"":""Progression:"",""value"":""None""}],""rankitems"":[],""secondaryDescription"":""""}},""godAbility1_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1988_9657.jpg"",""godAbility2_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1988_9663.jpg"",""godAbility3_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1988_9662.jpg"",""godAbility4_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1988_9682.jpg"",""godAbility5_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1988_9698.jpg"",""godCard_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/standardscylla_card.jpg"",""godIcon_URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1988.jpg"",""id"":1988,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Deathbane"",""Ability2"":""Cobra's Kiss"",""Ability3"":""Ambush"",""Ability4"":""Last Breath"",""Ability5"":""Catalyst"",""AbilityId1"":10187,""AbilityId2"":10213,""AbilityId3"":10215,""AbilityId4"":10223,""AbilityId5"":10185,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""60"",""description"":""Serqet dashes three times from side to side, dealing damage and applying Deathbane Poison to each enemy hit. This ability can Critical Hit, and Serqet is immune to Knockup while dashing.\n\nDeathbane Poison reduces a target's Physical Protection for a short time, after which it remains in a lingering dormant state for 20s."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Max Distance:"",""value"":""50""}],""rankitems"":[{""description"":""Damage:"",""value"":""60/80/100/120/140 (+45% of your Physical Power)""},{""description"":""Protection Reduction:"",""value"":""15% for 3s.""}],""secondaryDescription"":""""}},""Id"":10187,""Summary"":""Deathbane"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2005_10187.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""70/75/80/85/90"",""description"":""Serqet launches her two blades forward, dealing damage and applying the Cobra's Kiss Poison.\r\n\r\nCobra's Kiss Poison drives gods to madness, forcing them to attack nearby allies dealing this damage again, or walk harmlessly towards Serqet. After the madness, Cobra's Kiss remains in a lingering dormant state for 20s."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""40""}],""rankitems"":[{""description"":""Damage:"",""value"":""50/75/100/125/150 (+50% of your Physical power)""},{""description"":""Madness Duration:"",""value"":""1.0/1.1/1.2/1.3/1.4s""}],""secondaryDescription"":""""}},""Id"":10213,""Summary"":""Cobra's Kiss"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2005_10213.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""70"",""description"":""Serqet vanishes, Rooting herself in place. She may leap once, revealing herself and dealing damage to enemies. She will stay hidden until she leaps or cancels this ability. Enemy gods within range 12.5 will also reveal her."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/140/200/260/320 (+50% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":10215,""Summary"":""Ambush"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2005_10215.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Serqet leaps to an enemy, Stunning them, applying the Last Breath poison, then pushing them 30 units away.\n\nThe Last Breath poison deals damage to the target over the next 5s, and prevents them from healing. If an enemy dies while infected with Last Breath, they will explode, applying the poison to all enemies within 20 units."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""True""},{""description"":""Radius:"",""value"":""10""}],""rankitems"":[{""description"":""Damage:"",""value"":""210/330/450/570/690 True Damage over 5s""},{""description"":""Stun Duration:"",""value"":""1s""},{""description"":""Healing Reduction:"",""value"":""All Healing""}],""secondaryDescription"":""""}},""Id"":10223,""Summary"":""Last Breath"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2005_10223.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Serqet's Basic Attacks apply Catalyst, which consumes her lingering poisons. If the target is affected by two or three different poisons, they take additional damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""}],""rankitems"":[{""description"":""2 Poisons Consumed:"",""value"":""10% of target's maximum Health as Physical Damage.""},{""description"":""3 Poisons Consumed:"",""value"":""25% of target's maximum Health as Physical Damage.""}],""secondaryDescription"":""""}},""Id"":10185,""Summary"":""Catalyst"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/2005_10185.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.022,""Cons"":"""",""HP5PerLevel"":0.7,""Health"":400,""HealthPerFive"":9,""HealthPerLevel"":74,""Lore"":""It is with fear and trepidation that man walks carefully near the serpent and scorpion. Not that these creatures could overpower him with strength or guile, but the fierce venom they carry is deadlier than any blade or arrow. Yet, for all the dread they induce, they never strike randomly or in anger. Poison of any kind is controlled and administered only to those deserving of such punishment. Serqet, Goddess of Venom sees to this.\\n\\nThough crushing strangulation and pain await those touched by her sting, Serqet is not a deity of retribution but guardianship. The wakeless dead are embalmed and preserved for all time in fluids taken from Serqet's beasts. Of the four sacred Canopic Jars which hold the internal organs of the mummified, Serqet is the watcher of one. And, though her strikes mean certain death, Serqet can cleanse poison as easily as apply it.\\n\\nA battlefield is a strange place to find this Goddess. Normally, Serqet is an invisible presence. She watches. She waits. She learns before she strikes and ensures that those she kills deserve such an end. It must be that the vanity of the Gods has pushed Serqet too far. Now all will meet death with venom in their veins."",""MP5PerLevel"":0.29,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":240,""ManaPerFive"":4.3,""ManaPerLevel"":40,""Name"":""Serqet"",""OnFreeRotation"":"""",""Pantheon"":""Egyptian"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.25,""PhysicalProtection"":14,""PhysicalProtectionPerLevel"":2.9,""Pros"":"" High Single Target Damage, High Mobility"",""Roles"":"" Assassin"",""Speed"":370,""Title"":""Goddess of Venom"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""60"",""description"":""Serqet dashes three times from side to side, dealing damage and applying Deathbane Poison to each enemy hit. This ability can Critical Hit, and Serqet is immune to Knockup while dashing.\n\nDeathbane Poison reduces a target's Physical Protection for a short time, after which it remains in a lingering dormant state for 20s."",""menuitems"":[{""description"":""Abili