ains new skills as it ranks up. "",""menuitems"":[{""description"":""Ability:"",""value"":""Pet Command""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Basic Attack Damage:"",""value"":""40/50/60/70/80% of Skadi's Basic Attack Damage""},{""description"":""Rank 1:"",""value"":""isrank1/2/3/4/5/Kaldr gains a dash attack""},{""description"":""Rank 3:"",""value"":""isrank3/4/5/Kaldr's kills heal him""},{""description"":""Rank 5:"",""value"":""isrank5/Kaldr's basic attacks give Skadi 10% increased movement speed""}],""secondaryDescription"":""""}},""Id"":12017,""Summary"":""Rune of the Hunt"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/03/Icons_Skadi_A023.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""18s "",""cost"":""70/75/80/85/90 "",""description"":""Skadi freezes the ground for 5s at a target location. The icy area deals damage to enemies that touch it and continues to deal additional damage every .5s they stay on it. Gods who step on the ice are slowed and lose control of their movement while sliding across. Also, Skadi's movement speed increases by 40% while standing on the area and persists for 3s after it fades or she leaves."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Self and Enemies""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Initial Damage:"",""value"":""70/100/130/160/190 (/+60% of your physical power)""},{""description"":""Damage Per Tick"",""value"":""5/10/15/20/25 (/+5% of your physical power)""},{""description"":""Slow:"",""value"":""15%""},{""description"":""Radius:"",""value"":""16/18/20/22/24 ""}],""secondaryDescription"":""""}},""Id"":12018,""Summary"":""Permafrost"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/03/Icons_Skadi_A033.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s "",""cost"":""80/90/100/110/120 "",""description"":""Snowstorms surround Skadi and Kaldr. Upon activation, enemies in range become Rooted and Kaldr is restored to full health. The storms persist for 4s while dealing damage to enemies every .5s."",""menuitems"":[{""description"":""Ability:"",""value"":""Stim""},{""description"":""Affects:"",""value"":""Skadi and Kaldr""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage Per Tick:"",""value"":""10/20/30/40/50 (/+5% of your Physical Power)""},{""description"":""Root Duration"",""value"":""1/1.25/1.5/1.75/2s""}],""secondaryDescription"":""""}},""Id"":12019,""Summary"":""Winter's Grasp"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/03/Icons_Skadi_A044.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Kaldr fights by Skadi's side and has 2 forms: Beast and Elemental. While in Beast form he can attack enemies and be attacked. While Elemental he is immune to attacks and regenerates health over time. His forms can be controlled with Skadi's Rune of the Hunt but he will be forced into Elemental form if he loses all Hit Points."",""menuitems"":[{""description"":""Ability:"",""value"":""Summon Pet""},{""description"":""Hit Points:"",""value"":""5""},{""description"":""Attack Speed:"",""value"":""50% Of Skadi's""},{""description"":""Move Speed:"",""value"":""110% Of Skadi's""}],""rankitems"":[{""description"":""Lane Minion Damage:"",""value"":""1 HP lost per 5 hits""},{""description"":""Other Source Damage:"",""value"":""1 HP lost from any attack or ability""}],""secondaryDescription"":""""}},""Id"":12014,""Summary"":""Kaldr, The Winter Wolf"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/03/Icons_Skadi_Passive2.jpg""},""AttackSpeed"":0.9,""AttackSpeedPerLevel"":0.014,""Cons"":"""",""HP5PerLevel"":0.69,""Health"":470,""HealthPerFive"":8,""HealthPerLevel"":78,""Lore"":""Full of mirth rang the halls of Asgard. Celebrating, the Gods drank of mead and feasted on roasted beast while the corpse of their defeated foe, the Jotun Thjazi, lay cold nearby. For decades were they at odds. Now, that conflict was ended. Odin and his ilk openly boasted of their achievements, laughing and cheering while the floor ran wet with spilled spirits. \\n\\nThen, the doors swung wide, breathing icy winter wind across the hall. There she stood, spear in hand, skin, porcelain pale, clad in snow dusted furs, and eyes blue as glacier ice but smoldering with vengeful fire. Skadi, the Jotun’s daughter had come. \\n\\nTransfixed by her beauty, the gathered Gods sought to dissuade her from violence. As a symbol of honor, Odin cast the eyes of her father into the heavens to twinkle as stars for eternity. Skadi was not moved. A life for a life, she demanded. \\n\\nIt was Loki that softened her heart with humor and dance. So jovial was he that, at last, her frozen features cracked a smile. \\n\\nA wedding! Odin declared. Skadi would marry a God and so, herself become a Goddess. This would be her payment for the life of her father. Now warmed to them, Skadi agreed. Blindfolded, she was to choose her husband by only his feet. Eligible men came forth and Skadi made her choice. \\n\\nTheir marriage did not last. Niord was a God of Summer and Skadi a Goddess of Winter. After a few years, they amicably parted ways. Skadi returned to the snow-capped mountains of her youth, but without her father or husband, she soon grew lonely. Word spread of a war between the Pantheons. Odin and Loki, Niord and Ullr; these Gods were her family now, and Skadi would not lose the only family she had left."",""MP5PerLevel"":0.32,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":4.5,""ManaPerLevel"":35,""Name"":""Skadi"",""OnFreeRotation"":"""",""Panth