ing Reduction:"",""value"":""50%""},{""description"":""Healing Reduction Lifetime:"",""value"":""4s""},{""description"":""Heal:"",""value"":""20/30/40/50/60 (+10% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":7951,""Summary"":""Sickening Strike"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1747_7951.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""80/90/100/110/120"",""description"":""Sobek submerges himself, where he gains 30% protections, regenerates Mana, is immune to Crowd Control and he Slows all enemies. When Sobek emerges, he damages all enemies in the radius. Cancelling the ability decreases the damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""350/500/650/800/950 (+80% of your Magical Power)""},{""description"":""Submerge Slow:"",""value"":""20/25/30/35/40%""},{""description"":""Submerge Lifetime:"",""value"":""4s""},{""description"":""Submerge Mana Regen:"",""value"":""10% per second""}],""secondaryDescription"":""""}},""Id"":7947,""Summary"":""Lurking in the Waters"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1747_7947.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Sobek's Basic Attacks and abilities that hit an enemy grant him Protections for a short time."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Protections:"",""value"":""7""},{""description"":""Lifetime:"",""value"":""6s""},{""description"":""Max Stacks:"",""value"":""3""}],""secondaryDescription"":""""}},""Id"":7952,""Summary"":""Blessing of the Nile"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1747_7952.jpg""},""AttackSpeed"":0.85,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.75,""Health"":490,""HealthPerFive"":6,""HealthPerLevel"":81,""Lore"":""Hunter, guardian, destroyer, menace; the Crocodile God, Sobek, swims where the Nile takes him and owes allegiance to no one.\\n\\nSome say that Sobek was there when only the Dark Waters existed, so he helped create the world. Some say that Sobek made the Nile with his sweat and protects those that travel it if they pay him tribute, otherwise he destroys them. Some say that Sobek ushers the worthy dead down the Nile to the afterlife and aids in their rebirth, restoring sight and strength. Some say he is evil and hateful, ravaging those along the shores and terrorizing villages. Sobek, in truth, is all of these things and none.\\n\\nSobek is not a God of good or evil, of benevolence or malice, but a God of solitary neutrality, unless disturbed; a God that tends to his mighty river and performs his responsibilities to passing souls. The rest of the time, he does what he wishes. For his protection to the living and the dead, he is to be worshipped and respected. For his power, ferocity, and ruthlessness, he is to be rightfully feared."",""MP5PerLevel"":0.43,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.5,""Mana"":210,""ManaPerFive"":4.5,""ManaPerLevel"":35,""Name"":""Sobek"",""OnFreeRotation"":"""",""Pantheon"":""Egyptian"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":19,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Crowd Control, High Defense"",""Roles"":"" Guardian"",""Speed"":365,""Title"":""God of the Nile"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""70/75/80/85/90"",""description"":""Sobek charges forward at a frenzied pace. If Sobek hits an enemy, he does damage and throws the enemy behind himself. Sobek is immune to Knocku