+1% Magical Power and +1.2% Attack Speed for every 4% Heat. At 100% Heat, Sol's basic attacks gain +25% Damage. Heat decreases over time."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Basic Attack:"",""value"":""5% Heat""}],""secondaryDescription"":""""}},""Id"":11862,""Summary"":""Unstable Manifestation"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/09/Icons_Sol_Passive.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.018,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":400,""HealthPerFive"":6,""HealthPerLevel"":75,""Lore"":""Sol and her brother came into this world radiant, glorious beings. So enamored with them, their father arrogantly named each after a sacred heavenly body, he for the moon and she, the sun. As they grew, each child proved their namesake. Mani, of the moon, was contemplative, obedient, calm. Sol, conversely, became willful, spirited, passionate. His children were everything a father could dream, but Odin and his ilk were not pleased. For a father's hubris, Mani and Sol were punished.\\n\\nTo the sky, they were sent, each to lead the chariot that dragged the sun or the moon. At their heels were loosed the bloodthirsty sons of Fenrir. Hungry wolves, relentless in pursuit of their prey.\\n\\nResigned, Mani guided his steeds through the night, ever ahead of his hunter, but Sol did not accept her fate. Furious at the Gods, she taunts and challenges the wolf Skoll as she blazes across the sky, unleashing her spite on the only opponent she can reach.\\n\\nOdin has never shown signs of regret for his decision, but now war is upon the land. His attentions are turned. Sol, normally confined to her chariot has found a way to send her flaming essence to the battlefield. To the casual observer, the combat, the bloodshed, may all seem just a game to Sol, but she is driven by an age old grudge and a desire to be free."",""MP5PerLevel"