e may leap off before the duration expires, dealing damage. The decoy inherits a percentage of Sun Wukong's current strength and defense. The decoy is killed instantly if hit by a hard Crowd Control excluding Banishes and Knockbacks. If the decoy dies, Sun Wukong is revealed on his cloud."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Self and Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""25""}],""rankitems"":[{""description"":""Damage:"",""value"":""200/250/300/350/400 (+120% of your Physical Power)""},{""description"":""Healing:"",""value"":""5% per second""}],""secondaryDescription"":""""}},""Id"":9324,""Summary"":""Somersault Cloud"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1944_9324.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""When Sun Wukong is below 40% Health, he gains +10 Physical Power and +10 Protections, plus another 2 Physical Power and 1 Protection for his current level."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":9312,""Summary"":""Undefeated Body"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1944_9312.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.009,""Cons"":"""",""HP5PerLevel"":0.8,""Health"":470,""HealthPerFive"":8,""HealthPerLevel"":82,""Lore"":""Warrior, rebel, trickster, monk, Sun Wukong is known by many titles in the East, yet it was a Journey to the West that made him a hero.\\n\\nIn his youth, Sun Wukong gained leadership of the monkey tribes, learned secret arts and spells from a Taoist monk, and acquired the legendary Ruyi Jingu Bang from Ao Kuang, a staff that could change size according to his whim. He defied death itself by wiping his name from the Book of Life and Death, and united many of the other monster tribes who sought to ally with him, an act that garnered the attention of the Jade Emperor.\\n\\nIn an effort to better control the Monkey-King, the Jade Emperor awarded him a title, but when Sun Wukong discovered his new position was little more than “stable boy” he grew angry and declared himself “Great Sage, Equal of Heaven,” and waged war on the heavens. For this treasonous act, he was finally captured and imprisoned beneath a mountain for five centuries.\\n\\nAt long last, the humble monk Xuanzang was seeking disciples to protect him while on his legendary Journey to the West to collect the Indian Sutras. Sun Wukong gladly agreed to serve him, but the Buddha wrapped a golden circlet around the Monkey King’s head so that Xuanzang could control him. With three other disciples, they faced eighty one trials during their quest, and collected the sutras. For his service and strength, Sun Wukong was awarded Buddhahood, finally ascending to heaven and gaining immortality.\\n\\nWith an epic battle between Gods taking place, Sun Wukong’s presence is all but assured."",""MP5PerLevel"":0.38,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":205,""ManaPerFive"":4.3,""ManaPerLevel"":35,""Name"":""Sun Wukong"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.0,""PhysicalProtection"":18,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Defense, High Mobility"",""Roles"":"" Warrior"",""Speed"":375,""Title"":""the Monkey King"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""50/60/70/80/90"",""description"":""Sun Wukong's Magic Cudgel grows in length, and he slams it down, damaging all enemies in front of him. Minions and Jungle Camps take an extra +25% damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""}