/2015/05/19441.jpg"",""id"":1944,""latestGod"":""n"",""ret_msg"":null},{""Ability1"":""Storm Kata"",""Ability2"":""Wind Siphon"",""Ability3"":""Jet Stream"",""Ability4"":""Typhoon"",""Ability5"":""Gathering Storm"",""AbilityId1"":12813,""AbilityId2"":12797,""AbilityId3"":12869,""AbilityId4"":12801,""AbilityId5"":14767,""Ability_1"":{""Description"":{""itemDescription"":{""cooldown"":""16/15/14/13/12s"",""cost"":""60/65/70/75/80"",""description"":""Susano moves thrice in quick succession; after each attack he has up to 3s to fire the next one.\r\nFirst Attack: 100% Damage to all Enemies in a cone.\r\nSecond Attack: 100% Damage to all Enemies in a circle.\r\nThird Attack: 50% Damage while Dashing forward."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash Special""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""30""}],""rankitems"":[{""description"":""Damage per Hit:"",""value"":""40/65/90/115/140 (/+55% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":12813,""Summary"":""Storm Kata"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/05/Icons_Susano_A01-1.png""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""80/75/70/65/60"",""description"":""Susano commands the winds to blow, dealing damage in a cone in front of him.\r\nEnemies in the center of the attack are pulled towards him."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""35""}],""rankitems"":[{""description"":""Damage:"",""value"":""60/75/90/105/120 (60% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":12797,""Summary"":""Wind Siphon"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/05/Icons_Susano_A02-1.png""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""16s"",""cost"":""45/50/55/60/65"",""description"":""Susano throws forward a gust of air which creates a whirlwind, dealing damage every .75s for 3s.\r\nHe may activate this ability again to teleport to the whirlwind.\r\nIf the initial gust hits an Enemy, the whirlwind surrounds and travels with them, and teleporting to the Enemy reduces this cooldown to 8s."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile Special""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""45""}],""rankitems"":[{""description"":""Damage per Tick:"",""value"":""20/30/40/50/60 (30% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":12869,""Summary"":""Jet Stream"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/05/Icons_Susano_A03-1.png""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""100s"",""cost"":""80/85/90/95/100"",""description"":""Susano summons a hurricane at his location that pulls Enemies towards the center while growing to up to twice its size, increasing the damage as it grows. Upon reaching full size, the storm is launched in the direction he is facing, knocking up opponents in its path. Susano may re-activate this ability early to fire the storm at it's current size for reduced damage. If fired at less than half of its maximum size, he also foregoes the knock-up."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""70""}],""rankitems"":[{""description"":""Max Damage:"",""value"":""215/280/345/410/475 (+140% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":12801,""Summary"":""Typhoon"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/05/Icons_Susano_A04-1.png""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Each time Susano successfully deals damage to at least one enemy god with an ability he gains a stack. At 4 stacks, his next ability that hits an enemy god will deal bonus damage. Stacks last for 5 seconds."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Bonus Damage:"",""value"":""25 (/+60% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":14767,""Summary"":""Gathering Storm"",""URL"":""""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.022,""Cons"":"""",""HP5PerLevel"":0.7,""Health"":435,""HealthPerFive"":9,""HealthPerLevel"":76,""Lore"":""Like his sister, Amaterasu, Susano was born to rule, but he was tempestuous, with a flaring anger, wicked tongue, and a penchant for destruction. Their father, Izanagi, would have none of it and decreed that Susano live in the Underworld. His mood dark at this news, Susano committed heinous acts of vandalism and murder. Acts that sent Amaterasu into shameful hiding.\\n\\nCast low, Susano descended to earth on his way to the Underworld. He carried only his Ten-Span Sword, and regret for his actions. What had his defilements achieved but to envelop the world in darkness? This was his nature, to broil like a storm, to frighten and destroy what stood in his path.\\n\\nBut a storm could also herald life.\\n\\nAt a river side, Susano ventured upon an elderly couple, weeping and cradling their young daughter. Eight children, they’d had once, but now only one remained; seven devoured by the eight-headed serpent. Susano was resolved. To atone for his crimes, to prove his father wrong, to better himself, Susano would slay this beast.\\n\\nEight traps he laid, one for each head of the creature, with eight tubs of aromatic saké as bait. Slithering forward, the Orochi spread its gruesome heads to drink from the trapped tubs. Susano cut the rope. Gates dropped. The heads were imprisoned. One by one, he chopped the eight necks, until only the wriggling tail remained. Sweeping his blade split the reptilian hide, leaving notches in his blade but revealing a brilliant sword inside: the Kusanagi-no-Tsurugi.\\n\\nTo his sister, he gave the blade. An act of atonement, but not an apology. His true nature would never change, but his intention could.\\n\\nThough seen on the battlefield of the Gods, Susano’s fight is not truly against those foes, but within himself. He is a raging summer storm, struggling to focus that destructive power at evil, and atoning when the innocent are harmed."",""MP5PerLevel"":0.27,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":225,""ManaPerFive"":4.2,""ManaPerLevel"":38,""Name"":""Susano"",""OnFreeRotation"":"""",""Pantheon"":""Japanese"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.2,""PhysicalProtection"":14,""PhysicalProtectionPerLevel"":2.9,""Pros"":"" High Crowd Control, High Mobility"",""Roles"":"" Assassin"",""Speed"":365,""Title"":""God of the Summer Storm"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""16/15/14/13/12s"",""cost"":""60/65/70/75/80"",""description"":""Susano moves thrice in quick succession; after each attack he has up to 3s to fire the next one.\r\nFirst Attack: 100% Damage to all Enemies in a cone.\r\nSecond Attack: 100% Damage to all Enemies in a circle.\r\nThird Attack: 50% Damage while Dashing forward."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash Special""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Range:"",""value"":""30""}],""rankitems"":[{""description"":""Damage per Hit:"",""value"":""40/65/90/115/140 (/+55% of your Physical Power)""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""8