cription"":{""itemDescription"":{""cooldown"":""110s"",""cost"":""90"",""description"":""Terra channels her strength into the entire world, buffing all of her allies for 10s. While active, Terra and her allies gain increased Movement Speed, reduction of Mana costs for abilities, and increased Cooldown Reduction.\n\nTerra also summons 4 stones around herself and each of her teammates. If any one of them take damage from enemy gods 4 times the stones will activate and heal them."",""menuitems"":[{""description"":""Ability:"",""value"":""Global Buff""},{""description"":""Affects:"",""value"":""Allies""}],""rankitems"":[{""description"":""Movement Speed:"",""value"":""20%""},{""description"":""Mana Cost Reduction:"",""value"":""100% Reduced Mana Costs""},{""description"":""CDR:"",""value"":""20/25/30/35/40%""},{""description"":""Heal:"",""value"":""100/150/200/250/300 (+30% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":13164,""Summary"":""Terra's Blessing"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/08/Icons_Terra_A04-2.png""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Terra's abilities create Standing Stones. As long as any Standing Stones are on the battleground Terra becomes Knockup immune and her Basic Attacks will Slow enemies and deal bonus damage. If Terra Shatters any stones she will retain this buff for an additional 3s after all of the stones are gone."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self / Enemies""}],""rankitems"":[{""description"":""Slow:"",""value"":""30% for 1.25s""},{""description"":""Bonus Damage:"",""value"":""7 (+10% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":13149,""Summary"":""Standing Stones"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/07/Icons_Terra_Passive.jpg""},""AttackSpeed"":0.9,""AttackSpeedPerLevel"":0.013,""Cons"":"""",""HP5PerLevel"":0.8,""Health"":500,""HealthPerFive"":8,""HealthPerLevel"":95,""Lore"":""Terra Mater, quite literally the mother Earth, rests dormant beneath every living thing. Upon her flesh, trees stand like hairs, rivers weave like veins, and oceans lap against her sides. Long has she slept; since her son, the Titan Saturn, was cast down by his own son. It had all gone so wrong.\\n\\nAt the forging of creation, Terra was split from all other primordial matter to form the earth. Above her, Uranus, the sky, suspended angelically. She loved him immediately and made him her king. Their children were Titans, beings even more powerful than they. In his fear and jealousy, Uranus buried the Titans within the earth. Terra began to see the arrogance, the vanity, the hatred in her husband. Conspiring with her children, she freed them and overthrew Uranus.\\n\\nYoungest of the Titans, Saturn, ruled next. Terra could not have been more proud, but prophecies claimed Saturn would be defeated by his children, just as Uranus had. To prevent this, Saturn consumed his offspring. All but one. Jupiter escaped, and with righteous fury split Saturn open, unleashing his swallowed siblings. Violently, they defeated the Titans, Terra’s children, and claimed the world as their own.\\n\\nMournful of the children she lost, Terra slept. And ages passed.\\n\\nBut the ravages of a new war have scarred her skin. Her grandchildren, those arrogant, vain, treacherous Gods that stole the world from her son, those Gods, so reminiscent of Uranus, bleed into her bones with every battle. Now, she finally rises from her slumber. She rises to claim the throne for herself."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.75,""Mana"":200,""ManaPerFive"":4.6,""ManaPerLevel"":35,""Name"":""Terra"",""OnFreeRotation"":"""",""Pantheon"":""Roman"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":20,""PhysicalProtecti