ral energy. The monolith heals nearby allied gods every .5s for the duration but can be destroyed early if hit by 3 enemy basic attacks.\r\n\r\nTerra can Shatter this stone with Force of Nature to Root enemies in the area for 1s and create a damaging area that lasts 5s. "",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Allies / Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Monolith Duration:"",""value"":""10s""},{""description"":""Heal Per Tick:"",""value"":""3/6/9/12/15 (/+5% of your Magical Power)""},{""description"":""Shatter Damage:"",""value"":""70/100/130/170/200 (+50% of your Magical Power)""},{""description"":""Damage Per Tick"",""value"":""10/12/14/16/18 (+5% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription4"":{""itemDescription"":{""cooldown"":""110s"",""cost"":""90"",""description"":""Terra channels her strength into the entire world, buffing all of her allies for 10s. While active, Terra and her allies gain increased Movement Speed, reduction of Mana costs for abilities, and increased Cooldown Reduction.\n\nTerra also summons 4 stones around herself and each of her teammates. If any one of them take damage from enemy gods 4 times the stones will activate and heal them."",""menuitems"":[{""description"":""Ability:"",""value"":""Global Buff""},{""description"":""Affects:"",""value"":""Allies""}],""rankitems"":[{""description"":""Movement Speed:"",""value"":""20%""},{""description"":""Mana Cost Reduction:"",""value"":""100% Reduced Mana Costs""},{""description"":""CDR:"",""value"":""20/25/30/35/40%""},{""description"":""Heal:"",""value"":""100/150/200/250/300 (+30% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription5"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Terra's abilities create Standing Stones. As 