/55/65"",""description"":""Thanatos flings his scythe at an enemy, dealing damage and an additional 10% of the target's maximum Health against enemy gods. Enemies hit are slowed for 3s and heal Thanatos based on damage dealt. Consumes 5% of Thanatos' current HP when used."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""100/170/240/310/380 (+60% of your Physical Power)""},{""description"":""Bonus Damage (Gods):"",""value"":""10% of max HP""},{""description"":""Healing:"",""value"":""75% of damage dealt""},{""description"":""Slow:"",""value"":""20%""}],""secondaryDescription"":""""}},""Id"":9299,""Summary"":""Death Scythe"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1943_9299.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""13s"",""cost"":""20/25/30/35/40"",""description"":""Thanatos senses death, gaining immunity to Slow effects and additional move speed and Physical Penetration for 6s. His speed bonus increases up to double when moving toward an enemy god within the instant kill Health threshold of his Ultimate. Consumes 5% of Thanatos' current HP when used."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Penetration:"",""value"":""15/20/25/30/35""},{""description"":""Move Speed:"",""value"":""10/15/20/25/30%""},{""description"":""Bonus Speed (Low Health):"",""value"":""10/15/20/25/30%""}],""secondaryDescription"":""""}},""Id"":9304,""Summary"":""Scent of Death"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1943_9304.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""25/30/35/40/45"",""description"":""Thanatos swings his scythe, dealing Physical damage and Silencing enemies he hits. Thanatos moves at a reduced rate while swinging. Consumes 5% of Thanatos' current HP when used."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""100/150/200/250/300 (+70% of your Physical Power)""},{""description"":""Silence Duration:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":9228,""Summary"":""Soul Reap"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1943_9228.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""40/50/60/70/80"",""description"":""Thanatos flaps his wings and ascends for 5s, unable to be hit. While airborne, he moves unimpeded at an increased speed before diving to his target location, dealing damage. Enemies below a Health threshold are instantly killed. All others are Stunned. Consumes 10% of Thanatos' current HP when used."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/125/160/195/230 (+80% of your Physical Power)""},{""description"":""Kill HP Threshold:"",""value"":""24/28/32/36/40%""},{""description"":""Stun Duration:"",""value"":""1s""},{""description"":""Bonus Move Speed:"",""value"":""150%""}],""secondaryDescription"":""""}},""Id"":9272,""Summary"":""Hovering Death"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1943_9272.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Enemy gods within his ultimate's execute Health threshold are revealed to Thanatos. Dealing the killing blow to enemies also empowers Thanatos, healing him based on the max HP of his target and reducing his active cooldowns. Additionally, all of Thanatos' abilities cost Health and Mana to use."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""HP Restore (Gods):"",""value"":""20% of target's max HP""},{""description"":""HP Restore (Minions):"",""value"":""10% of target's max HP""},{""description"":""Cooldown Reduction (Gods):"",""value"":""5s""}],""secondaryDescription"":""""}},""Id"":9239,""Summary"":""Harvester of Souls"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1943_9239.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.017,""Cons"":"""",""HP5PerLevel"":0.67,""Health"":390,""HealthPerFive"":8,""HealthPerLevel"":75,""Lore"":""Inevitably, all mortals must die. They cling to life with fevered desperation, for death is a cold unknown, filled with uncertainty and bleak, everlasting finality. Some accept fate with grace, others are dragged, kicking and screaming, though in truth, no mortal would go to Hades willingly. They are reaped by the nightmarish God of Death, whose grim visage strikes strange against the gleeful satisfaction he feels at performing his work. Thanatos is the very face of death.\\n\\nYet, to Thanatos, Mortals are easy prey. Their end is preordained, harvesting them but a game to pass the eons, but a God, a being beyond the mortal coil, now there is a creature Thanatos eyes with greedy longing. He despises the immortality other Gods covet. To him, it is a perversion and defiance of his very purpose.\\n\\nBut can a God truly die? As the Heavens clash and immortal blood spills on the Earth, Thanatos hungers to find out. War is but the preamble to death, a battlefield of souls rent from their bodies, listlessly waiting to be taken by the God of Death. A war between Gods, a war of this magnitude can mean only one thing. Thanatos is about to be very, very busy."",""MP5PerLevel"":0.38,""MagicProtection"":30,""MagicProtecti