 any damage. If The Morrigan attacks or takes damage, she will be revealed and lose her increased Movement Speed."",""menuitems"":[{""description"":""Ability:"",""value"":""Stealth""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Range:"",""value"":""80""}],""rankitems"":[{""description"":""Duration:"",""value"":""4/4.5/5/5.5/6s ""},{""description"":""Movement Speed:"",""value"":""20/25/30/35/40%""}],""secondaryDescription"":""""}},""Id"":14001,""Summary"":""Confusion"",""URL"":""""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""160/140/120/100/80s"",""cost"":""100"",""description"":""The Morrigan selects a God from the current match and becomes a copy of them and cleanse herself of all effects. She copies all of their current stats and may use all of their abilities for the duration. She retains her own Relics and cannot use Consumables.\n\nThe Rank of her abilities will transfer to the skills of the god she copies. This ability's cooldown will be increased to match the target God's ultimate ability cooldown. You may hover over a target and cancel to pre-select them, so you do not need to use the cursor on activation. "",""menuitems"":[{""description"":""Ability:"",""value"":""Transform""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Duration:"",""value"":""10s""}],""secondaryDescription"":""""}},""Id"":13690,""Summary"":""Changeling"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/12/0404SLKJDF345ujoljflkd.png""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""The 3rd hit of The Morrigan’s hit chain will explode, dealing damage to all enemies within range and Dooming all enemies hit. Doomed Enemies will take additional Basic Attack damage over time."",""menuitems"":[{""description"":""Ability:"",""value"":""Basic Attack Stim""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""10""}],""rankitems"":[{""description"":""Damage:"",""value"":""9% of the target's Max HP""},{""description"":""Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":14144,""Summary"":""Doomsayer"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2016/12/psvLKSJRFfskj3245.png""},""AttackSpeed"":0.87,""AttackSpeedPerLevel"":0.009,""Cons"":"""",""HP5PerLevel"":0.7,""Health"":400,""HealthPerFive"":10,""HealthPerLevel"":75,""Lore"":""Fate is an unusual thing. An unseen force predicting every action of every being. Some deities can see it, recognizing the flow of the plan. There are none, save one, that claims mastery over it, that manipulates it with such cold intent, that steers it ever toward war and the red demise of heroes. In truth, she is many Goddesses, with many names and many forms. But there is only one title. The Morrigan\\n\\nAnu, Macha, Badb. Individually, these three Goddesses were sisters, progenitors of sovereignty, war, and death. They were caretakers of their lush green Éire, champions for armored soldiers, guides for the deceased. It is unknown what bound them together. Some whispered curse, some lover’s scorn. Some dark power or darker purposes.  But now they are one.\\n\\nShe’s been seen in many shapes. The lurid seductress, the wrinkled hag, the screaming crow, and worst of all, the washer in the river. For those who witness her cleaning their bloody armor prophecies a violent end.\\n\\nSubtle and manipulative, there is no war The Morrigan did not incite. No dying breath she did not collect. Even this war, a war between Gods, must secretly be of her making. So, beware those that behold her, for The Morrigan controls your fate."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":170,""MagicalPowerPerLevel"":12.0,""Mana"":250,""ManaPerFive"":4.5,""ManaPerLevel"":38,""Name"":""The Morrigan"",""OnFreeRotation"":"""",""Panthe