"":""Affects:"",""value"":""Thoth and Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/110/150/190/230 (+60% of your Magical Power)""},{""description"":""Stun Duration:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":13740,""Summary"":""Evade and Punish"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/Icons_Thoth_A02.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""5s"",""cost"":""25/30/35/40/45"",""description"":""From his book, Thoth conjures forth a Hieroglyph in front of him. Thoth's ability projectiles passing through the glyph receive increased damage, and a range increase of 30.\r\n\r\nThoth and allies' Basic Attack projectiles receive a reduced damage bonus, but no range increase."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Self and Allies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""55""}],""rankitems"":[{""description"":""Ability Bonus Damage:"",""value"":""15/25/35/45/55 (+10% of your Magical Power)""},{""description"":""Basic Attack Damage:"",""value"":""10/15/20/25/30 (+10% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":13566,""Summary"":""Glyph of Pain"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/Icons_Thoth_A03.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Thoth conjures a large glyph from his book, and then inscribes three more at it's corners. When all four have been summoned, he sends them forward damaging all Enemies in their path.\n\nThoth may activate this ability again to fire the ability early, doing a reduced amount of damage based on the number of glyphs currently summoned. Alternately he may cancel this ability at a cost of 30 mana."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Range:"",""value"":""100""}],""rankitems"":[{""description"":""Damage:"",""value"":""360/430/500/570/640 (+120% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":13575,""Summary"":""Final Judgement"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/Icons_Thoth_A04.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Thoth pens the names of his fallen opponents in his book, recording their weaknesses. After killing 30 Enemies, Thoth gains a stack of 4 Magical Penetration, and killing an Enemy God will complete the current stack. He unlocks a new stack every 4 levels, up to a maximum of 5 stacks at level 17."",""menuitems"":[{""description"":""Level 1:"",""value"":""Max 1 Stack""},{""description"":""Level 5:"",""value"":""Max 2 Stacks""},{""description"":""Level 9:"",""value"":""Max 3 Stacks""},{""description"":""Level 13:"",""value"":""Max 4 Stacks""}],""rankitems"":[{""description"":""Kills for One Stack:"",""value"":""30""},{""description"":""Penetration:"",""value"":""4 per Stack""},{""description"":""Max Penetration:"",""value"":""20 at 5 Stacks""}],""secondaryDescription"":""""}},""Id"":13763,""Summary"":""Dead Reckoning"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2016/11/Icons_Thoth_Passive.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.012,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":365,""HealthPerFive"":6,""HealthPerLevel"":75,""Lore"":""Legends tell of a tome of magic, wherein all the secrets of the world can be found, where the spells to change the fabric of reality are written, and where the knowledge to master death is inscribed. The legends understate reality. So powerful is this book that the mere flipping of pages sets Gods on edge.\\n\\nThis lexicon of legerdemain was no product of happenstance. Every incantation, every inflection was carefully crafted by a God beyond comprehension, of wisdom so transcendent, he willed himself into being. He is Thoth, the Scribe of Secrets.\\n\\nThree great battles there have been, and at each, Thoth was present, aiding the forces of order to triumph over chaos. When Ra faced the world serpent Apep for the final time, Thoth’s spells shielded Ra against the reptile. When Osiris was dismembered by his brother Set, Thoth taught Isis the incantations to reassemble him. And when Horus, the child of Isis and Osiris, battled Set once again for control of the Kingdom, Thoth’s rituals cleansed the young man of Set’s vilest poisons.\\n\\nAll of the secrets, the power, the wisdom of the universe, Thoth has placed into this book. He is the guardian of this knowledge, invoking it only to save the world, to keep it from descending into disorder.\\n\\nBut now, the world is falling into chaos. God battles God. The heavens quake, the earth shudders, the seas boil, and mortals cry out. If ever there was a time for Thoth to break the binding of his book, it is now. This world is unprepared for the secrets he will reveal."",""MP5PerLevel"":0.44,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":160,""MagicalPowerPerLevel"":7.5,""Mana"":245,""ManaPerFive"":4.6,""ManaPerLevel"":49,""Name"":""Thoth"",""OnFreeRotation"":"""",""Pantheon"":""Egyptian"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":9,""PhysicalProtectionPerLevel"":2.6,""Pros"":"" High Area Damage"",""Roles"":"" Mage"",""Speed"":355,""Title"":""Arbiter of the Damned"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""8s"",""cost"":""60/65/70/75/80"",""description"":""Thoth conjures three Hieroglyphs around him, ignoring the Basic Attack Movement penalty. His next 3 Basic Attacks pass through Enemies and apply Ability Damage instead.\n\nIf these attacks pa