004,""Summary"":""Fearless"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1924_9004.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""12/11/10/9/8s"",""cost"":""50"",""description"":""Tyr makes a massive melee attack, hitting all enemies within a 180 degree cone.\n\nAssault Stance: Enemies that are knocked up in the air are knocked away.\n\nGuard Stance: Tyr heals himself for each enemy hit (max 3)."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Cone:"",""value"":""180""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/115/150/185/220 (+65% of your Physical Power)""},{""description"":""Healing:"",""value"":""25/45/65/85/105""}],""secondaryDescription"":""""}},""Id"":9013,""Summary"":""Power Cleave"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1924_9013.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""14/13/12/11/10s"",""cost"":"""",""description"":""Tyr changes between Assault and Guard stances. Changing stances refreshes the cooldown on Fearless and Power Cleave.\n\nAssault Stance: Gain Physical Power.\n\nGuard Stance: Gain Protections."",""menuitems"":[{""description"":""Ability:"",""value"":""Stance Change""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Assault Stance:"",""value"":""10/20/30/40/50 Physical Power""},{""description"":""Defense Stance:"",""value"":""10/20/30/40/50 Protections""}],""secondaryDescription"":""""}},""Id"":9025,""Summary"":""Change Stance"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1924_9025.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90/85/80/75/70s"",""cost"":""80/90/100/110/120"",""description"":""Tyr leaps through the air, bringing indiscriminate justice upon all enemies in the target area, and Slowing them."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""25""}],""rankitems"":[{""description"":""Damage:"",""value"":""150/225/300/375/450 (+120% of your Physical Power)""},{""description"":""Slow:"",""value"":""25%""},{""description"":""Slow Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":9173,""Summary"":""Lawbringer"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1924_9173.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":"" Stuns, Taunts, Fears, Intoxicate, and Mesmerize cannot affect Tyr for longer than 1s."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[],""secondaryDescription"":""""}},""Id"":9032,""Summary"":""Unyielding"",""URL"":""https://web2.hirez.com/smite//wp-content/uploads/2015/05/1924_9032.jpg""},""AttackSpeed"":1.0,""AttackSpeedPerLevel"":0.009,""Cons"":"""",""HP5PerLevel"":0.72,""Health"":475,""HealthPerFive"":8,""HealthPerLevel"":80,""Lore"":""Tyr. The embodiment of mankind’s impossible ideals. Man is a malleable creature, but a God is stone, shaped only by the harsh weather of expectation. And none have a greater burden of expectation than Tyr, for he is Courage. He is Honor. He is Justice.\\n\\nCourage is not the absence of fear, but the will to face the frightening.\\n\\nFenrir, the mighty wolf, was foretold to wreak such devastation on the Gods that they sought to bind him. Tyr, clothed in courage, brought the beast to their prison, where the Gods prepared shackles.\\n\\nHonor is not a stubborn oath, but the integrity to uphold what is right, even when it is not easy.\\n\\nUnder the guise of a test of strength, twice the Gods bound Fenrir, and twice he broke free. On the third attempt, Fenrir sensed a trick and demanded one of the Gods place their hand into his mouth. If the binding proved magical, Fenrir would take the hand. Tyr agreed.\\n\\nJustice is not adherence to the law, but a code of fairness and morality.\\n\\nBound by the mystical ribbon, Fenrir devoured Tyr’s hand. It was the price to be paid. And Tyr paid it willingly. Even Fenrir deserved justice.\\n\\nOne handed, Tyr is worshipped as a pinnacle of righteousness, called upon for valor in battle, balance in law, and the fortitude to face the impossible. As the cloud of war blackens the world, and fear grips the people, Tyr is stooped by the weight of expectation. With blade in hand, he takes the field. For he is Courage. He is Honor. He is Justice."",""MP5PerLevel"":0.29,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":230,""ManaPerFive"":4.4,""ManaPerLevel"":40,""Name"":""Tyr"",""OnFreeRotation"":"""",""Pantheon"":""Norse"",""PhysicalPower"":39,""PhysicalPowerPerLevel"":2.0,""PhysicalProtection"":15,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Defense, Medium Crowd Control"",""Roles"":"" Warrior"",""Speed"":375,""Title"":""the Lawgiver"",""Type"":"" Melee, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""60/65/70/75/80"",""description"":""Tyr charges forward, immune to Knockup, damaging enemies.\n\nAssault Stance: Tyr pushes all enemies along with him, hitting them 2 times and knocking them up in the air.\n\nGuard Stance: Tyr hits each enemy only once, passing through them."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""12""}],""rankitems"":[{""description"":""Damage:"",""value"":""40/90/140/190/240 (+50% of your Physical Power)""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldow