ur Physical Power)""}],""secondaryDescription"":""""}},""Id"":9893,""Summary"":""Hail of Arrows (Glory Bound)"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1991_9893.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""1s"",""cost"":""0"",""description"":""Ullr changes stance.\n\nRanged: Ullr uses his yew bow, removing Disarms and gaining additional attack speed.\n\nMelee: Ullr uses his axes, removing Disarms and gaining additional Physical Lifesteal."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Attack Speed (Bow):"",""value"":""5/10/15/20/25%""},{""description"":""Physical Lifesteal (Axe):"",""value"":""5/10/15/20/25%""}],""secondaryDescription"":""""}},""Id"":9915,""Summary"":""Wield Axes (Wield Bow)"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1991_9915.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""When Ullr uses an ability in either stance his Cooldowns in the opposite stance are reduced."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Cooldown Reduction:"",""value"":""1s""}],""secondaryDescription"":""""}},""Id"":9800,""Summary"":""Weapon Master"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1991_9800.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.014,""Cons"":"""",""HP5PerLevel"":0.71,""Health"":480,""HealthPerFive"":8,""HealthPerLevel"":80,""Lore"":""Amongst the snow-capped forests of the frigid north resides the hunter-God of Glory, Ullr. Reserved, secretive, Ullr does not represent the tankard downing, boast bellowing contemporaries of the Norse Pantheon, but pays respectful tribute to glory in all its forms.\\n\\nGlory is in the silence of snowfall, in the honorable victory earned from single combat, in the perfect curve of a yew bow firing an arrow true. Dotted across the lands of the Faithful, shrines to Ullr can be found in remote, secluded hideaways. It is there that glory is found in the sanctity of a vow, once sworn, never broken, and bound by a ring, no matter how crude, then buried in the earth to weather the ages of time.\\n\\nThough rarely spoken of, he is highly regarded, even among the Gods, for it is Ullr, not one of Odin’s sons that tends the throne of Asgard while the All Father is away. Other Gods might use the opportunity to abuse the power, but Ullr’s rule is merely an extension thereof. So much so that only the innermost circle even know that Odin is gone.\\n\\nAll the more noticeable is it, then, that Ullr has abandoned this post to join the fray. Early on did Odin take the field of battle, leaving Ullr to manage the kingdom. So great a threat must this war be as to endanger the very survival of Asgard. Whatever the reason, Ullr comes to preserve glory, which, for him, may be the whole world."",""MP5PerLevel"":0.38,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":230,""ManaPerFive"":4.4,""ManaPerLevel"":40,""Name"":""Ullr"",""OnFreeRotation"":"""",""Pantheon"":""Norse"",""PhysicalPower"":38,""PhysicalPowerPerLevel"":2.4,""PhysicalProtection"":13,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Sustain"",""Roles"":"" Hunter"",""Speed"":360,""Title"":""The Glorious One"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""50"",""description"":""Ranged: Ullr fires a bladed arrow in a line, dealing damage and passing through all targets it hits.\r\n\r\nMelee: Ullr throws an axe in a line, hitting a single target dealing damage and Stunning it."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""ran