n front of him and sprints forward, doing damage to all enemies and knocking them into the air."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/110/150/190/230 (+60% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":7719,""Summary"":""Clear the Path"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1723_7719.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""15/14/13/12/11s"",""cost"":""60/70/80/90/100"",""description"":""Vamana infuses his umbrella with his armor, reinforcing it while he strikes forth, doing damage to all enemies in a cone."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""85/140/195/250/305 (+70% of your Physical Power)""}],""secondaryDescription"":""""}},""Id"":7721,""Summary"":""Armored Umbrella"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1723_7721.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""13s"",""cost"":""60/70/80/90/100"",""description"":""Vamana spins an umbrella out in front of him, hitting everyone in its path for damage and slowing your enemies' attack and movement speeds.  After reaching its destination, the umbrella returns back to Vamana, hitting everyone in its path again."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""50/85/120/155/190 (+50% of your Physical Power)""},{""description"":""Attack / Movement Speed Slow:"",""value"":""30%""},{""description"":""Speed Slow Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":7722,""Summary"":""Umbrellarang"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1723_7722.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Vamana grows to an enormous giant. While Vamana is enraged, he is immune to Crowd Control, gains Protections, Physical Power, massive regeneration and his Basic Attacks now damage all nearby enemies. When Vamana is in Colossal form, taking damage from gods increases the duration. \r\nYou may cancel his giant form early."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""16""}],""rankitems"":[{""description"":""Protections:"",""value"":""5/10/15/20/25""},{""description"":""Physical Power:"",""value"":""40/55/70/85/100""},{""description"":""Health Regeneration:"",""value"":""5% per second""},{""description"":""Colossal Duration:"",""value"":""6s ""},{""description"":""Colossal Duration Increase:"",""value"":"" .5s per hit/ up to 10s.""}],""secondaryDescription"":""""}},""Id"":7723,""Summary"":""Colossal Fury"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1723_7723.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""A percentage of Vamana's Physical Protection is converted to Physical Power."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Physical Protection Conversion:"",""value"":""20%""}],""secondaryDescription"":""""}},""Id"":7746,""Summary"":""Sleeping Giant"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1723_7746.jpg""},""AttackSpeed"":0.9,""AttackSpeedPerLevel"":0.013,""Cons"":"""",""HP5PerLevel"":0.5,""Health"":480,""HealthPerFive"":8,""HealthPerLevel"":85,""Lore"":""Though small of stature, Vamana, the Fifth Avatar of Vishnu, should never be underestimated. His harsh lessons in humility have shamed even the proudest of kings.\\n\\nThe demon king, Bali, was fair and righteous, yet for all his virtues, Bali was extremely proud and driven by fierce ambition. After conquering the Underworld and all the Earth, Bali managed to wrest the Heavens from the God Indra. Unable to reclaim his seat, Indra implored Vishnu for aid, and so Vishnu took the form of a small mortal man, a priest named Vamana.\\n\\nIn his splendid palace, Bali was giving gifts to the pious. Vishnu, disguised as the monk Vamana and carrying a wooden umbrella, requested only as much land as he could cover in three steps. Bali offered Vamana an island but Vamana stuck to his request, which Bali granted against the wishes of his advisor. Immediately, Vamana grew to cosmic proportions, crashing through the ceiling of the palace and filling the sky. With one colossal step, he engulfed all the Earth and the Underworld. With a second step, he consumed the heavens. Now, with everything under his two units, Vamana had nowhere to place his third step. He challenged Bali to go back on his word or offer somewhere else for him to step. Bali’s demon army surged forth, but the demon king held them back. Bowing in humility, Bali offered his head as the third step. Vamana sends Bali to the underworld but, in recognizing Bali’s benevolence, shows mercy by granting him sovereignty over it in appreciation of Bali’s sacrifice.\\n\\nVishnu returned control of the Heavens to Indra and left his Avatar behind, but he also left behind a valuable lesson. Even the mightiest and most arrogant of kings can be humbled by the smallest of men."",""MP5PerLevel"":0.41,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":200,""ManaPerFive"":4.7,""ManaPerLevel"":39,""Name"":""Vamana"",""OnFreeRotation"":""""