t every second. The Inferno Cannon lasts until destroyed or another is placed. This inherits Vulcan's penetrations but does not apply on-hit effects. Inferno Cannon takes 50% additional damage from non-god sources."",""menuitems"":[{""description"":""Ability:"",""value"":""Pet""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""45/70/95/120/145 (+35% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":8609,""Summary"":""Inferno Cannon"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1869_8609.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""50/55/60/65/70"",""description"":""Vulcan tosses a bomb that explodes in a radius on impact with the ground, damaging and knocking back nearby enemies."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/120/170/220/270 (+70% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":9444,""Summary"":""Magma Bomb"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1869_9444.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""80/90/100/110/120"",""description"":""Vulcan launches a rocket that explodes on impact with the ground. The rocket starts at 60% strength, and increases damage the further it travels from Vulcan."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""400/520/640/760/880 (+130% of your Magical Power)""}],""secondaryDescription"":""""}},""Id"":9540,""Summary"":""Earthshaker"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1869_9540.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Whenever Vulcan successfully hits an enemy god with an ability he gains bonuses to Movement Speed and MP5 for 5s."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""}],""rankitems"":[{""description"":""Movement Speed"",""value"":""15%""},{""description"":""MP5:"",""value"":""15""}],""secondaryDescription"":""""}},""Id"":13271,""Summary"":""Master Craftsman"",""URL"":""""},""AttackSpeed"":0.9,""AttackSpeedPerLevel"":0.01,""Cons"":"""",""HP5PerLevel"":0.48,""Health"":380,""HealthPerFive"":7,""HealthPerLevel"":71,""Lore"":""When the Gods of Rome ride chariots across the sky, it is Vulcan that made them. When they reach for weapons to wield in battle, it is Vulcan that forged them. When the very earth rumbles and mountains erupt in searing flame, it is Vulcan’s rage that burns. Smith of the Gods, Vulcan crafts with fire and forge as an artist would with paint and brush.\\n\\nAs an infant, so hideous was Vulcan that his disgusted mother, Juno, cast him into the sea from the heights of Mount Olympus. So great was the fall, it smashed one of Vulcan’s legs, a wound from which he would never recover.  Beneath the waves, a sea nymph, Thetis, rescued the child-god and raised him as her own. As Vulcan grew, he ventured to the surface and discovered fire and the art of smithing. His natural talents emerged and he forged wondrous jewels for his adopted mother.\\n\\nSummoned to a gala on Mount Olympus, Thetis wore Vulcan’s glittering gifts, but when Juno discovered Vulcan had made them, she jealously demanded he return to Mount Olympus. Angrily, Vulcan refused. In his stead, he sent a magnificent throne of gold and gems that imprisoned Juno when she sat upon it.\\n\\nFor three days Juno was so entombed, and would have remained so had not Jupiter, Vulcan’s father, interjected. To Vulcan he offered an exchange, Juno’s freedom for the hand of Venus, the most beautiful Goddess of Love. Vulcan agreed.\\n\\nThough his vengeance was served cold, the fire of spite still burns in Vulcan’s chest. Unable to truly forgive, he loses himself at the forge. None of the wondrous chariots, jewelry or weapons he crafts can ever fill the hurt in his heart, but each one is worthy of a God."",""MP5PerLevel"":0.45,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":170,""MagicalPowerPerLevel"":7.5,""Mana"":245,""ManaPerFive"":4.8,""ManaPerLevel"":40,""Name"":""Vulcan"",""OnFreeRotation"":"""",""Pantheon"":""Roman"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":13,""PhysicalProtectionPerLevel"":3.0,""Pros"":"" High Area Damage, Pusher"",""Roles"":"" Mage"",""Speed"":360,""Title"":""Smith of the Gods"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""7/6.5/6/5.5/5s"",""cost"":""40/45/50/55/60"",""description"":""Vulcan blasts a fireball out of his Forge, pushing him back and dealing damage to all enemies in its path, marking the first god that is hit.  The Inferno Cannon prioritizes the marked target and deals 10% more damage to that god."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile, Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/120/160/200/240 (+80% of your Magical Power)""},{""description"":""Mark Lifetime:"",""value"":""4s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""15s"",""cost"":""65/70/75/80/85"",""description"":""Vulcan constructs an Inferno Cannon that shoots fireballs in a cone that deal damage to the target every second. The Inferno Cannon lasts until destroyed or another is placed. This inherits Vulcan's penetrations but does not apply on-hit effects. Inferno Cannon takes 50% additional damage from non-god sources."",""menuitems"":[{""description"":""Ability:"",""value"":""Pet""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""45/70/95/120/145 (+35% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription3"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""50/55/60/65/70"",""description"":""Vulcan tosses a bomb that explodes in a radius on impact with the ground, damaging and knocking back nearby enemies."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""15""}],""rankitems"":[{""description"":""Damage:"",""value"":""70/120/170/220/270 (+70% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription4"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""80/90/100/110/120"",""description"":""Vulcan launches a rocket that explodes on impact with the ground. The rocket starts at 60% strength, and increases damage the further it travels from Vulcan."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""400/520/640/760/880 (+130% of your Magical Power)""}],""secondaryDescription"":""""}},""abilityDescription5"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Whenever Vulcan successfully hits an enemy god with an ability he gains bonuses to Movement Speed and MP5 for 5s."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""}],""rankitems"":[{""description"":""Movement Speed"",""value"":""15%""},{""