smite/wp-content/uploads/2015/05/1864_8521.jpg""},""Ability_2"":{""Description"":{""itemDescription"":{""cooldown"":""18/17/16/15/14s"",""cost"":""60/65/70/75/80"",""description"":""Xbalanque shoots 10 darts in a cone in front of him, dealing damage with each one.  An enemy can be hit by 3 darts, with the other 2 doing 30% damage.  Enemies hit are poisoned, taking additional damage every .5s and are Slowed."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage per Dart:"",""value"":""30/45/60/75/90 (+40% of your Physical Power)""},{""description"":""Poison Damage:"",""value"":""10/15/20/25/30 (+10% of your Physical Power)""},{""description"":""Poison Slow:"",""value"":""4/8/12/16/20%""},{""description"":""Poison Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":8524,""Summary"":""Poison Darts"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1864_8524.jpg""},""Ability_3"":{""Description"":{""itemDescription"":{""cooldown"":""16s"",""cost"":""60/70/80/90/100"",""description"":""Xbalanque rushes forward and then jumps into the air.  While in the air, he fires darts at all nearby enemies, dealing damage to all in the area.  Any enemies that were poisoned by Xbalanque take additional damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Dash""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Physical""},{""description"":""Radius:"",""value"":""30""}],""rankitems"":[{""description"":""Damage:"",""value"":""80/130/180/230/280 (+30% of your Physical Power)""},{""description"":""Additional Poisoned Damage:"",""value"":""30%""}],""secondaryDescription"":""""}},""Id"":8530,""Summary"":""Rising Jaguar"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1864_8530.jpg""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""100"",""description"":""Xbalanque shrouds enemies in darkness for 3s.  During this time, Xbalanque's Basic Attack range and his movement speed are increased.  At the end of the darkness, any enemy gods moving at the time are Stunned."",""menuitems"":[{""description"":""Ability:"",""value"":""Area""},{""description"":""Affects:"",""value"":""Enemy""}],""rankitems"":[{""description"":""Movement Speed:"",""value"":""20/30/40/50/60%""},{""description"":""Basic Attack Range Increase:"",""value"":""40ft""},{""description"":""Stun:"",""value"":""1.5s""}],""secondaryDescription"":""""}},""Id"":8528,""Summary"":""Darkest of Nights"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1864_8528.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Any enemy gods that Xbalanque kills increases his Physical Power permanently."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Physical Power:"",""value"":""5""},{""description"":""Max Stacks:"",""value"":""6""}],""secondaryDescription"":""""}},""Id"":8534,""Summary"":""Dead of Night"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1864_8534.jpg""},""AttackSpeed"":0.95,""AttackSpeedPerLevel"":0.01,""Cons"":"""",""HP5PerLevel"":0.68,""Health"":455,""HealthPerFive"":8,""HealthPerLevel"":75,""Lore"":""Xbalanque was born with vengeance in his heart.\\n\\nAs one of the Hero Twins, Xbalanque, and his brother Hunahpu, knew their lives would eventually force them to face the Lords of Death, chiefs of the Underworld who murdered their father, but first they would need to master the arts of hunting with blowguns and the violent ball game Pitz.\\n\\nAs a test of their strength, they decided to defeat the vain and evil bird-lord, Seven Macaw, who declared himself the Sun and the Moon and replaced his teeth with glistening jewels.\\n\\nThe Hero Twins fired their blowguns at the perching bird-lord, knocking out several of Seven Macaw’s glittering teeth. Ferociously he came at them, but only snatched Hunahpu and tore off the boy’s arm. Cleverly, the twins enlisted the aid of an elderly couple and advised them to pose as dentists. Seven Macaw sought to ease the pain in his mouth, so, as they were instructed, the dentists pulled the rest of Seven Macaw’s teeth and replaced them with white corn. So humiliated was the great bird that he died of despair.\\n\\nIt would be many years and several trials later that, at last, the Hero Twins were able to challenge the Lords of Death and avenge their father, but their final victory allowed them to ascend to the heavens, where Xbalanque was immortalized as the moon, lighting the night for clever hunters everywhere."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":0,""MagicalPowerPerLevel"":0.0,""Mana"":220,""ManaPerFive"":4.4,""ManaPerLevel"":37,""Name"":""Xbalanque"",""OnFreeRotation"":"""",""Pantheon"":""Mayan"",""PhysicalPower"":37,""PhysicalPowerPerLevel"":2.5,""PhysicalProtection"":12,""PhysicalProtectionPerLevel"":2.9,""Pros"":"" High Single Target Damage, Medium Area Damage"",""Roles"":"" Hunter"",""Speed"":365,""Title"":""Hidden Jaguar Sun"",""Type"":"" Ranged, Physical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":"".5s"",""cost"":""3/6/9/12/15 per shot"",""description"":""When Xbalanque toggles on this ability, his Basic Attacks deal additional damage.  When the bola hits, it splits into 2 that hit enemies up to 30 units behind the target for 30% damage (on-hit effects do not apply). Pressing the ability again cancels toggle."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Affects:"",""value"":""Self""},{""description"":""Damage:"",""value"":""Physical""}],""rankitems"":[{""description"":""Damage:"",""value"":""10/20/30/40/50""}],""sec