ion"":{""cooldown"":""15s"",""cost"":""65/75/85/95/105"",""description"":""Xing Tian leaps forward, dealing damage to enemies when he lands, and he may leap again within 3s. While in the air, Xing Tian has increased protections, which are refreshed if he connects with a target."",""menuitems"":[{""description"":""Ability:"",""value"":""Leap""},{""description"":""Affects:"",""value"":""Self & Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""12""}],""rankitems"":[{""description"":""Damage:"",""value"":""65/85/105/125/145 (30% of your magical power)""},{""description"":""Protections:"",""value"":""10/15/20/25/30 ""},{""description"":""Duration:"",""value"":""3s""}],""secondaryDescription"":""""}},""Id"":13553,""Summary"":""Sky-Cutting Axe"",""URL"":""""},""Ability_4"":{""Description"":{""itemDescription"":{""cooldown"":""90s"",""cost"":""110/100/90/80/70"",""description"":""Xing Tian hits enemies with his axe, hooking them and spinning them on it up to three times in succession, before throwing them."",""menuitems"":[{""description"":""Ability:"",""value"":""Radius""},{""description"":""Affects:"",""value"":""Enemies""},{""description"":""Damage:"",""value"":""Magical""},{""description"":""Radius:"",""value"":""20""}],""rankitems"":[{""description"":""Damage:"",""value"":""25/45/65/85/105 (+35% of your magical power)""}],""secondaryDescription"":""""}},""Id"":11823,""Summary"":""Whirlwind of Rage and Steel"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/08/2072_11823.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""Xing Tian gains stacks of Smouldering Rage each time he hits an enemy with an ability. For each stack of rage Xing Tian has, he gains HP5.\n\nStacks last 18s."",""menuitems"":[{""description"":""Ability:"",""value"":""Passive""}],""rankitems"":[{""description"":""Max Stacks:"",""value"":""12""},{""description"":""HP5 / Stack:"",""value"":""3""}],""secondaryDescription"":""""}},""Id"":11831,""Summary"":""Smouldering Rage"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/08/2072_11831.jpg""},""AttackSpeed"":0.9,""AttackSpeedPerLevel"":0.011,""Cons"":"""",""HP5PerLevel"":0.54,""Health"":495,""HealthPerFive"":5,""HealthPerLevel"":90,""Lore"":""Hear the legends of the headless warrior from the East, for they are not tales of a murderous monster, but a man that would not be undone by defeat or even death.\\n\\nLong ago, three Emperors warred for supremacy over a young nation. Barely clinging to dominance, the Flame Emperor deployed his greatest general, the warrior-poet Xing Tian. Tirelessly he battled the other would-be Emperors but the size of their armies were too great, their weapons too sharp. Xing Tian returned to his lord in defeat but with spirit unbroken. He begged to ride out and meet the enemy once more, but the Flame Emperor refused. His reign was over, his life forfeit to the Yellow Emperor.\\n\\nUnwilling to give in despite the loss of his lord, Xing Tian rallied the Flame Army for a final siege of the Yellow Emperor’s Sky Palace. While the soldiers crashed around them, Xing Tian met the Yellow Emperor in single combat, the two titans trading blows up the upon the mountaintop. High upon the snow-capped peak the Yellow Emperor’s blade struck true, beheading Xing Tian.\\n\\nWas it days that passed, or years? It is unknown, but there, at the base of the mountain, Xing Tian awoke. A new face burned from his chest. The fire to battle renewed, the now headless Xing Tian rose to fight again.\\n\\nFor Xing Tian there is no defeat; there is no death. As long as there is a battle to be fought he will never surrender. And he will never die."",""MP5PerLevel"":0.45,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":175,""MagicalPowerPerLevel"":7.75,""Mana"":200,""ManaPerFive"":4.5,""ManaPerLevel"":40,""Name"":""Xing Tian"",""OnFreeRotation"":"""",""Pantheon"