{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""All of Ymir's abilities that affect enemies apply a Debuff to the enemy called Frostbite. All of Ymir's Basic Attacks against a target afflicted by Frostbite do 100% more damage. Enemies afflicted by Frostbite deal 10% less damage. Lasts for 4s."",""menuitems"":[{""description"":""Ability:"",""value"":""Buff""},{""description"":""Damage Reduction:"",""value"":""!{rankprog:10}!%""},{""description"":""Affects:"",""value"":""Self""}],""rankitems"":[{""description"":""Frostbite Damage Bonus:"",""value"":""100%""}],""secondaryDescription"":""""}},""Id"":7553,""Summary"":""Frostbite"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1670_7553.jpg""},""AttackSpeed"":0.85,""AttackSpeedPerLevel"":0.01,""Cons"":"""",""HP5PerLevel"":0.9,""Health"":510,""HealthPerFive"":8,""HealthPerLevel"":104,""Lore"":""As far as it is known, Ymir has long been dead.\\n\\nIn Midgard, in the North, it is believed that Ymir’s skull is the sky, his flesh the earth, and his blood the sea. Though, these claims could merely be the boasting of proud Odin and his brothers, who take credit for slaying the first jotunn and fashioning the earth from his body parts.\\n\\nAt the beginning of time, the Realm of Fire, Muspell, and the Realm of Ice, Niflheim met at the place called Ginnungagap; the void of space. Steam rose and froze again, and from that primordial mixture, Ymir, King of the Frost Giants took shape. From his body dripped other beings that would become the ancestors of Gods, Men, Dwarves, and of course, Giants. Even the mighty Odin must claim Ymir as his grandfather. Yet Ymir, like all giants, was an evil creature and led his Giant brethren against the Gods. After ages of warfare, Odin and his brothers slew the Giant-King and forged the world from his remains.\\n\\nYet there are other whispers. Rumors that Ymir, though not a God, was still a Primeval Being, and as such cannot truly be destroyed. Perhaps he only lies dormant in Niflheim, the realm of ice, eager to return and wreak vengeance upon Odin in his kin."",""MP5PerLevel"":0.4,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":190,""MagicalPowerPerLevel"":7.75,""Mana"":200,""ManaPerFive"":4.5,""ManaPerLevel"":32,""Name"":""Ymir"",""OnFreeRotation"":"""",""Pantheon"":""Norse"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":23,""PhysicalProtectionPerLevel"":3.3,""Pros"":"" High Crowd Control, High Defense"",""Roles"":"" Guardian"",""Speed"":360,""Title"":""Father of the Frost Giants"",""Type"":"" Melee, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""14s"",""cost"":""60/65/70/75/80"",""description"":""Ymir summons a wall of ice out of the ground that blocks player movement."",""menuitems"":[{""description"":""Ability:"",""value"":""Ground Target""},{""description"":""Affects:"",""value"":""All""}],""rankitems"":[{""description"":""Lifetime:"",""value"":""2/3/4/5/6s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""8s"",""cost"":""55/60/65/70/75"",""description"":""Ymir smashes his club, doing damage to all enemies in front of him and Slowing them. Applies Frostbite."",""menuitems"":[{""description"":""Ability:"",""value"":""Line""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""90/160/230/300/370 (+70% of your Magical Power)""},{""description"":""Slow:"",""value"":""35%""},{""description"":""Slow Duration:"",""value"":""4s""}],""secondaryDescription"":""""}},""abilityDescription3"":{""itemDescription"":{""cooldown"":""18s"",""cost"":""60/65/70/75/80"",""description"":""Ymir uses his breath to freeze enemies in blocks of ice, doing damage and Stunning them.  Applies Frostbite."",""menuitems"":[{""description"":""Ability:"",""value"":""Cone""},{""description"":""Affects:"",""value"":""Ene