"5s""}],""secondaryDescription"":""""}},""Id"":7313,""Summary"":""Lightning Storm"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1672_7313.jpg""},""Ability_5"":{""Description"":{""itemDescription"":{""cooldown"":"""",""cost"":"""",""description"":""In hand lightning bolt attacks against enemies will apply a charge.  Basic Attacks against targets with charges deal increased damage."",""menuitems"":[{""description"":""Ability:"",""value"":""Debuff""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage Increase per Charge:"",""value"":""30%""}],""secondaryDescription"":""""}},""Id"":7554,""Summary"":""Overcharge"",""URL"":""https://web2.hirez.com/smite/wp-content/uploads/2015/05/1672_7554.jpg""},""AttackSpeed"":0.87,""AttackSpeedPerLevel"":0.009,""Cons"":"""",""HP5PerLevel"":0.45,""Health"":380,""HealthPerFive"":6,""HealthPerLevel"":71,""Lore"":""King of Gods, Zeus strives for fairness and justice, but will not hesitate to call down the thunder when there’s smiting to be done!\\n\\nZeus’ father, the Titan Cronus, immediately swallowed his children after birth so that none could overthrow him as he had his own father. When Zeus was born, Rhea, Zeus’ mother, hid the child from Cronus and gave the Titan a rock in swaddling clothes, which he swallowed instead. In secret, Zeus grew up on the isle of Crete until he was old and strong enough to challenge his father. During their battle, Zeus slit open Cronus’ stomach, allowing his swallowed brothers and sisters to escape, slaying the Titan. Then, Zeus released the Cyclops and other beings Cronus had kept imprisoned. In gratitude, the Cyclops awarded Zeus control over lightning.\\n\\nWith his two brothers, Poseidon and Hades, the three Gods drew lots to decide command of creation. Poseidon became king of the sea, Hades the underworld, and Zeus the sky. From his golden throne atop Mount Olympus, Zeus now rules Gods and Men with his wife Hera, upholding justice, hospitality, oaths, and honesty to all under his domain.\\n\\nYet, Zeus is a restless God, and while he holds high expectations for others, he does not keep those standards for himself. Chiefly, Zeus is nearly infamous for several infidelities to his wife which have resulted in dozens of children beget by other women, most famous of which are Hercules, Artemis, and Athena. Such wanton unfaithfulness is the source of great jealousy from Hera, though as King, Zeus can ultimately do as he wishes.\\n\\nWeather is dictated by the Thunder God’s mood. When in a fair temperament, the sky is clear, bright and warm. When Zeus’ anger flares, black clouds roll in, lightning streaks the sky and thunder shakes the very ground. Lately, Zeus has been furious."",""MP5PerLevel"":0.45,""MagicProtection"":30,""MagicProtectionPerLevel"":0.0,""MagicalPower"":175,""MagicalPowerPerLevel"":7.5,""Mana"":245,""ManaPerFive"":4.6,""ManaPerLevel"":44,""Name"":""Zeus"",""OnFreeRotation"":"""",""Pantheon"":""Greek"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":8,""PhysicalProtectionPerLevel"":2.7,""Pros"":"" High Area Damage"",""Roles"":"" Mage"",""Speed"":355,""Title"":""God of the Sky"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""50/55/60/65/70"",""description"":""Zeus fires a bolt of lightning that arcs between enemies, doing damage and applying a charge on each hit."",""menuitems"":[{""description"":""Ability:"",""value"":""Projectile""},{""description"":""Affects:"",""value"":""Enemy""},{""description"":""Damage:"",""value"":""Magical""}],""rankitems"":[{""description"":""Damage:"",""value"":""40/70/100/130/160 (+40% of your Magical Power)""},{""description"":""Arcs:"",""value"":""4""},{""description"":""Slow:"",""value"":""30% for 2s""}],""secondaryDescription"":""""}},""abilityDescription2"":{""itemDescription"":{""cooldown"":""10s"",""cost"":""60/65/70/