eedPerLevel"":0.009,""Cons"":"""",""HP5PerLevel"":0.44,""Health"":450,""HealthPerFive"":6,""HealthPerLevel"":85,""Lore"":""In this world resides powerful evil, intent on destroying everything crafted by Gods and Men. Without guardians of equal strength, all would have fallen long ago. Zhong Kui was once a man with ambitions no greater than scholastic excellence, but in death became the perfect shield against evil’s onslaught.\\n\\nZhong Kui sought to pit his brilliant mind against the Imperial Examinations, tests to select councilors for the Emperor. With ease, he passed, but when the emperor saw his hideous face, he cast the scholar out. Offended, furious, Zhong Kui hurled himself repeatedly at the palace gates until his body was broken.\\n\\nFor his crime, Zhong Kui’s soul was judged by the King of Hell, but where the Emperor saw only ugliness, the King of Hell saw potential armed with genius. Zhong Kui was appointed Lord of Demons, tasked to forever hunt and ensnare the evils of the world.\\n\\nFor centuries, home owners and shopkeepers have adorned their buildings with Zhong Kui’s likeness, for that visage that once horrified the emperor now glares with purpose at unwelcome demons. Yet these days, it is not just shops and homes in peril, but the whole world. It does not take a mind like Zhong Kui’s to see evil’s hand in this War of the Gods. The time has come to bring these demons to task, and Zhong Kui means to smite them all."",""MP5PerLevel"":0.45,""MagicProtection"":30,""MagicProtectionPerLevel"":0.9,""MagicalPower"":165,""MagicalPowerPerLevel"":7.5,""Mana"":250,""ManaPerFive"":4.8,""ManaPerLevel"":47,""Name"":""Zhong Kui"",""OnFreeRotation"":"""",""Pantheon"":""Chinese"",""PhysicalPower"":0,""PhysicalPowerPerLevel"":0.0,""PhysicalProtection"":8,""PhysicalProtectionPerLevel"":2.6,""Pros"":"" High Area Damage, Medium Crowd Control"",""Roles"":"" Mage"",""Speed"":360,""Title"":""the Demon Queller"",""Type"":"" Ranged, Magical"",""abilityDescription1"":{""itemD